INSERT INTO `movies` VALUES ('2024-04-07 20:24:07.636046','2024-04-07 20:24:07.636046',11776,'Люди Икс 2',2003,'Мутанты продолжают борьбу против общества, которое страшит их, и которому они не доверяют. Их положение становится еще более отчаянным, когда они подвергаются мощной атаке неизвестного противника, обладающего экстраординарными способностями. \n\nВнезапное нападение снова становится причиной политического и общественного резонанса по поводу введения повсеместной регистрации мутантов и причиной образования движения против мутантов, возглавляемого Уильямом Страйкером, бывшим военным, который, по слухам, проводил опыты над мутантами.',134,'110000000 $',12,298,7.562,7.4,'https://image.openmoviedb.com/kinopoisk-images/1600647/417ac3c9-16ad-4b0d-bdd8-33f6fef9fa85/orig','movie'),('2024-04-07 20:24:08.355358','2024-04-07 20:24:08.356366',11777,'Матрица: Перезагрузка',2003,'Борцы за свободу Нео, Тринити и Морфеус продолжают руководить восстанием людей против армии машин. Они вынуждены использовать не только арсенал превосходного оружия, но и свои выдающиеся навыки. Участие в миссии по спасению человеческой расы от истребления приносит им более глубокое понимание Матрицы и осознание центральной роли Нео в судьбе человечества.',138,'150000000 $',18,299,7.737,7.2,'https://image.openmoviedb.com/kinopoisk-images/4774061/a53d1c75-4d1a-4c86-a936-65b2a724345c/orig','movie'),('2024-04-07 20:24:08.955565','2024-04-07 20:24:08.955565',11778,'Лиззи Магуайр',2003,'Тринадцатилетняя школьница Лиззи Магуайер и ее приятели Гордо, Кейт и Эсан собираются оттянуться по полной программе во время их поездки с классом в Италию.\n\nНо там случается весьма неожиданное происшествие: девочку ошибочно принимают за итальянскую поп-звезду Изабеллу, да к тому же девушка влюбляется в бывшего дружка Изабеллы Паоло. Когда родители Лизи обо всем узнают, они вместе с ее братом Мэттом срочно вылетают в Италию.\n\nНо Лиззи уже не та закомплексованная девочка-подросток, кем была раньше, она до такой степени вжилась в роль певицы, что и на самом деле стала самой настоящей звездой.',94,'17000000 $',12,300,6.314,5.5,'https://image.openmoviedb.com/kinopoisk-images/4303601/a60e881c-c989-4a26-bbaf-c8323ffbf600/orig','movie'),('2024-04-07 20:24:09.642585','2024-04-07 20:24:09.643585',11779,'Матрица',1999,'Жизнь Томаса Андерсона разделена на две части: днём он — самый обычный офисный работник, получающий нагоняи от начальства, а ночью превращается в хакера по имени Нео, и нет места в сети, куда он бы не смог проникнуть. Но однажды всё меняется. Томас узнаёт ужасающую правду о реальности.',136,'63000000 $',18,301,8.497,8.7,'https://image.openmoviedb.com/kinopoisk-images/4774061/cf1970bc-3f08-4e0e-a095-2fb57c3aa7c6/orig','movie'),('2024-04-07 20:24:10.306725','2024-04-07 20:24:10.306725',11780,'Клад',2003,'На семье подростка по имени Стенли Илнетс (прочтите фамилию наоборот!) лежит древнее проклятие. Все его предки по мужской линии были обречены попадать в самые невероятные жизненные переделки. Вот и Стенли получает срок в исправительном трудовом лагере «Зелёное озеро» за преступление, которое он не совершал.\r Администрация лагеря в лице хищной начальницы и жестокого старшего надзирателя заставляет своих подопечных ежедневно копать в пустыне странные ямы, называя это «трудовой терапией». Никто из этих ребят не знает, зачем на самом деле они роют все эти ямы…  Чтобы выяснить истинную цель раскопок, несколько ребят решают совершить дерзкий побег из лагеря. Вскоре они узнают, что по преданию во времени освоения Дикого Запада в этих местах орудовала банда знаменитой разбойницы Кейт Барлоу по прозвищу Кейт-Поцелуй. Эту кличку она получила за то, что целовала свои жертвы перед смертью, оставляя на их лицах следы яркой помады.',117,'20000000 $',12,302,7.225,7,'https://image.openmoviedb.com/kinopoisk-images/1900788/9212f7c7-78b1-45ab-964d-f92cc84056ff/orig','movie'),('2024-04-07 20:24:10.979522','2024-04-07 20:24:10.979522',11781,'Управление гневом',2003,'Скромному клерку отчаянно не везет. Парня по обвинению в нападении на бортпроводницу приговаривают к лечению у психиатра. Но верно говорят, что большинство психиатров сами немного безумны. Или сильно не в себе...',106,'75000000 $',18,303,7.144,6.2,'https://image.openmoviedb.com/kinopoisk-images/1704946/872aff12-e80f-4c75-ac64-b139c46b78eb/orig','movie'),('2024-04-07 20:24:11.587135','2024-04-07 20:24:11.587135',11782,'Афера',2003,'Джейк Вига – хитроумный и обаятельный мошенник. Последняя афера Джейка привела к тому, что его дорожки пересеклись с мафией – при помощи своей команды он лишил нескольких тысяч долларов Лайонела Долби, – счетовода эксцентричного мафиозного босса Уинстона Кинга по прозвищу «Король».\n\nМафия шутить не любит, а любит выбивать долги из тех, кто пытается ее надуть. Чтобы сохранить жизнь и расквитаться с долгами, Джейку приходится устроить новую, еще более изощренную аферу – сложнейшую схему, в которой требуется «творческий подход к бухгалтерии».\n\nНеожиданные помехи появляются одна за другой: палки в колеса Джейку вставляют его старый враг, агент ФБР Гюнтер Бутан, Трэвис, правая рука «Короля» и хитроумная карманщица Лили на которую Джейк успел положить глаз...',97,'15000000 $',18,304,7.022,6.6,'https://image.openmoviedb.com/kinopoisk-images/9784475/7329ddfa-afd1-429a-8f05-94dbf7f51779/orig','movie'),('2024-04-07 20:24:12.243869','2024-04-07 20:24:12.243869',11783,'Телефонная будка',2002,'Один телефонный звонок может изменить всю жизнь человека или даже оборвать ее. Герой фильма Стью Шеферд становится пленником телефонной будки.\n\nЧто вы сделаете, если услышите, как в телефонной будке зазвонил телефон? Скорее всего, инстинктивно поднимете трубку, хотя прекрасно знаете, что кто-то просто ошибся номером. Вот и Стью кажется, что на звонок надо обязательно ответить, а в результате он оказывается втянутым в чудовищную игру. «Только положи трубку, и ты – труп», – говорит ему невидимый собеседник.',81,'13000000 $',18,305,7.644,7.1,'https://image.openmoviedb.com/kinopoisk-images/1704946/576d69f2-63f6-4770-afb7-d11fd6778fe9/orig','movie'),('2024-04-07 20:24:12.800321','2024-04-07 20:24:12.800321',11784,'Рекрут',2003,'Джеймс Клэйтон - студент и опытный хакер. Он привлекает внимание спецслужб, и его вербуют в ЦРУ, упоминая таинственное исчезновение его отца в 90-х. Джеймс обучается у Уолтера Бёрка. Он отлично сдает все тесты, кроме последнего. Так он становится агентом без прикрытия и получает задание: найти «крота», который похищает опасный вирус из Лэнгли.',115,'46000000 $',18,306,7.331,6.6,'https://image.openmoviedb.com/kinopoisk-images/1704946/72dd6b1b-82d9-4c08-8d44-bbed18a5abbb/orig','movie'),('2024-04-07 20:24:13.400854','2024-04-07 20:24:13.400854',11785,'Разыскиваются в Малибу',2003,'Не стоит ненавидеть его за то, кем он является. Или кем он не является. Все, чем хочет заниматься Брэд - или Би-рэд - разъезжать со своими дружками по Малибу и вести себя, как самый крутой черный рэппер в округе.\n\nНо все вокруг знают, что паренек, лихо читающий рэп, родом из респектабельного квартала Малибу. И отец Брэда, Билл Глакман, кандидат в губернаторы, серьезно боится, что увлечение Би-рэда «черной» культурой может разнести в пух и прах его предвыборную кампанию.',86,'15000000 $',12,307,5.713,5.2,'https://image.openmoviedb.com/kinopoisk-images/1900788/f5f5630b-3439-4b08-9f12-be0cb714754d/orig','movie'),('2024-04-07 20:24:13.962546','2024-04-07 20:24:13.962546',11786,'Тупой и еще тупее тупого: Когда Гарри встретил Ллойда',2003,'Как же встретились два героя-недоумка Гарри и Ллойд, известные по фильму «Тупой и еще тупее»? Оба несколько лет не ходили в школу, а учились на дому. Пришло время отправляться в школу, и прямо на улице Гарри и Ллойд столкнулись лбами...\n\nА в это время школьный директор Коллинз и мисс Хеллер, буфетчица-официантка школьной столовой, задумали провернуть аферу - получить благотворительную премию в сто тысяч долларов за организацию класса для умственно отсталых. Злоумышленники решили создать липовый класс. Два кандидата в спецкласс нашлись сразу - Гарри и Ллойд, а они разыскали остальных...',85,'19000000 $',16,308,4.26,3.4,'https://image.openmoviedb.com/kinopoisk-images/1704946/32fc0c97-23a8-411a-ab0b-b2dd36c6e93f/orig','movie'),('2024-04-07 20:24:15.181334','2024-04-07 20:24:15.181334',11787,'Эквилибриум',2002,'В будущем люди лишены возможности выражать эмоции. Это цена, которую человечество платит за устранение из своей жизни войны. Теперь книги, искусство и музыка находятся вне закона, а любое чувство — преступление, наказуемое смертью.\n\nДля приведения в жизнь существующего правила используется принудительное применение лекарства прозиум. Правительственный агент Джон Престон борется с теми, кто нарушает правила. В один прекрасный момент он забывает принять очередную дозу лекарства, и с ним происходит духовное преображение, что приводит его к конфликту не только с режимом, но и с самим собой.',107,'20000000 $',18,309,7.885,7.3,'https://image.openmoviedb.com/kinopoisk-images/1900788/81852081-e0b8-4769-9756-45bbdc0bda1a/orig','movie'),('2024-04-07 20:24:15.819907','2024-04-07 20:24:15.819907',11788,'Дежурный папа',2003,'Чарли и Фила увольняют с работы в крупной корпорации. Теперь им самим придётся сидеть со своими сыновьями, так как оплачивать счета дорогостоящего детского центра уже не на что. Промучившись пару недель со своими отпрысками, папаши так увлекаются этим делом, что решают поставить дело на деловые рельсы и открывают новый центр дневного пребывания для детей. \r\n\r\nЧарли и Филл находят всё новые и новые нетрадиционные и забавные способы воспитательного воздействия на малышей, и центр «Дежурный папа» становится всё более популярным. Почувствовав жёсткое соперничество со стороны усатых няней, директриса дорогого детского центра решает выжить конкурентов-новичков из бизнеса.',89,'60000000 $',6,310,6.824,5.6,'https://image.openmoviedb.com/kinopoisk-images/4303601/3b89ac83-9a8a-47a5-996f-f3f99d8d93d7/orig','movie'),('2024-04-07 20:24:16.398827','2024-04-07 20:24:16.398827',11789,'Пуленепробиваемый',2003,'Монах-мастер боевых искусств охраняет древний свиток — артефакт, содержащий ключ к безграничной власти. Монаху нужно найти следующего хранителя, и поиски приводят его в Америку. Согласно древнему пророчеству и к изумлению Монаха его преемником оказывается обаятельный хулиган по имени Кар. Пока Монах обучает Кара, обоим приходится защищать свиток от одержимого жаждой власти человека, который гоняется за ним 60 лет.',104,'52000000 $',12,311,6.68,5.4,'https://image.openmoviedb.com/kinopoisk-images/1900788/f7e87d4d-5ed8-4dc7-b24c-a0d3d8f3132e/orig','movie'),('2024-04-07 20:24:17.054067','2024-04-07 20:24:17.054067',11790,'Властелин колец: Две крепости',2002,'Братство распалось, но Кольцо Всевластья должно быть уничтожено. Фродо и Сэм вынуждены довериться Голлуму, который взялся провести их к вратам Мордора. Громадная армия Сарумана приближается: члены братства и их союзники готовы принять бой. Битва за Средиземье продолжается.',179,'94000000 $',12,312,8.607,8.8,'https://image.openmoviedb.com/kinopoisk-images/6201401/772093e4-7f68-49aa-a805-d654693aee26/orig','movie'),('2024-04-07 20:24:17.732089','2024-04-07 20:24:17.732089',11791,'Играй, как Бекхэм',2002,'Джесс только 18, но она твердо знает, что сделает ее счастливой: футбольная карьера, такая же, как у знаменитого игрока «Манчестер Юнайтед» Дэвида Бекхема. Пока она гоняет мяч в лондонском парке, доказывая соседским мальчишкам, что девушки играют в футбол не хуже, ее родители и многочисленные родственники, как и положено традиционной индийской семье, подыскивают для нее достойного мужа и строят планы о ее будущей карьере юриста.\n\nОднажды, во время очередной разминки, Джесс знакомится с Джулз и та приглашает ее на тренировку в женскую футбольную секцию. С замиранием сердца она следует за своей новой приятельницей, и мечта становится реальностью: Джесс принимают в настоящую футбольную команду. В довершение ко всему она влюбляется в своего тренера Джо.\n\nПонимая, что семья никогда не примирится с ее выбором, Джесс наслаждается своим кратковременным счастьем и готовится отстаивать свои права до конца...',112,'3500159 £',18,313,6.734,6.7,'https://image.openmoviedb.com/kinopoisk-images/9784475/d4b94226-64ce-42f4-abfc-f22d322d94ed/orig','movie'),('2024-04-07 20:24:18.476455','2024-04-07 20:24:18.476455',11792,'Цыпочка',2002,'Популярная, но неприятная в общении старшеклассница Джессика однажды утром просыпается в теле 30-летнего мужчины с не самой привлекательной внешностью. Девушка отправляется на поиски своего тела, и это приключение помогает ей увидеть себя со стороны и понять, насколько поверхностной и недалёкой она была.',104,'{}',18,314,6.865,5.6,'https://image.openmoviedb.com/kinopoisk-images/4303601/d0ab64df-98f0-4e49-aa30-62f4853b9de7/orig','movie'),('2024-04-07 20:24:19.343119','2024-04-07 20:24:19.343119',11793,'Матрица: Революция',2003,'Пока армия машин пытается уничтожить Зион, его жители из последних сил держат оборону.',129,'150000000 $',18,316,7.626,6.7,'https://image.openmoviedb.com/kinopoisk-images/1900788/37fc55e7-dfc7-406f-a187-17ef49f65b6f/orig','movie'),('2024-04-07 20:24:19.987428','2024-04-07 20:24:19.987428',11794,'Любовь с уведомлением',2002,'Джордж Уэйд и шага не может сделать без Люси Келсон, работающей главным консультантом в его корпорации. Однако обращается он с ней скорее как с няней, а не как с блестящим юристом, окончившим Гарвард. По прошествии года все это надоедает Люси, и она решает уволиться. Джордж соглашается ее отпустить, но с одним условием — она должна найти себе достойную замену...',101,'60000000 $',16,317,7.076,6.1,'https://image.openmoviedb.com/kinopoisk-images/1704946/6c497136-1416-496d-814d-a86acce5af18/orig','movie'),('2024-04-07 20:24:20.589145','2024-04-07 20:24:20.589145',11795,'Ограбление по-итальянски',2003,'Джон Бриджер всегда умел спланировать идеальное ограбление. Вместе со своей командой опытных бандитов он провернул не одно дело, но теперь решил уйти на покой. Впереди у Бриджера последнее задание: кража золотых слитков, в которой принимают участие инсайдер Стив, водитель Роб, взрыватель Левое ухо, технарь Лайл и Чарли - верный друг Бриджера и второй «планировщик» в их команде. Ограбление, изящное и быстрое, было разыграно как по нотам, но после его завершения веселье преступников было омрачено предательством...',111,'60000000 $',12,318,7.577,7,'https://image.openmoviedb.com/kinopoisk-images/1599028/7673fc11-be11-45f7-a997-f757a04b0cd9/orig','movie'),('2024-04-07 20:24:21.390175','2024-04-07 20:24:21.390175',11796,'Терминатор 3: Восстание машин',2003,'Прошло десять лет с тех пор, как Джон Коннор помог предотвратить Судный День и спасти человечество от массового уничтожения. Теперь ему 25, Коннор не живет «как все» - у него нет дома, нет кредитных карт, нет сотового телефона и никакой работы.\n\nЕго существование нигде не зарегистрировано. Он не может быть прослежен системой Skynet - высокоразвитой сетью машин, которые когда-то попробовали убить его и развязать войну против человечества. Пока из теней будущего не появляется T-X - Терминатрикс, самый сложный киборг-убийца Skynet.\n\nПосланная назад сквозь время, чтобы завершить работу, начатую её предшественником, T-1000, эта машина так же упорна, как прекрасен её человеческий облик. Теперь единственная надежда Коннору выжить - Терминатор, его таинственный прежний убийца. Вместе они должны одержать победу над новыми технологиями T-X и снова предотвратить Судный День...',109,'200000000 $',18,319,6.774,6.3,'https://image.openmoviedb.com/kinopoisk-images/1599028/eb157a95-c1fa-4426-8eab-90653e848923/orig','movie'),('2024-04-07 20:24:22.064429','2024-04-07 20:24:22.064429',11797,'25-й час',2002,'В фильме описывается последний день свободной жизни молодого бруклинца Монти Брогана (Эдвард Нортон), осужденного на семь лет тюрьмы за торговлю наркотиками. Оставшиеся 24 часа он проводит в компании своих родных, друзей, деловых партнеров и любимой девушки Натурель.\n\nМонти, мечтавший в свое время стать пожарным, но в итоге ступивший на роковую стезю наркодилера, прощается с прошлым и пытается переосмыслить свою жизнь...',135,'5000000 $',18,320,7.548,7.6,'https://image.openmoviedb.com/kinopoisk-images/1773646/36278095-3e97-47ba-8cdb-b07466598be8/orig','movie'),('2024-04-07 20:24:22.574439','2024-04-07 20:24:22.574439',11798,'Звездный путь: Возмездие',2002,'После свадьбы командира Уильяма Райкера и советника Дианы Трой экипаж корабля «Энтерпрайз» обнаруживает позитронный сигнал на одной из планет около нейтральной зоны, где они находят B-4 — менее совершенный, чем Дейта, прототип андроида, созданного доктором Сунгом.\n\nЭта загадка остается неразгаданной, так как в то же время адмирал Джейнвей приказывает «Энтерпрайзу» отправиться к Ромулу, где сенат был свергнут в результате государственного переворота Шинзоном и его последователями. По прибытии на Ромул «Энтерпрайз» обнаруживает не только самый мощный из всех встреченных ими кораблей, но и страшную тайну, касающуюся нового лидера Ромуланской империи, который планирует использовать смертельное оружие для уничтожения всего живого на главной планете Федерации — Земле.',116,'60000000 $',12,321,6.721,6.4,'https://image.openmoviedb.com/kinopoisk-images/4303601/edcf17bd-0972-4f71-9fb3-733ba2dda00b/orig','movie'),('2024-04-07 20:24:23.263429','2024-04-07 20:24:23.263429',11799,'Гарри Поттер и узник Азкабана',2004,'В третьей части истории о юном волшебнике полюбившиеся всем герои — Гарри Поттер, Рон и Гермиона — возвращаются уже на третий курс школы чародейства и волшебства Хогвартс. На этот раз они должны раскрыть тайну узника, сбежавшего из зловещей тюрьмы Азкабан, чье пребывание на воле создает для Гарри смертельную опасность...',142,'130000000 $',12,322,8.231,7.9,'https://image.openmoviedb.com/kinopoisk-images/4303601/3eabac99-fb98-4b12-ba9f-6172782d54c6/orig','movie'),('2024-04-07 20:24:23.898715','2024-04-07 20:24:23.898715',11800,'Двойной форсаж',2003,'Бывший полицейский Брайан О`Коннер с напарником Романом Пирсом собирается перевезти крупную сумму грязных денег известного мафиози Картера Верона. Но на самом деле эта работа является только прикрытием для Брайана, который вместе с тайным агентом Моникой Фуэнтес должен уличить изворотливого преступника.',107,'76000000 $',12,323,7.188,5.9,'https://image.openmoviedb.com/kinopoisk-images/6201401/a7de8b77-34a0-4b22-9574-acec6c689958/orig','movie'),('2024-04-07 20:24:24.541587','2024-04-07 20:24:24.541587',11801,'Поймай меня, если сможешь',2002,'Фрэнк Эбегнейл успел поработать врачом, адвокатом и пилотом на пассажирской авиалинии – и все это до достижения полного совершеннолетия в 21 год. Мастер в обмане и жульничестве, он также обладал искусством подделки документов, что в конечном счете принесло ему миллионы долларов, которые он получил по фальшивым чекам.\n\nАгент ФБР Карл Хэнрэтти отдал бы все, чтобы схватить Фрэнка и привлечь к ответственности за свои деяния, но Фрэнк всегда опережает его на шаг, заставляя продолжать погоню.',141,'52000000 $',18,324,8.53,8.1,'https://image.openmoviedb.com/kinopoisk-images/1704946/e38dd6f9-610e-4c90-8540-dc48560cb9cc/orig','movie'),('2024-04-07 20:24:25.172782','2024-04-07 20:24:25.172782',11802,'Крестный отец',1972,'Криминальная сага, повествующая о нью-йоркской сицилийской мафиозной семье Корлеоне. Фильм охватывает период 1945-1955 годов.\n\nГлава семьи, Дон Вито Корлеоне, выдаёт замуж свою дочь. В это время со Второй мировой войны возвращается его любимый сын Майкл. Майкл, герой войны, гордость семьи, не выражает желания заняться жестоким семейным бизнесом. Дон Корлеоне ведёт дела по старым правилам, но наступают иные времена, и появляются люди, желающие изменить сложившиеся порядки. На Дона Корлеоне совершается покушение.',175,'6000000 $',18,325,8.705,9.2,'https://image.openmoviedb.com/kinopoisk-images/1599028/c11652e8-653b-47c1-8e72-1552399a775b/orig','movie'),('2024-04-07 20:24:25.738420','2024-04-07 20:24:25.738420',11803,'Побег из Шоушенка',1994,'Бухгалтер Энди Дюфрейн обвинён в убийстве собственной жены и её любовника. Оказавшись в тюрьме под названием Шоушенк, он сталкивается с жестокостью и беззаконием, царящими по обе стороны решётки. Каждый, кто попадает в эти стены, становится их рабом до конца жизни. Но Энди, обладающий живым умом и доброй душой, находит подход как к заключённым, так и к охранникам, добиваясь их особого к себе расположения.',142,'25000000 $',18,326,9.109,9.3,'https://image.openmoviedb.com/kinopoisk-images/1599028/0b76b2a2-d1c7-4f04-a284-80ff7bb709a4/orig','movie'),('2024-04-07 20:24:26.247115','2024-04-07 20:24:26.247115',11804,'Крестный отец 2',1974,'Для дона Корлеоне и его сына не существует моральных преград на пути к достижению целей. Они превращают мафию, построенную по патриархальным сицилийским законам, в весьма прагматичную, жесткую корпорацию, плавно интегрируя её в большой бизнес Америки.',202,'13000000 $',18,327,8.53,9,'https://image.openmoviedb.com/kinopoisk-images/1599028/33474b2a-d670-47c8-9cbe-51291847b6d4/orig','movie'),('2024-04-07 20:24:26.804008','2024-04-07 20:24:26.804008',11805,'Властелин колец: Братство Кольца',2001,'Сказания о Средиземье &#151; это хроника Великой войны за Кольцо, длившейся не одну тысячу лет. Тот, кто владел Кольцом, получал неограниченную власть, но был обязан служить злу. \nТихая деревня, где живут хоббиты. Придя на 111-й день рождения к своему старому другу Бильбо Бэггинсу, волшебник Гэндальф начинает вести разговор о кольце, которое Бильбо нашел много лет назад. Это кольцо принадлежало когда-то темному властителю Средиземья Саурону, и оно дает большую власть своему обладателю. Теперь Саурон хочет вернуть себе власть над Средиземьем. Бильбо отдает Кольцо племяннику Фродо, чтобы тот отнёс его к Роковой Горе и уничтожил.',178,'93000000 $',12,328,8.611,8.9,'https://image.openmoviedb.com/kinopoisk-images/6201401/a2d5bcae-a1a9-442f-8195-f5373a5ba77f/orig','movie'),('2024-04-07 20:24:27.448899','2024-04-07 20:24:27.448899',11806,'Список Шиндлера',1993,'Фильм рассказывает реальную историю загадочного Оскара Шиндлера, члена нацистской партии, преуспевающего фабриканта, спасшего во время Второй мировой войны почти 1200 евреев.',195,'22000000 $',18,329,8.846,9,'https://image.openmoviedb.com/kinopoisk-images/6201401/1e1ac6d9-c658-4f5f-937e-d080bca0d893/orig','movie'),('2024-04-07 20:24:28.113668','2024-04-07 20:24:28.113668',11807,'Касабланка',1942,'Оставивший родину американец Рик Блейн, владелец игорного клуба в Касабланке, встречается с покинувшей его несколько лет назад возлюбленной Ильзой, которая приехала в город вместе со своим мужем — борцом антифашистского сопротивления Виктором Лазло. По их следу идут немцы, и Ильза пытается упросить Рика отдать принадлежащие ему важные документы, которые позволят Виктору бежать из Касабланки и продолжить борьбу.',103,'950000 $',12,330,8.026,8.5,'https://image.openmoviedb.com/kinopoisk-images/1599028/1d316279-1d2c-4919-b210-83fe3510e529/orig','movie'),('2024-04-07 20:24:28.688780','2024-04-07 20:24:28.688780',11808,'Гражданин Кейн',1941,'В шикарном поместье умирает газетный магнат Чарльз Фостер Кейн, роняя лишь одно слово: «Роузбад». Смерть Кейна вызывает бурную реакцию в обществе, и группа журналистов берётся узнать, кем же он был на самом деле, что он пережил за свою долгую, полную взлётов и падений, жизнь... И что всё-таки значит «Роузбад»?',119,'839727 $',12,331,7.756,8.3,'https://image.openmoviedb.com/kinopoisk-images/1704946/7d2f812d-8713-48fa-b12f-a72e3956b1bf/orig','movie'),('2024-04-07 20:24:29.212826','2024-04-07 20:24:29.212826',11809,'Семь самураев',1954,'Япония, XVI век. В стране полыхает гражданская война, повсюду орудуют банды разбойников и мародеров. Бедные крестьяне нанимают для защиты деревни семерых самураев, которые немного сплачивают раздробленных и малодушных селян в процессе подготовки и укрепления деревни.',207,'500000 $',16,332,8.162,8.6,'https://image.openmoviedb.com/kinopoisk-images/1704946/9ff2e712-2dd0-46ee-8c44-ca9ffbb7171d/orig','movie'),('2024-04-07 20:24:29.766542','2024-04-07 20:24:29.766542',11810,'Звёздные войны: Эпизод 4 — Новая надежда',1977,'Татуин. Планета-пустыня. Уже постаревший рыцарь Джедай Оби Ван Кеноби спасает молодого Люка Скайуокера, когда тот пытается отыскать пропавшего дроида. С этого момента Люк осознает свое истинное назначение: он один из рыцарей Джедай. В то время как гражданская война охватила галактику, а войска повстанцев ведут бои против сил злого Императора, к Люку и Оби Вану присоединяется отчаянный пилот-наемник Хан Соло, и в сопровождении двух дроидов, R2D2 и C-3PO, этот необычный отряд отправляется на поиски предводителя повстанцев – принцессы Леи. Героям предстоит отчаянная схватка с устрашающим Дартом Вейдером – правой рукой Императора и его секретным оружием – «Звездой Смерти».',121,'11000000 $',6,333,8.114,8.6,'https://image.openmoviedb.com/kinopoisk-images/1600647/9bdc6690-de82-4a8c-a114-aa3a353bc1da/orig','movie'),('2024-04-07 20:24:30.386942','2024-04-07 20:24:30.386942',11811,'Доктор Стрейнджлав, или Как я научился не волноваться и полюбил атомную бомбу',1963,'Одержимый мыслью, что коммунисты намереваются украсть у американцев их «бесценные телесные соки», командир военно-воздушной базы генерал Джек Д. Риппер посылает эскадрилью бомбардировщиков с ядерным оружием бомбить СССР. Президент США Маффли пытается спасти положение &#151; он собирает своих советников, включая доблестного генерала Тергидсона и прикованного к инвалидной коляске бывшего нацистского ученого доктора Стрейнджлава.',95,'1800000 $',12,334,8.023,8.4,'https://image.openmoviedb.com/kinopoisk-images/6201401/500c65bf-b631-44c5-b218-40d6ce5240be/orig','movie'),('2024-04-07 20:24:31.015345','2024-04-07 20:24:31.015345',11812,'Мементо',2000,'Леонард Шелби изысканно и дорого одет, ездит на новеньком «Ягуаре», но останавливается в дешевых мотелях. Он всеми силами пытается найти убийцу жены. Его проблема — редкая форма амнезии, потеря короткой памяти — помня все до убийства, он не помнит, что было 15 минут назад.',113,'9000000 $',18,335,7.878,8.4,'https://image.openmoviedb.com/kinopoisk-images/6201401/3fabdd0d-9b34-4cbf-a3b0-eb8448ccc122/orig','movie'),('2024-04-07 20:24:31.658012','2024-04-07 20:24:31.658012',11813,'Пролетая над гнездом кукушки',1975,'Рэндла Патрика Макмёрфи, патологического преступника и бунтаря, переводят из колонии в психиатрическую клинику, чтобы установить, является он душевнобольным или нет. В клинике он обнаруживает, что отделение контролирует хладнокровная, строгая и одержимая распорядком старшая медсестра Милдред Рэтчед. Макмёрфи намерен не подчиняться абсурдным, на его взгляд, правилам и одновременно повеселиться от души. Его бунтарская натура заражает других пациентов, но сестра Рэтчед решительно настроена пресечь это.',133,'3000000 $',18,336,8.515,8.7,'https://image.openmoviedb.com/kinopoisk-images/1704946/3521be40-0419-4864-9d62-461cc7959f2c/orig','movie'),('2024-04-07 20:24:32.184932','2024-04-07 20:24:32.184932',11814,'Окно во двор',1954,'Прикованный из-за сломанной ноги к инвалидному креслу фоторепортер от скуки подглядывает за соседями, живущими в его же доме, чьи окна выходят во внутренний двор. Постоянные наблюдения наталкивают его на мысль, что один из соседей ведет себя подозрительно. ',112,'2000000 $',12,337,8.022,8.5,'https://image.openmoviedb.com/kinopoisk-images/1599028/b366c92a-690b-4586-89e4-974ca741c420/orig','movie'),('2024-04-07 20:24:32.755062','2024-04-07 20:24:32.755062',11815,'Звёздные войны: Эпизод 5 — Империя наносит ответный удар',1980,'Борьба за Галактику обостряется в пятом эпизоде космической саги. Войска Императора начинают массированную атаку на повстанцев и их союзников.\n\nХан Соло и принцесса Лейя укрываются в Заоблачном Городе, в котором их и захватывает Дарт Вейдер, в то время как Люк Скайуокер находится на таинственной планете джунглей Дагоба.\n\nТам Мастер - джедай Йода обучает молодого рыцаря навыкам обретения Силы. Люк даже не предполагает, как скоро ему придется воспользоваться знаниями старого Мастера: впереди битва с превосходящими силами Императора и смертельный поединок с Дартом Вейдером.',124,'18000000 $',12,338,8.141,8.7,'https://image.openmoviedb.com/kinopoisk-images/6201401/42f4a53f-b353-4700-bbb7-525837c46630/orig','movie'),('2024-04-07 20:24:33.361250','2024-04-07 20:24:33.361250',11816,'Индиана Джонс: В поисках утраченного ковчега',1981,'Известный археолог и специалист по оккультным наукам доктор Джонс получает опасное задание от правительства США. Он должен отправиться на поиски уникальной реликвии — священного Ковчега. Но Индиана и не подозревает, что аналогичный приказ уже получили тайные агенты Адольфа Гитлера.',115,'18000000 $',12,339,7.99,8.4,'https://image.openmoviedb.com/kinopoisk-images/4303601/2b81e7f3-2f2b-490f-988e-c008e4276560/orig','movie'),('2024-04-07 20:24:33.966505','2024-04-07 20:24:33.966505',11817,'Подозрительные лица',1995,'Если есть преступление, есть и мотив. Если проводится опознание, то по крайней мере есть один подозреваемый. Но это было необычное преступление. Пять преступников столкнулись в одном необычном месте и решили прокрутить одно дельце. Но некто более сильный и влиятельный, некто, чье имя пугает всех преступников мира, хочет, чтобы они поработали на него. Это не было обычным преступлением, и они — не просто подозрительные лица.',106,'6000000 $',18,340,7.842,8.5,'https://image.openmoviedb.com/kinopoisk-images/1704946/194aa7f0-13ab-401e-8ae7-913191a6e785/orig','movie'),('2024-04-07 20:24:34.633140','2024-04-07 20:24:34.633140',11818,'Амели',2001,'Как полет крошечной мухи может вызвать где-то далеко мощный ураган, так и странные и, на первый взгляд, непонятные поступки тихой одинокой девушки, живущей в мире своих фантазий, могут навсегда изменить жизнь совершенно разных людей, подарив им счастье и раскрасив окружающий мир яркими красками. Эту девушку зовут Амели Пулен.',122,'10000000 €',18,341,8.025,8.3,'https://image.openmoviedb.com/kinopoisk-images/6201401/a49739d0-a2da-4e53-83c0-116fe2d4cc27/orig','movie'),('2024-04-07 20:27:00.764470','2024-04-07 20:27:00.764470',11819,'Криминальное чтиво',1994,'Двое бандитов Винсент Вега и Джулс Винфилд ведут философские беседы в перерывах между разборками и решением проблем с должниками криминального босса Марселласа Уоллеса.\nВ первой истории Винсент проводит незабываемый вечер с женой Марселласа Мией. Во второй рассказывается о боксёре Бутче Кулидже, купленном Уоллесом, чтобы сдать бой. В третьей истории Винсент и Джулс по нелепой случайности попадают в неприятности.',154,'8000000 $',18,342,8.65,8.9,'https://image.openmoviedb.com/kinopoisk-images/1900788/87b5659d-a159-4224-9bff-d5a5d109a53b/orig','movie'),('2024-04-07 20:27:01.426725','2024-04-07 20:27:01.426725',11820,'На север через северо-запад',1959,'Однажды успешного рекламного агента Роджера Торнхилла ошибочно принимают за агента разведки Кэплана, которого никто не знает в лицо, и хотят его убрать. Обескураженный Роджер пытается бежать. В вагоне-ресторане поезда милая женщина по имени Ив помогает ему скрыться от преследователей...',136,'4000000 $',12,343,7.846,8.3,'https://image.openmoviedb.com/kinopoisk-images/10893610/304cac3f-1186-477b-a025-742c351bf7c7/orig','movie'),('2024-04-07 20:27:02.111421','2024-04-07 20:27:02.111421',11821,'Психо',1960,'Мэрион Крэйн недовольна романом с разведенным мужчиной, который уделяет ей внимание только наездами. Поэтому девушка крадет на работе крупную сумму и в спешке бежит из города. Мэрион останавливается на ночь в мотеле, которым управляет Норман Бейтс — юноша, страдающий от гнёта своей горячо любимой, но деспотичной матери. ',109,'806947 $',18,344,8.078,8.5,'https://image.openmoviedb.com/kinopoisk-images/4303601/abbb4d30-fd08-4fc1-9543-333b2276be11/orig','movie'),('2024-04-07 20:27:02.755331','2024-04-07 20:27:02.755331',11822,'Молчание ягнят',1990,'Психопат похищает и убивает молодых женщин по всему Среднему Западу. ФБР, уверенное, что все преступления совершены одним и тем же человеком, поручает агенту Клариссе Старлинг встретиться с заключенным-маньяком Ганнибалом Лектером, который мог бы помочь составить психологический портрет убийцы. Сам Лектер отбывает наказание за убийства и каннибализм. Он согласен помочь Клариссе лишь в том случае, если она попотчует его больное воображение подробностями своей личной жизни.',118,'19000000 $',18,345,8.335,8.6,'https://image.openmoviedb.com/kinopoisk-images/6201401/9c655ce1-2b59-4941-97aa-f9e928ed0ff4/orig','movie'),('2024-04-07 20:27:03.465926','2024-04-07 20:27:03.465926',11823,'12 разгневанных мужчин',1956,'Юношу обвиняют в убийстве собственного отца, ему грозит электрический стул. Двенадцать присяжных собираются, чтобы вынести вердикт: виновен или нет. С начала заседания почти все считают подсудимого виновным, и лишь только один из двенадцати позволил себе усомниться. И он решает убедить остальных в своей правоте.',96,'340000 $',16,346,8.521,9,'https://image.openmoviedb.com/kinopoisk-images/1898899/db273efe-5f61-481a-9e42-ad0aff776c1f/orig','movie'),('2024-04-07 20:27:04.086842','2024-04-07 20:27:04.086842',11824,'Лоуренс Аравийский',1962,'Фильм рассказывает о легендарном герое Первой мировой войны - английском разведчике Т.Э. Лоуренсе, действовавшем среди арабских племен и возглавившем их в походе против турок.',216,'15000000 $',12,347,8.011,8.3,'https://image.openmoviedb.com/kinopoisk-images/1704946/0eee2a65-f954-448d-aff2-456bc8c4e542/orig','movie'),('2024-04-07 20:27:04.745365','2024-04-07 20:27:04.745365',11825,'Эта замечательная жизнь',1947,'Джордж Бейли, житель небольшого провинциального городка, всегда хотел повидать мир, но обстоятельства не давали ему покинуть родные места. Он жертвовал собой ради других, копил каждый цент, чтобы содержать семью, брал взаймы и защищал городок от злого банкира Поттера. И вот, в канун Рождества, расстроенный бесчисленными проблемами и терзаемый мыслями, что лучше бы и вовсе не рождаться, Джордж решается на отчаянный поступок. Но именно в этот момент к нему приходит ангел, чтобы показать мужчине, какой была бы жизнь, если бы он не родился.',130,'3180000 $',12,348,8.427,8.6,'https://image.openmoviedb.com/kinopoisk-images/10893610/c763cab4-ee73-449a-9717-701052dfbffb/orig','movie'),('2024-04-07 20:27:05.423228','2024-04-07 20:27:05.423228',11826,'Хороший, плохой, злой',1966,'Разгар Гражданской войны, Дикий Запад. По воле судьбы трое мужчин вынуждены объединить усилия в поисках украденного золота. Но совместная работа — не самое подходящее занятие для таких отъявленных бандитов. Компаньоны вскоре понимают, что в их дерзком и опасном путешествии по разоренной войной стране самое важное — никому не доверять и держать пистолет наготове.',178,'1200000 $',16,349,8.513,8.8,'https://image.openmoviedb.com/kinopoisk-images/1773646/8b9d4616-9426-4c74-a63c-296189f28213/orig','movie'),('2024-04-07 20:27:06.141750','2024-04-07 20:27:06.141750',11827,'Славные парни',1990,'История о Генри Хилле — начинающем гангстере, занимающемся грабежами вместе с подельниками Джими Конвеем и Томми Де Вито, которые с легкостью убивают любого, кто встаёт у них на пути.',140,'25000000 $',18,350,8.126,8.7,'https://image.openmoviedb.com/kinopoisk-images/4774061/7f119fc4-7fe0-4738-9fa4-bc541d468911/orig','movie'),('2024-04-07 20:27:06.768503','2024-04-07 20:27:06.768503',11828,'Красота по-американски',1999,'Лестер Бернэм переживает кризис среднего возраста. Его не уважают и не ценят на работе, а от счастливой семьи осталась лишь видимость. У жены Кэролайн страстный роман с коллегой по работе, а угрюмая дочь-подросток Джейн увлечена соседским парнем, побывавшим в психиатрической больнице.\n\nТерзаемый душевными муками Лестер впадает в депрессию. Но неожиданно для себя влюбляется в одноклассницу дочери Анджелу, и эта страсть дает Лестеру мощный жизненный импульс. Он ощущает прилив сил и желаний и готов снова радоваться красоте.',122,'15000000 $',18,351,7.988,8.3,'https://image.openmoviedb.com/kinopoisk-images/1599028/36f029a1-497d-45cd-b9fa-a152712a899c/orig','movie'),('2024-04-07 20:27:07.309206','2024-04-07 20:27:07.310207',11829,'Головокружение',1958,'Скотти Фергюсон - отставной сыщик, которого не назовешь баловнем судьбы: одинокий, оставшийся за бортом своей профессии, да еще и страдающий патологическим страхом высоты. Бывший коллега Гейвин Элстер просит его последить за своей женой Мэделин, одержимой идеей самоубийства.',128,'2479000 $',12,352,7.918,8.3,'https://image.openmoviedb.com/kinopoisk-images/4303601/c4674483-78a6-49cb-aa6f-bbc3859884e4/orig','movie'),('2024-04-07 20:27:07.928376','2024-04-07 20:27:07.928376',11830,'Сансет бульвар',1950,'Молодой сценарист Джо Гиллис сидит на мели, его преследуют кредиторы, ему не на что поесть, ему кажется, что жизнь кончилась. Машина, на которой он отправляется бездумно и бесцельно неизвестно куда, вдруг из-за лопнувшей шины резко виляет в сторону и влетает во двор особняка знаменитой в прошлом и увядающей в настоящем кинозвезды Нормы Десмонд.',110,'1752000 $',16,353,8.002,8.4,'https://image.openmoviedb.com/kinopoisk-images/1900788/aaf262e7-3adb-4193-aa8f-f4d362b71def/orig','movie'),('2024-04-07 20:27:08.511128','2024-04-07 20:27:08.511128',11831,'Апокалипсис сегодня',1979,'Во время Вьетнамской войны капитан Уиллард отправляется вверх по реке в Камбоджу со спецзаданием: найти и убить сумасшедшего полковника Курца, создавшего в отдалённом районе нечто вроде собственного культа. По пути капитан становится свидетелем безумия и ужасов войны.',194,'31500000 $',18,354,8.143,8.4,'https://image.openmoviedb.com/kinopoisk-images/10671298/a0d6537e-72ee-47f2-b51f-ef776b1b9cdf/orig','movie'),('2024-04-07 20:27:09.140189','2024-04-07 20:27:09.140189',11832,'Пианист',2002,'Фильм снят по автобиографии Владислава Шпильмана, одного из лучших пианистов Польши 30-х годов прошлого века. Главный герой фильма — Владек — занимается искусством до тех пор, пока территорию Польши не занимают нацисты. Жизнь всех евреев меняется: их помещают в Варшавское гетто, запрещают работать, унижают, заставляют носить отличительные повязки, а через некоторое время отправляют в концлагерь.',149,'35000000 $',18,355,8.466,8.5,'https://image.openmoviedb.com/kinopoisk-images/1946459/6d71694e-3796-4e1c-96aa-0e982c2bc03d/orig','movie'),('2024-04-07 20:27:09.928517','2024-04-07 20:27:09.928517',11833,'В джазе только девушки',1959,'Когда чикагские музыканты Джо и Джерри случайно становятся свидетелями бандитской перестрелки, они в срочном порядке смываются на поезде во Флориду, прикинувшись женщинами. Теперь они — Джозефина и Дафна, новенькие и хорошенькие инструменталистки женского джаз-бэнда.\n\nДо поры до времени их маскировка срабатывает. Но вскоре любвеобильная солистка влюбляется в «переодетого» мужчиной Джозефину, престарелый миллионер подкатывает к Дафне, а босс мафии, разгадав тайну маскарада, решает срочно разделаться со свидетелями.',119,'2883848 $',12,356,8.45,8.2,'https://image.openmoviedb.com/kinopoisk-images/1600647/f9d40e34-f5b2-49ca-9fe0-bbdd3e43da3a/orig','movie'),('2024-04-07 20:27:10.584019','2024-04-07 20:27:10.584019',11834,'Убить пересмешника',1962,'Юрист из Алабамы в одиночку воспитывает двоих детей. В обстановке экономической депрессии, преисполненной фанатизма и ненависти он должен защищать в суде афроамериканца, ложно обвиненного в изнасиловании.',129,'2000000 $',18,357,8.019,8.3,'https://image.openmoviedb.com/kinopoisk-images/4774061/46b80991-7b6f-484b-b6dd-8cd2cd6ccbe9/orig','movie'),('2024-04-07 20:27:11.158544','2024-04-07 20:27:11.158544',11835,'Таксист',1976,'Тусклый свет слепых фонарей, скелеты фабричных труб, задыхающихся в собственном дыму. Вавилонские башни небоскребов, все это — ад Нового времени, Нью-Йорк.\n\nВетеран вьетнамской войны Трэвис Бикл ведет свое одинокое такси по ночным улицам бесконечного города, и перед ним разворачивается мрачная панорама человеческих грехов. Как ветхозаветный пророк, он надеется, что однажды небеса пошлют на землю спасительный дождь, который очистит Нью-Йорк от вековой грязи.\n\nА когда умирает надежда, остается только ненависть. Огненный ливень обрушится на головы грешников. Таксист позаботится об этом.',114,'1900000 $',18,358,7.762,8.2,'https://image.openmoviedb.com/kinopoisk-images/4716873/e2d3a565-39a6-4bce-8ade-7033072d9039/orig','movie'),('2024-04-07 20:27:11.746045','2024-04-07 20:27:11.746045',11836,'Третий человек',1949,'Холли Мартинс, автор бульварных романов, в надежде получить работу приезжает в послевоенную Вену по приглашению старинного приятеля Гарри Лайма. Увы, буквально накануне тот погиб в результате несчастного случая.\n\nПо мнению полицейского Кэллоуэя, Лайм был темной личностью, рэкетиром и спекулянтом. Мартинс решает провести собственное расследование, чтобы снять с друга обвинения в преступлениях, которые, как он уверен, тот не совершал.\n\nБолее того, Мартинс уверен, что его друг был убит, а его убийца где-то рядом...',104,'{}',12,359,7.614,8.1,'https://image.openmoviedb.com/kinopoisk-images/1704946/b5590dc7-9bb9-4760-a744-5f86cad2a49f/orig','movie'),('2024-04-07 20:27:12.381790','2024-04-07 20:27:12.381790',11837,'Тропы славы',1957,'1916 год, Западный фронт. Полковник Дэкс командует пехотным полком французской армии. Уже два года союзники пытаются переломить ход войны. Начальник корпуса генерал Брулард приказывает дивизионному генералу Миро атаковать неприступную вражескую позицию.',88,'935000 $',12,360,8.099,8.4,'https://image.openmoviedb.com/kinopoisk-images/1704946/33a4403d-9750-4d45-a20a-dffa0e03f49c/orig','movie'),('2024-04-07 20:27:12.990929','2024-04-07 20:27:12.990929',11838,'Бойцовский клуб',1999,'Сотрудник страховой компании страдает хронической бессонницей и отчаянно пытается вырваться из мучительно скучной жизни. Однажды в очередной командировке он встречает некоего Тайлера Дёрдена — харизматического торговца мылом с извращенной философией. Тайлер уверен, что самосовершенствование — удел слабых, а единственное, ради чего стоит жить, — саморазрушение.\n\nПроходит немного времени, и вот уже новые друзья лупят друг друга почем зря на стоянке перед баром, и очищающий мордобой доставляет им высшее блаженство. Приобщая других мужчин к простым радостям физической жестокости, они основывают тайный Бойцовский клуб, который начинает пользоваться невероятной популярностью.',139,'63000000 $',18,361,8.668,8.8,'https://image.openmoviedb.com/kinopoisk-images/1898899/8ef070c9-2570-4540-9b83-d7ce759c0781/orig','movie'),('2024-04-07 20:27:13.635075','2024-04-07 20:27:13.635075',11839,'Подводная лодка',1981,'Осень 1941 года. Немецкая подводная лодка отправляется в Атлантический океан - место противостояния германского и британского флотов. Жизнь по строгому распорядку, учебные тревоги, воспоминания о семьях и любимых девушках, солёные мужские шуточки. Скоро всё это закончится. Потому что впереди – ад и никакой надежды на спасение.',150,'14000000 $',16,362,8.071,8.4,'https://image.openmoviedb.com/kinopoisk-images/1898899/cec066d4-70ac-4563-82d5-8bf74fc90fa2/orig','movie'),('2024-04-07 20:27:14.438213','2024-04-07 20:27:14.438213',11840,'Секреты Лос-Анджелеса',1997,'Бад Уайт и Эд Эксли работают в полиции Лос-Анджелеса. Они настолько разные, что порой ненавидят друг друга. Но их объединяет общее дело — расследование массового убийства. Оба пришли в полицию, чтобы бороться со злом, и оба — по личным причинам.',138,'35000000 $',18,363,7.928,8.2,'https://image.openmoviedb.com/kinopoisk-images/1900788/4688a7e8-0438-496d-8b9d-fe2df63d1d41/orig','movie'),('2024-04-07 20:27:15.128457','2024-04-07 20:27:15.128457',11841,'Двойная страховка',1944,'Сластолюбивый страховой агент Уолтер Нефф отправляется продлить полис на машину некоему мистеру Дитрихсону. В его доме он встречается с миссис Дитрихсон и мгновенно воспламеняется. Красотка делает Уолтеру предложение, от которого он не может отказаться.',107,'927262 $',12,364,7.944,8.3,'https://image.openmoviedb.com/kinopoisk-images/1704946/2d7f4533-eee5-413e-88c3-cc9cbf465012/orig','movie'),('2024-04-07 20:27:15.830588','2024-04-07 20:27:15.830588',11842,'Китайский квартал',1974,'Частный детектив Гиттес принимает предложение загадочной богатой красавицы заняться расследованием обстоятельств тайного романа ее мужа-инженера. Взявшись за дело, детектив оказывается в центре скандалов, беспредела коррупции и скрытых махинаций, правда о которых всплывет однажды ночью вместе с телом несчастного инженера.',130,'6000000 $',16,365,7.717,8.1,'https://image.openmoviedb.com/kinopoisk-images/1900788/d8913c0f-f10d-4930-ac21-15c07baa0dfc/orig','movie'),('2024-04-07 20:27:16.478773','2024-04-07 20:27:16.478773',11843,'Мальтийский сокол',1941,'Частный детектив Сэм Спэйд начинает смертельную охоту за таинственно исчезнувшей бесценной статуэткой «мальтийского сокола».',100,'300000 $',12,366,7.702,8,'https://image.openmoviedb.com/kinopoisk-images/1704946/33a4e7f4-0083-4cd8-9a00-7c3bd18ab238/orig','movie'),('2024-04-07 20:27:17.146387','2024-04-07 20:27:17.146387',11844,'Реквием по мечте',2000,'Каждый стремится к своей заветной мечте. Сара Голдфарб мечтала сняться в известном телешоу, ее сын Гарольд с другом Тайроном — сказочно разбогатеть, подруга Гарольда Мэрион грезила о собственном модном магазине, но на их пути были всевозможные препятствия. Все они выбирают неочевидные пути достижения своих целей, и мечты по-прежнему остаются недостижимыми, а жизни героев рушатся безвозвратно.',102,'4500000 $',18,367,8,8.3,'https://image.openmoviedb.com/kinopoisk-images/1773646/2a50c6d2-16b2-440d-a419-ab7306fc82fa/orig','movie'),('2024-04-07 20:27:17.660310','2024-04-07 20:27:17.661298',11845,'Поющие под дождем',1951,'Основа этого легендарного фильма – дюжина старых песен, написанных для различных бродвейских шоу. Дон Локвуд – популярная звезда немого кино вспоминает о том, как он пришел к славе… но вдруг счастье покидает его – наступила эра звукового кино. Нужно осваивать новые горизонты.',103,'2540800 $',12,368,8.034,8.3,'https://image.openmoviedb.com/kinopoisk-images/1900788/b38fde27-1056-4b28-bcf5-a8fea18f0cf2/orig','movie'),('2024-04-07 20:27:18.338936','2024-04-07 20:27:18.338936',11846,'Мост через реку Квай',1957,'Захваченные в плен японцами британские солдаты и их командир полковник Николсон вынуждены строить железнодорожный мост через реку Квай в Бирме. Несмотря на свирепый характер полковника Сайто, Николсон проявляет настоящее мужество.\n\nТем временем командование назначает группу коммандос для уничтожения этого стратегически важного объекта.',155,'3000000 $',16,369,7.75,8.1,'https://image.openmoviedb.com/kinopoisk-images/1900788/515a7f7b-e28b-4277-9542-75cb3437fdab/orig','movie'),('2024-04-07 20:27:19.001847','2024-04-07 20:27:19.001847',11847,'Унесённые призраками',2001,'Тихиро с мамой и папой переезжает в новый дом. Заблудившись по дороге, они оказываются в странном пустынном городе, где их ждет великолепный пир. Родители с жадностью набрасываются на еду и к ужасу девочки превращаются в свиней, став пленниками злой колдуньи Юбабы. Теперь, оказавшись одна среди волшебных существ и загадочных видений, Тихиро должна придумать, как избавить своих родителей от чар коварной старухи.',125,'19000000 $',12,370,8.514,8.6,'https://image.openmoviedb.com/kinopoisk-images/6201401/ae3b699c-3db7-4196-a869-39b610bfe706/orig','anime'),('2024-04-07 20:27:19.723556','2024-04-07 20:27:19.723556',11848,'Спасти рядового Райана',1998,'Вторая мировая. Капитан Джон Миллер получает тяжелое задание. Вместе с отрядом из восьми человек он должен отправиться в тыл врага на поиски рядового Джеймса Райана, три родных брата которого почти одновременно погибли на полях сражений.\n\nКомандование приняло решение демобилизовать Райана и отправить его на родину к безутешной матери. Но чтобы найти и спасти солдата, крошечному отряду придется пройти через все круги ада.',169,'70000000 $',18,371,8.184,8.6,'https://image.openmoviedb.com/kinopoisk-images/1900788/9ebff88a-fdd1-4a90-b3cf-7fb5bd256ed7/orig','movie'),('2024-04-07 20:27:20.331929','2024-04-07 20:27:20.331929',11849,'Всё о Еве',1950,'Стареющая звезда Бродвея Марго Ченнинг имела все: успех, друзей, молодого любовника. Скромная и трудолюбивая Ева становится ее помощницей, выполняющей все желания хозяйки. Быстрее всех понимает, что Евой движет желание стать «новой Марго Ченнинг», циничный театральный критик Аддисон Де Витт.\nПресыщенный жизнью и презирающий окружающую его благопристойность, он решает помочь молодой карьеристке. Она становится его благодарной ученицей и упорно, не гнушаясь ничем, идет к вершинам славы, предавая окружающих ее людей... ',138,'1400000 $',12,372,7.991,8.2,'https://image.openmoviedb.com/kinopoisk-images/1599028/bc088cca-a4ca-40fc-9455-ec39e0519b4b/orig','movie'),('2024-04-07 20:27:20.894207','2024-04-07 20:27:20.894207',11850,'М убийца',1931,'Маньяк-убийца наводит ужас на жителей Города. Маленькие девочки не успевают домой к обеду и не возвращаются вовсе. Полиция сбилась с ног в поисках преступника, однако все усилия тщетны. Обеспокоенный активностью полицейских преступный мир Города сам объявляет охоту на маньяка.',108,'{}',18,373,7.913,8.3,'https://image.openmoviedb.com/kinopoisk-images/1777765/f08b3023-27e2-46b3-8f7b-e44167f10c60/orig','movie'),('2024-04-07 20:27:21.563452','2024-04-07 20:27:21.563452',11851,'Бешеный бык',1980,'Джейк ЛаМотта, получивший прозвище Бронксский Бык, - боксер. И все его психологические и сексуальные комплексы яростно извергаются на боксерском ринге. Под горячую руку ему попадается родной брат, ставший жертвой навязчивой паранойи и ревности Джейка, а также пятнадцатилетняя девочка, которой суждено было стать самой главной наградой Джейка... и преследующим его наваждением.',129,'18000000 $',16,374,7.772,8.1,'https://image.openmoviedb.com/kinopoisk-images/1704946/3f51ec5f-356a-4192-a1f3-1f0097019f00/orig','movie'),('2024-04-07 20:27:22.171156','2024-04-07 20:27:22.171156',11852,'Монти Пайтон и Священный Грааль',1975,'Король Артур и рыцари Круглого стола отправляются в невероятное путешествие на поиски Святого Грааля. В пути они попадают в самые нелепые и абсурдные ситуации.',91,'229575 £',12,375,7.805,8.2,'https://image.openmoviedb.com/kinopoisk-images/1773646/107a90fd-7af3-48ba-957c-4c71216caf2b/orig','movie'),('2024-04-07 20:27:22.847861','2024-04-07 20:27:22.847861',11853,'Однажды на Диком Западе',1968,'Дикий Запад. Молодая вдова отказывается продать землю дельцу, задумавшему проложить по этой земле железную дорогу. Тогда бизнесмен поручает своему верному стрелку Фрэнку «устранить проблему», ведь тот ранее уже убил её мужа и приёмных детей. На защиту женщины встают известный бандит Шайен и таинственный незнакомец с губной гармошкой, у которого к Фрэнку давние счёты.',165,'5000000 $',18,376,8,8.5,'https://image.openmoviedb.com/kinopoisk-images/1773646/c366d993-15b8-4817-b619-c9b149af4494/orig','movie'),('2024-04-07 20:27:23.529991','2024-04-07 20:27:23.529991',11854,'Семь',1995,'Детектив Уильям Сомерсет - ветеран уголовного розыска, мечтающий уйти на пенсию и уехать подальше от города и грешных обитателей. За 7 дней до пенсии на Сомерсета сваливаются две неприятности: молодой напарник Миллс и особо изощренное убийство. Острый ум опытного сыщика сразу определяет, что за этим преступлением, скорее всего, последуют другие. Новости подтверждают его догадку. Поняв, что убийца наказывает свои жертвы за совершенные ими смертные грехи, детектив встает перед выбором: вернуться к работе либо уйти и передать дело своему менее опытному напарнику?',127,'33000000 $',18,377,8.297,8.6,'https://image.openmoviedb.com/kinopoisk-images/1773646/9ce4716c-dd27-435b-8a3a-f833ad859052/orig','movie'),('2024-04-07 20:27:24.201304','2024-04-07 20:27:24.201304',11855,'Крадущийся тигр, затаившийся дракон',2000,'Легендарный мастер боевых искусств Ли Мубай отправляется на поиски магического меча зеленой стали, похищенного злоумышленниками. Впереди его ждет зловещая фигура давнего противника, наемного убийцы, который после долгого отсутствия снова вернулся на тропу войны.',120,'17000000 $',12,378,7.367,7.9,'https://image.openmoviedb.com/kinopoisk-images/4303601/bc1c4231-80b1-40bb-8b81-16c6804eab0a/orig','movie'),('2024-04-07 20:27:25.012255','2024-04-07 20:27:25.012255',11856,'Волшебник страны Оз',1939,'Усаживайтесь поудобнее и приготовьтесь отправиться в долгое путешествие. Поднявшись выше радуги, вы окажетесь на дороге из желтого кирпича. Дорога проведет вас через заколдованные леса, царства злых ведьм и добрых фей в Изумрудный Город в далекой стране Оз. В мир, где любая мечта становится реальностью.',101,'2777000 $',0,379,7.578,8.1,'https://image.openmoviedb.com/kinopoisk-images/1946459/13acf544-539c-481f-978e-860e9dc7c2ba/orig','movie'),('2024-04-07 20:27:25.754469','2024-04-07 20:27:25.754469',11857,'2001 год: Космическая одиссея',1968,'Экипаж космического корабля «Дискавери» &#151; капитаны Дэйв Боумэн, Фрэнк Пул и их бортовой компьютер HAL 9000 &#151; должны исследовать район галактики и понять, почему инопланетяне следят за Землей. На этом пути их ждет множество неожиданных открытий.',149,'12000000 $',12,380,7.914,8.3,'https://image.openmoviedb.com/kinopoisk-images/1704946/4fb869bc-9e2f-46cc-a72d-df67ead77fff/orig','movie'),('2024-04-07 20:27:26.381014','2024-04-07 20:27:26.381014',11858,'Жизнь прекрасна',1997,'Во время Второй мировой войны из Италии в концлагерь были отправлены евреи - отец с маленьким сыном. Жена-итальянка добровольно последовала за ними. В лагере отец сказал мальчику, что всё происходящее вокруг является большой интересной игрой за приз в виде настоящего танка. И этот классный приз достанется тому мальчику, который сможет не попасться на глаза надзирателям.',116,'20000000 $',12,381,8.625,8.6,'https://image.openmoviedb.com/kinopoisk-images/1599028/97353be9-362d-47bc-bbeb-c366db381c33/orig','movie'),('2024-04-07 20:27:27.036416','2024-04-07 20:27:27.036416',11859,'Американская история X',1998,'Лидер местной банды скинхедов Дерек Виньярд прочно удерживает авторитет в своём районе. Убеждённый в своей правоте, он беспощадно расправляется с теми, кто имеет не белый цвет кожи. Независимость и смелость Дерека вызывают восхищение у его младшего брата Дэнни, который уже тоже сделал свой выбор.\nНо совершённое Дереком зверское убийство двух чернокожих парней разделяет дороги братьев: Дерек оказывается в тюрьме, где существует свой расклад сил, а Дэнни на свободе успешно продолжает дело брата. До тех пор, пока их пути не пересекаются вновь.',119,'20000000 $',18,382,8.296,8.5,'https://image.openmoviedb.com/kinopoisk-images/1704946/e0eb0512-5180-41d4-8788-f22d77b79501/orig','movie'),('2024-04-07 20:27:27.628775','2024-04-07 20:27:27.628775',11860,'Афера',1973,'В 1930-е годы двое отпетых мошенников пытаются отомстить главарю мафии за смерть их общего друга с помощью одной из самых неожиданных афер в истории кино, которая к тому же заканчивается удивительным и забавным образом.',129,'5500000 $',6,383,8.13,8.3,'https://image.openmoviedb.com/kinopoisk-images/1773646/dbb8d4ca-a07b-4127-b8ae-f38ad1820fe1/orig','movie'),('2024-04-07 20:27:28.235202','2024-04-07 20:27:28.235202',11861,'Печать зла',1958,'В небольшом городке на границе с Мексикой творятся криминальные дела.',95,'829000 $',100,384,7.634,8,'https://image.openmoviedb.com/kinopoisk-images/1900788/eab1da7b-5cfd-435a-9717-22172156e6a6/orig','movie'),('2024-04-07 20:27:28.867378','2024-04-07 20:27:28.867378',11862,'Маньчжурский кандидат',1962,'Южная Корея, 1952 год. Отряд американских солдат попадает в окружение, и только чудом спасшиеся девять человек под командованием Раймонда Шоу возвращаются на родину. Раймонд за эту операцию получает Медаль Почёта, но не помнит, ни как они выходили из окружения, ни многих подробностей боя.',126,'2200000 $',12,385,6.984,7.9,'https://image.openmoviedb.com/kinopoisk-images/1900788/87a0ae1f-ff32-4833-afb9-a0c237169e65/orig','movie'),('2024-04-07 20:27:29.426936','2024-04-07 20:27:29.426936',11863,'Чужой',1979,'В далеком будущем возвращающийся на Землю грузовой космический корабль перехватывает исходящий с неизвестной планеты сигнал. Экипаж, в соответствии с основными инструкциями, обязан найти и исследовать источник сигнала. Оказавшись на планете, астронавты повсюду обнаруживают предметы, по виду напоминающие гигантские коконы.',116,'11000000 $',18,386,8.076,8.5,'https://image.openmoviedb.com/kinopoisk-images/1704946/14af6019-b2fe-4e1e-bee5-334d9e472d94/orig','movie'),('2024-04-07 20:27:30.079947','2024-04-07 20:27:30.079947',11864,'Мистер Смит едет в Вашингтон',1939,'Наивный идеалист Джефферсон Смит, лидер организации бойскаутов, назначен представителем в сенат. Он объединяется со старшим сенатором от своего штата, однако не подозревает, как много людей вокруг него ведут двойную игру и выполняют приказания вышестоящих. Наивный молодой сенатор сталкивается с коррупцией, грязной игрой, лживостью и ангажированностью прессы.',129,'1900000 $',12,387,7.851,8.1,'https://image.openmoviedb.com/kinopoisk-images/1898899/c9b3d1a7-03e4-427a-aa20-04b0bc289ece/orig','movie'),('2024-04-07 20:27:30.625031','2024-04-07 20:27:30.625031',11865,'Расёмон',1950,'Древняя Япония. В лесу изнасилована женщина, а её муж убит. Есть четыре точки зрения на это происшествие, у каждого из четырех свидетелей &#151; своя. Каждая сторона проливает свет на случившееся, добавляя дополнительные детали.',88,'250000 $',18,388,7.958,8.2,'https://image.openmoviedb.com/kinopoisk-images/10893610/6d80dc6e-7edf-49a1-9912-572c83f152a1/orig','movie'),('2024-04-07 20:27:31.130176','2024-04-07 20:27:31.130176',11866,'Леон',1994,'Профессиональный убийца Леон неожиданно для себя самого решает помочь 12-летней соседке Матильде, семью которой убили коррумпированные полицейские.',133,'115000000 FRF',18,389,8.673,8.5,'https://image.openmoviedb.com/kinopoisk-images/6201401/8662d92a-5881-4600-a7ae-549e6fd53b03/orig','movie'),('2024-04-07 20:27:31.825830','2024-04-07 20:27:31.825830',11867,'Энни Холл',1977,'Комик Элви Сингер с юмором и иронией рассказывает о своей жизни, о людях, которые его окружают. Он скептически анализирует свои неудачи в личной жизни, в которой было несколько любимых женщин.',93,'4000000 $',12,390,7.781,8,'https://image.openmoviedb.com/kinopoisk-images/1704946/787826af-f3a8-4611-82cb-865a4aa1407a/orig','movie'),('2024-04-07 20:27:32.403596','2024-04-07 20:27:32.403596',11868,'Заводной апельсин',1971,'Безжалостный лидер банды подростков, совершающей убийства и изнасилования, попадает в тюрьму и подвергается специальной обработке по подавлению подсознательного стремления к насилию. Но жизнь за воротами тюрьмы такова, что меры, принятые по «исправлению жестокости характера», не могут ничего изменить.',137,'2200000 $',18,391,7.901,8.3,'https://image.openmoviedb.com/kinopoisk-images/1629390/5c80a1c4-b8d4-4fc9-a363-41df01545f7f/orig','movie'),('2024-04-07 20:27:33.006664','2024-04-07 20:27:33.006664',11869,'Большой побег',1963,'Американские, британские и канадские военнопленные осуществляют массовый побег из немецкого лагеря во время Второй мировой войны.',172,'4000000 $',12,392,7.336,8.2,'https://image.openmoviedb.com/kinopoisk-images/1946459/a53a7633-e321-4f90-a5fe-cb974211f3e3/orig','movie'),('2024-04-07 20:27:33.665625','2024-04-07 20:27:33.665625',11870,'Сокровища Сьерра Мадре',1947,'В небольшом мексиканском городке Тампико знакомятся два бедняка Доббс и Кертин. От местного старика они узнают о золотой жиле в окрестностях Сьерра Мадре. Вложив все свои деньги в дело, трое друзей отправляются в опасное путешествие.\n\nДойти туда стоит огромных трудов, но сохранить трезвый разум при виде жёлтого металла и вернуться живым ещё сложнее.',126,'3800000 $',12,393,7.989,8.2,'https://image.openmoviedb.com/kinopoisk-images/1599028/0de253ef-fac4-4404-acae-87b66689182f/orig','movie'),('2024-04-07 20:27:34.321574','2024-04-07 20:27:34.321574',11871,'Бешеные псы',1991,'Это должно было стать идеальным преступлением. Задумав ограбить ювелирный магазин, криминальный босс Джо Кэбот собрал вместе шестерых опытных и совершенно незнакомых друг с другом преступников. Но с самого начала все пошло не так, и обычный грабеж превратился в кровавую бойню.',100,'1200000 $',18,394,8.115,8.3,'https://image.openmoviedb.com/kinopoisk-images/1946459/b1add366-9e49-4ad8-905a-46ca23da8adc/orig','movie'),('2024-04-07 20:27:34.931624','2024-04-07 20:27:34.931624',11872,'Шестое чувство',1999,'Детский психиатр Малкольм Кроу сталкивается со странным случаем: девятилетнего Коула посещают страшные видения - призраки умерших. Все эти люди когда-то были убиты, и теперь они обрушивают на малыша свой гнетущий страх и отчаянный гнев.\n\nКак врач Малкольм бессилен помочь. Но как человек он пытается найти ключ к ужасному миру Коула, в котором веет дыханием смерти, и распускаются страшные цветы боли.',107,'40000000 $',12,395,8.186,8.2,'https://image.openmoviedb.com/kinopoisk-images/1946459/770e2754-f886-4012-852d-63580984a310/orig','movie'),('2024-04-07 20:27:35.710163','2024-04-07 20:27:35.710163',11873,'Челюсти',1975,'Действие картины протекает в течение пяти дней — на острове Э́мити, где расположен небольшой курортный городок. В этом тихом и солнечном месте произошли ужасные трагические события, начало которым было положено ранним утром, когда шеф местной полиции Мартин Броуди и его помощник находят на берегу остатки тела девушки. Она стала первой жертвой огромной белой акулы, которая появилась у берегов Эмити…\n\nС каждым днем число жертв кровожадной акулы продолжает увеличиваться. Сможет ли отважный охотник на акул, ветеран Второй мировой войны, рыбак Квинт на своём судне выловить и убить акулу-людоеда? В опасную морскую экспедицию вместе с ним отправляются Мартин Броуди и прибывший на остров эксперт из национального института океанографии Мэтт Хупер.',124,'7000000 $',18,396,7.329,8.1,'https://image.openmoviedb.com/kinopoisk-images/1900788/8632d1cd-9819-46b2-95a0-e583b2f72ffb/orig','movie'),('2024-04-07 20:27:37.342605','2024-04-07 20:27:37.342605',11874,'Амадей',1984,'1781 год. Антонио Сальери успешно справляется с обязанностями придворного композитора при императоре Иосифе II. Когда же при дворе появляется Моцарт, Сальери к своему ужасу обнаруживает, что божественный музыкальный дар, которым он так желает обладать, был отпущен какому-то непристойному, проказливому шуту. Ослепленный завистью, он замышляет во что бы то ни стало уничтожить Моцарта...',160,'18000000 $',18,397,8.161,8.4,'https://image.openmoviedb.com/kinopoisk-images/1946459/fdd9adaa-2b37-4d0e-9002-c00bcf439fd0/orig','movie'),('2024-04-07 20:27:38.003694','2024-04-07 20:27:38.003694',11875,'В порту',1954,'В центре сюжета судьба простого докера - Терри Мэллоу, терзающегося сомнениями и решающего встать на путь восстановления справедливости, после того как выясняется, что он работает на настоящего гангстера - коррумпированного босса портовых докеров Джонни Фрэндли.',108,'910000 $',16,398,7.677,8.1,'https://image.openmoviedb.com/kinopoisk-images/1599028/7e92ba16-97a2-42d1-92cc-20bd6b8c9ea6/orig','movie'),('2024-04-07 20:27:38.653909','2024-04-07 20:27:38.653909',11876,'Храброе сердце',1995,'Действие фильма начинается в 1280 году в Шотландии. Это история легендарного национального героя Уильяма Уоллеса, посвятившего себя борьбе с англичанами при короле Эдварде Длинноногом.\nОн рано лишился отца, погибшего от рук англичан, и его забрал к себе дядя Оргайл, который дал ему хорошее образование в Европе. На родину Уильям возвращается уже взрослым человеком, мечтающим завести семью и жить мирной жизнью.\nНо судьба распорядилась иначе. Его невесту убили англичане, и он начал свой крестовый поход за свободу.',178,'72000000 $',18,399,8.292,8.3,'https://image.openmoviedb.com/kinopoisk-images/1704946/ce82bed6-15de-4d5c-aa68-fae55556e39f/orig','movie'),('2024-04-07 20:27:39.301914','2024-04-07 20:27:39.301914',11877,'Ран',1985,'Япония, XVI век. Стареющий правитель Хидэтора объявляет о разделе своих владений между тремя сыновьями.\nОбманутый фальшивыми уверениями в верности двух старших сыновей Хидэтора прогоняет младшего, осмелившегося утверждать, что решение отца навлечет гибель на весь их род. Став жертвой коварного предательства, правитель лишается рассудка, а между его наследниками начинается беспощадная братоубийственная война.',161,'11500000 $',18,400,7.885,8.2,'https://image.openmoviedb.com/kinopoisk-images/1629390/4979d2d6-03e2-49e6-ab9c-639497cb6010/orig','movie'),('2024-04-07 20:27:39.946799','2024-04-07 20:27:39.946799',11878,'Ровно в полдень',1952,'Только что поженившись, Уилл и его прекрасная блондинка-квакерша Эми собираются навсегда покинуть городок, намереваясь оставить в прошлом опасную работу и обзавестись собственным ранчо, чтобы пустить корни. Однако, в городке узнают, что свирепый убийца Фрэнк Миллер должен очень скоро приехать в Хэдливиль и отомстить Уиллу и всему городу за то, что они засадили его в тюрьму несколько лет тому назад. Брат Миллера и еще два бандита-ганфайтера уже ждут поезд, на котором едет Миллер, а поезд должен прийти ровно в полдень. В минуту паники Уилл покидает город вместе с невестой и скачет по дороге в открытые прерии, но внезапно останавливает коня.',85,'730000 $',12,401,7.502,8,'https://image.openmoviedb.com/kinopoisk-images/1900788/972acd2e-973e-4005-8dc4-927c8b71ad2d/orig','movie'),('2024-04-07 20:27:40.578014','2024-04-07 20:27:40.578014',11879,'Фарго',1995,'Для робкого менеджера по продажам, работающего у собственного тестя, похищение собственной жены — отличная идея. Он нанимает двух преступников, чтобы по результатам разделить с ними крупный выкуп за заложницу. Но дело сразу идет не так, как замышлялось, проливается кровь... Вызов преступникам бросает отважная женщина-полицейский...',98,'7000000 $',18,402,7.63,8.1,'https://image.openmoviedb.com/kinopoisk-images/1777765/1783ce03-1a5e-4c0e-97ac-e7424a3ffa9a/orig','movie'),('2024-04-07 20:27:41.322972','2024-04-07 20:27:41.322972',11880,'Бегущий по лезвию',1982,'Ноябрь 2019 года. Бывший охотник на андроидов Рик Декард восстановлен в полиции Лос-Анджелеса для поиска возглавляемой Роем Батти группы репликантов, совершившей побег из космической колонии на Землю. В полиции считают, что андроиды пытаются встретиться с Эндолом Тайреллом — руководителем корпорации, которая разрабатывает кибернетический интеллект. Декард получает задание выяснить мотивы репликантов и уничтожить их.',117,'28000000 $',18,403,7.731,8.1,'https://image.openmoviedb.com/kinopoisk-images/1629390/ffa0729b-8587-47e8-b4de-3f8a2c61e218/orig','movie'),('2024-04-07 20:27:41.972836','2024-04-07 20:27:41.972836',11881,'Квартира',1960,'Скромный служащий страховой компании Бакстер, чтобы хоть как-то продвинуться по карьерной лестнице, одалживает ключи от своей холостяцкой квартиры не только приятелям, желающим «погулять на сторону», но и боссу. Когда дела начинают идти в гору, случается непредвиденное: Бакстер влюбляется в любовницу босса.',125,'3000000 $',16,404,8.008,8.3,'https://image.openmoviedb.com/kinopoisk-images/1629390/a0b4af58-27b3-4ff1-8f4d-b181cb59987f/orig','movie'),('2024-04-07 20:27:42.576303','2024-04-07 20:27:42.576303',11882,'История игрушек 2',1999,'Ковбой Вуди и другие игрушки мальчика по имени Энди продолжают жить, радуясь каждому дню. Но неожиданно все меняется, когда Вуди похищает коварный коллекционер. Оказывается, что Вуди - очень ценная игрушка из коллекции, за которую японский музей игрушек готов заплатить огромную сумму. В доме коллекционера он находит своих родственников. В это время игрушки во главе с Баззом Лайтером отправляются спасать Вуди.\nВуди узнает о своем знаменитом прошлом, Базз и другие игрушки проходят опасный и тернистый путь. Перед Вуди встает непростой вопрос - каково же его предназначение? Блистать в витрине музея или же вернуться к любимому хозяину?',92,'90000000 $',0,405,7.807,7.9,'https://image.openmoviedb.com/kinopoisk-images/4303601/2f460225-0428-418e-b94a-6eb0f3456fd1/orig','cartoon'),('2024-04-07 20:27:43.341370','2024-04-07 20:27:43.341370',11883,'Чужие',1986,'Чужой – совершенный организм. Идеальная машина для убийства, чье физическое превосходство сочетается с его феноменальной жаждой уничтожения. Офицер Элен Рипли и команда космического корабля Ностромо один раз уже встретилась с такой тварью. В живых осталась только Элен.\n\nКапсула с Элен найдена спасателями после многих лет блуждания в космосе. Ей сообщают, что планета L.V. 426 колонизирована, и ей придется вернуться туда, где начался ее кошмар, ибо связь с колонистами прервалась. И вот в составе группы космического десанта Рипли отправляется на проклятую планету. Но теперь их там поджидает не один Чужой, а тысячи. Кто сможет выжить в этой войне: чудовища, способные только убивать, или люди, способные мыслить?',137,'18500000 $',18,406,8.064,8.4,'https://image.openmoviedb.com/kinopoisk-images/1704946/cc6ba1ce-a005-4e39-b913-06e8c866817c/orig','movie'),('2024-04-07 20:27:44.096307','2024-04-07 20:27:44.096307',11884,'Незнакомцы в поезде',1951,'Невероятные события начинают происходить в жизни звезды тенниса Гая Хэйнса после неожиданной встречи в поезде с обаятельным незнакомцем Бруно.\n\nДо этой встречи молодые люди имели разные, но серьезные причины чувствовать себя несчастными. Решение личных проблем двух случайных попутчиков состоит из небольшого обмена услугами: «Я убью для тебя, а ты убьешь для меня».',101,'1200000 $',12,407,7.739,7.9,'https://image.openmoviedb.com/kinopoisk-images/6201401/e7a0be91-ecb6-40c9-bb60-c9b305c16c30/orig','movie'),('2024-04-07 20:27:44.764398','2024-04-07 20:27:44.764398',11885,'Новые времена',1936,'«Новые времена» - это эмоциональный, выдержанный в комическом ключе, отклик на перекосы машинной эпохи. Маленький Бродяга не желает быть «винтиком» в огромной мега-машине промышленного производства и так похожего на него человеческого общества. Чарли сражается с тупыми богачами, всесильными полицейскими, бездушными начальниками конвейерного производства.\n\nИногда он выигрывает в этих сражениях, но чаще проигрывает, в конце концов, бесстрашно идет навстречу рассвету. Хотя «Новые времена» считается последним немым фильмом Чарли Чаплина, в нем Маленький Бродяга в первый и в последний раз обрел голос.\n\nПравда, он не заговорил, а запел в финальных кадрах картины, символизируя прощание с прекрасным периодом немого кинематографа.',87,'1500000 $',0,408,8.095,8.5,'https://image.openmoviedb.com/kinopoisk-images/1946459/6b0ba87c-9dbb-4639-889e-4b8099b187e3/orig','movie'),('2024-04-07 20:27:45.397253','2024-04-07 20:27:45.397253',11886,'Сияние',1980,'Джек Торренс с женой и сыном приезжает в элегантный отдалённый отель, чтобы работать смотрителем во время мертвого сезона. Торренс здесь раньше никогда не бывал. Или это не совсем так? Ответ лежит во мраке, сотканном из преступного кошмара.',144,'19000000 $',18,409,7.779,8.4,'https://image.openmoviedb.com/kinopoisk-images/6201401/49ba5c05-249b-4387-8418-833aa54bb376/orig','movie'),('2024-04-07 20:27:46.092098','2024-04-07 20:27:46.092098',11887,'Донни Дарко',2001,'Донни Дарко — обычный старшеклассник, живет с родителями и двумя сестрами. Однажды он встречает человека в костюме кролика, который сообщает парню, что через 28 дней, 6 часов, 42 минуты и 12 секунд наступит конец света.',113,'4500000 $',18,410,7.602,8,'https://image.openmoviedb.com/kinopoisk-images/1629390/4c2dd163-0681-48c9-97eb-1d4e6e41486a/orig','movie'),('2024-04-07 20:27:46.749101','2024-04-07 20:27:46.749101',11888,'Утиный суп',1933,'Чтобы спасти маленькую страну Фридонию от банкротства, богатая вдова госпожа Тисдейл соглашается пожертвовать на это 20 миллионов долларов. Но только при условии, что ухлестывающий за ней Руфус Т. Файрфлай станет лидером страны.\n\nФайрфлай - циничный и бесцеремонный диктатор - провоцирует посла соседней Сильвании, и между странами начинается война. Военную «игру» осложняют и запутывают два друга-неумехи, которых посол Сильвании отправил шпионить за Файрфлаем с целью выкрасть его тайные планы сражения...',69,'{}',0,411,6.847,7.7,'https://image.openmoviedb.com/kinopoisk-images/6201401/f9d1d84a-d8be-44cc-b3aa-fbf859a7ec3c/orig','movie'),('2024-04-07 20:27:47.335323','2024-04-07 20:27:47.335323',11889,'Принцесса-невеста',1987,'Добро пожаловать в фантастический мир прекрасных замков, жутких подземелий, бескрайних океанов, лесов и гор. Чтобы спасти свою возлюбленную, прекрасную невесту, отважный герой преодолевает немыслимые препятствия и совершает невероятные подвиги.',98,'16000000 $',6,412,7.187,8,'https://image.openmoviedb.com/kinopoisk-images/1704946/beed4b44-b4d9-4f08-9819-cd8482918b22/orig','movie'),('2024-04-07 20:27:48.034206','2024-04-07 20:27:48.034206',11890,'Беги, Лола, беги',1998,'Лола и Манни живут в Берлине и безумно любят друг друга. И когда Манни — маленький курьер большого бандита — теряет сумку с деньгами своего босса, спасти его может только Лола. Но чтобы раздобыть совсем не маленькую сумму в сто тысяч марок, у девушки есть только 20 минут. Каждая секунда может означать разницу между жизнью и смертью.',81,'3500000 DEM',18,413,7.547,7.7,'https://image.openmoviedb.com/kinopoisk-images/4716873/44496e87-46cc-45aa-a0a1-3581516506d2/orig','movie'),('2024-04-07 20:27:48.674682','2024-04-07 20:27:48.674682',11891,'Огни большого города',1931,'Маленький Бродяга встречает красивую слепую девушку, торгующую цветами на улице, которая по ошибке принимает его за богатого герцога. Узнав о том, что операция может вернуть ей зрение, маленький Бродяга пускается на поиски денег.',87,'1500000 $',0,414,8.484,8.5,'https://image.openmoviedb.com/kinopoisk-images/1900788/fc084f01-9350-4bdc-956c-9de80385de4a/orig','movie'),('2024-04-07 20:27:49.319954','2024-04-07 20:27:49.319954',11892,'Паровоз Генерал',1926,'Юного Джонни Грэя в армию Конфедерации не взяли, а его возлюбленная Аннабел Ли отвергает его, обозвав трусом. Тем не менее, он со своим «напарником» паровозом утирает всем нос, выигрывая сражение. Джонни воюет с угонщиками поезда, непослушной пушкой и непредсказуемой силой судьбы.',80,'750000 $',18,415,7.938,8.1,'https://image.openmoviedb.com/kinopoisk-images/1898899/20687f2d-d388-4287-b8b0-1169488561e6/orig','movie'),('2024-04-07 20:27:50.052185','2024-04-07 20:27:50.052185',11893,'Искатели',1956,'Джон Уэйн  играет   бывшего солдата армии конфедерации Итана Эдвардса, который  больше  верит  пулям, чем   словам. Он разыскивает свою племянницу, похищенную команчами, которые убили всю его семью.\n\nЕму не страшны ни голод, ни жажда, ни одиночество. За время своих отчаянных пятилетних поисков Итан находит то, что найти не ожидал: свою собственную человечность.',119,'3750000 $',6,416,7.203,7.8,'https://image.openmoviedb.com/kinopoisk-images/1773646/628b77b2-00cc-4b8d-8681-3735b2d68d78/orig','movie'),('2024-04-07 20:27:50.706430','2024-04-07 20:27:50.706430',11894,'Метрополис',1927,'Метрополис - город будущего, разделен на две части. Под землей находятся жилища рабочих, над ними цеха с машинами. В верхнем городе расположены офисы, богатые кварталы и сады развлечений. Вся власть в городе принадлежит магнату Иогану Фендерсону.\nЕго сын - Фредер догадывается о несправедливости, царящей в метрополисе. Спустившись в машинную зону, Фредер приходит в ужас: он видит страшного Молоха, пожирающего людей. Не в силах смириться с увиденным, он начинает борьбу со злом.',145,'6000000 DEM',12,417,8.076,8.3,'https://image.openmoviedb.com/kinopoisk-images/4774061/e5aeb235-206a-4844-9a4a-c7e3b342bd30/orig','movie'),('2024-04-07 20:27:51.319977','2024-04-07 20:27:51.319977',11895,'Цельнометаллическая оболочка',1987,'Американская база подготовки новобранцев корпуса морской пехоты. Жесточайшая, бесчеловечная система призвана превратить домашних мальчишек в натренированных хладнокровных убийц. Их готовят к войне во Вьетнаме, где им придется часто задавать себе вопрос «Разве война - это не ад?», а иначе просто невозможно убивать каждый день, не понимая, для чего это?',116,'30000000 $',18,418,8.014,8.3,'https://image.openmoviedb.com/kinopoisk-images/1599028/63ae09b0-12c7-4ca6-996a-1a9435cb8cfc/orig','movie'),('2024-04-07 20:27:51.941391','2024-04-07 20:27:51.941391',11896,'Дурная слава',1946,'1946 г. американский суд приговаривает Иогана Губермана к двадцати годам тюрьмы как германского шпиона за измену Родине. Его дочь Алисия знакомится на вечеринке с агентом ФБР Дэвлином, который получает задание от руководства раскрыть нацистский заговор в Рио де Жанейро.\n\nДэвлин решает воспользоваться помощью девушки для выполнения своего задания, и она принимает его предложение. Так начинается их бурный «шпионский» роман.\n\nОни вступают в контакт с нацистским агентом Александром, за которого Алисия должна выйти замуж, чтобы узнать о секретных планах немецкой организации, в которой состоит Александр.',102,'2000000 $',12,419,7.45,7.9,'https://image.openmoviedb.com/kinopoisk-images/1773646/07aa330f-85ef-453f-ab04-08207634f8c4/orig','movie'),('2024-04-07 20:27:52.600401','2024-04-07 20:27:52.600401',11897,'Манхэттен',1979,'Желая бросить опостылевшую работу и привычный круг знакомств, телевизионный сценарист заводит роман с любовницей друга. И вновь оказывается в замкнутом круге лжи, лицемерия, пустословия. Неожиданно для себя он делает открытие, что надо больше доверять людям.',96,'9000000 $',18,420,7.792,7.8,'https://image.openmoviedb.com/kinopoisk-images/1898899/62779736-0398-4a10-a418-e61a8d918398/orig','movie'),('2024-04-07 20:27:53.199887','2024-04-07 20:27:53.199887',11898,'Буч Кэссиди и Сандэнс Кид',1969,'Два друга Буч Кэссиди и Сандэнс Кид известны всей округе. Они верховодят бандой «Дыра в стене». Буч - мозговой центр, Сандэнс - идеальный исполнитель и первоклассный стрелок. Они дважды грабят один и тот же поезд, перевозящий деньги. \n\nЗа налетчиками организована погоня, которой руководит опытный следопыт Балтимор. От него не удавалось уйти никому. С трудом оторвавшись от преследования, приятели укрываются в доме подружки Сандэнса. И тогда Буч понимает: раз удача отвернулась от них в Америке, может стоит попытать счастья в Боливии?',110,'6000000 $',12,421,7.968,8,'https://image.openmoviedb.com/kinopoisk-images/1629390/98cbe336-4778-469c-abce-39043cf67be7/orig','movie'),('2024-04-07 20:27:53.906525','2024-04-07 20:27:53.906525',11899,'Выпускник',1967,'После окончания колледжа в родительский дом возвращается Бенджамин Брэддок. На торжественном приёме в его честь Бен встречает давнюю приятельницу родителей, элегантную даму бальзаковского возраста миссис Робинсон, которая позже соблазняет его. Робкий, неуклюжий, безвольный Бен бессилен против чар властной и сексуальной женщины, пока не влюбляется в её дочь Элейн.',105,'3000000 $',16,422,7.882,8,'https://image.openmoviedb.com/kinopoisk-images/1900788/5c1ab88a-e120-4570-ac69-dc23d62cc02a/orig','movie'),('2024-04-07 20:27:54.514418','2024-04-07 20:27:54.514418',11900,'Глубокий сон',1946,'Пожилой генерал Стернвуд нанимает частного детектива Филипа Марлоу, чтобы тот разобрался с шантажистами его распутной младшей дочери Кармен. Начав копать, Марлоу ввязывается в опасную и запутанную криминальную игру. Да и старшая дочь генерала Вивиан добавляет хлопот. Загадочная, жёсткая, непредсказуемая и сексапильная красавица постоянно оказывается там, где не надо.',109,'250000 $',16,423,7.34,7.9,'https://image.openmoviedb.com/kinopoisk-images/1900788/e3b69624-d95d-4604-bbbf-8dd1078cf0a3/orig','movie'),('2024-04-07 20:27:55.158852','2024-04-07 20:27:55.158852',11901,'Новый кинотеатр «Парадизо»',1988,'Это рассказ о счастливых днях, когда итальянское кино еще не знало о том, что такое «кризис итальянского кинематографа». В центре разделенной как бы на три части картины - сицилийский мальчишка Сальваторе.',124,'5000000 $',16,424,7.999,8.5,'https://image.openmoviedb.com/kinopoisk-images/1898899/c6c61323-479f-48dc-8ac6-74b67242c6a9/orig','movie'),('2024-04-07 20:27:55.777452','2024-04-07 20:27:55.777452',11902,'Седьмая печать',1957,'В середине XIV века рыцарь Антониус Блок и его оруженосец возвращаются после десяти лет крестовых походов в родную Швецию. Блок устал от жизни и не видит ничего, ради чего стоило бы продолжать влачить существование. Но прежде он хочет убедиться, что Бог есть.',96,'150000 $',18,425,8.068,8.1,'https://image.openmoviedb.com/kinopoisk-images/10835644/25bea97e-6113-4cfa-8a1c-77daeb7c32a6/orig','movie'),('2024-04-07 20:27:56.347659','2024-04-07 20:27:56.347659',11903,'Ребекка',1940,'Максимиллиан Де Уинтер - богатый мужчина, примерно год назад потерявший жену Ребекку. Он приезжает в Монте-Карло, где встречает миссис Ван Хоппер и её юную компаньонку. Постепенно Максимиллиан так увлекается молодой особой, что в конце концов женится на ней, и вскоре супруги возвращаются в Мэндэрли, владение семьи Де Уинтеров в Корнуэлле. Там девушку начинает преследовать и подавлять присутствие Ребекки, которое она видит абсолютно во всём.',130,'1288000 $',12,426,7.917,8.1,'https://image.openmoviedb.com/kinopoisk-images/1900788/3a325e65-9a2a-4543-97ee-2981e0d29298/orig','movie'),('2024-04-07 20:27:57.047319','2024-04-07 20:27:57.047319',11904,'Доблесть',1989,'Полковник Шоу был офицером армии Федералов во времена Гражданской войны в США. Он добровольно вызвался стать командиром первого в истории США подразделения чернокожих солдат. Полковник должен обучить их и повести в бой, но времени на подготовку слишком мало, а впереди — решающее сражение с регулярными войсками южан.',122,'18000000 $',100,427,7.401,7.8,'https://image.openmoviedb.com/kinopoisk-images/1599028/a695df3f-b922-45ff-933a-edf0e24401f0/orig','movie'),('2024-04-07 20:27:57.729371','2024-04-07 20:27:57.729371',11905,'Охотник на оленей',1978,'История о трех американцах русского происхождения — их жизни до, во время и после войны во Вьетнаме.',183,'15000000 $',18,428,7.851,8.1,'https://image.openmoviedb.com/kinopoisk-images/1773646/013a7dc0-17bf-49eb-886b-97a8c40db73c/orig','movie'),('2024-04-07 20:27:58.335090','2024-04-07 20:27:58.335090',11906,'Лучшие годы нашей жизни',1946,'Фильм рассказывает историю о трех офицерах американской армии, которые с войны возвращаются домой к своим семьям. Эл, Фред и Хомер — эта история о них, у Эла дома жена и двое уже подросших детей, которые как раз вступают во взрослую жизнь, он пытается наверстать упущенное, узнать их заново и вновь завоевать семейную любовь и доверие, по возвращению его приглашают работать в банке на более высокую должность, нежели он был до того как отправился на войну. \nУ Фреда в свою очередь красавица жена, которая начала самостоятельную жизнь, уехав от родителей Фреда и поселившись в отеле и как видимо не очень то скучала без мужа, к тому же на работу Фреда брать не торопятся и у него, серьезные финансовые проблемы, после совместной выпивки в баре Фред попадает домой к Элу и там он влюбляется в дочь Эла, Пегги. А вот у Хомера дела еще сложнее, он потерял на войне обе руки, но его ждет семья и любимая девушка на которой он обещал по возвращению жениться, но серьезное увечье все усложняет, поэтому Хомера и его девушку ждет большое испытание их чувств, готовы ли его близкие принять его таким.',170,'2100000 $',12,429,7.783,8.1,'https://image.openmoviedb.com/kinopoisk-images/1599028/19a7ebb8-067e-4a13-8ef0-32e00d1ea6b0/orig','movie'),('2024-04-07 20:27:58.955092','2024-04-07 20:27:58.955092',11907,'Шрэк',2001,'Жил да был в сказочном государстве большой зеленый великан по имени Шрэк. Жил он в гордом одиночестве в лесу, на болоте, которое считал своим. Но однажды злобный коротышка &#151; лорд Фаркуад, правитель волшебного королевства, безжалостно согнал на Шрэково болото всех сказочных обитателей.\nИ беспечной жизни зеленого великана пришел конец. Но лорд Фаркуад пообещал вернуть Шрэку болото, если великан добудет ему прекрасную принцессу Фиону, которая томится в неприступной башне, охраняемой огнедышащим драконом.',90,'60000000 $',18,430,8.17,7.9,'https://image.openmoviedb.com/kinopoisk-images/1946459/7ade06a8-4178-4386-9ee2-87fec5a172eb/orig','cartoon'),('2024-04-07 20:27:59.744026','2024-04-07 20:27:59.744026',11908,'Великий диктатор',1940,'Главный герой фильма, еврейский цирюльник, сражается в рядах армии своего государства Томании. Однажды, во время одного из сражений, он спасает жизнь летчику Шульцу, но в результате довольно жесткого приземления ударяется головой, теряет память и долгое время находится в больнице.\n\nШли годы, война давно уже закончилась, и в Томании приходит к власти диктатор Аденоид Хинкель, который яро ненавидит евреев и очень сильно похож на того самого еврейского цирюльника. Хинкель жаждет завоевать весь мир, а в это время цирюльник выходит из больницы и, ни о чем не подозревая, пытается наладить старую жизнь. Однако впереди его ждут невероятные приключения…',125,'2000000 $',0,431,8.072,8.4,'https://image.openmoviedb.com/kinopoisk-images/1900788/75ae49cc-000e-4815-bdab-4d86e609a0c4/orig','movie'),('2024-04-07 20:28:00.375391','2024-04-07 20:28:00.375391',11909,'Похитители велосипедов',1948,'Послевоенный Рим, давно неработающий Антонио вне себя от радости - он наконец-то находит работу. Но в первый же трудовой день у него украли велосипед, без которого невозможно работать! Вместе с маленьким сыном Бруно он пытается  найти  в огромном  городе украденный  велосипед,  от которого зависит жизнь его семьи...',89,'133000 $',12,432,7.967,8.3,'https://image.openmoviedb.com/kinopoisk-images/1773646/4927dde7-0b9a-4b58-8a0b-6c8d05703dcb/orig','movie'),('2024-04-07 20:28:00.910321','2024-04-07 20:28:00.910321',11910,'Паттон',1970,'По книгам «Паттон: испытания и триумф» и «История солдата» генерала Омара Н. Брэдли. Биография генерала Джорджа Паттона, чей темперамент часто оказывал влияние на ход военных действий во время второй мировой войны.',172,'12000000 $',12,433,6.969,7.9,'https://image.openmoviedb.com/kinopoisk-images/1599028/c5d335d9-c1cd-4953-b508-020f6e7a9c80/orig','movie'),('2024-04-07 20:28:01.540371','2024-04-07 20:28:01.540371',11911,'Африканская королева',1951,'1914 год, Восточная Африка. Пропахший джином капитан Чарли приплывает на своем пароходике в деревню, где находится христианская миссия преподобного Сэмюэла и его незамужней сестры Розы, которые среди диких африканских джунглей ведут себя так, будто по-прежнему находятся в старой доброй Англии. Но война докатывается и до Африки.\n\nВорвавшиеся в миссию немецкие солдаты сжигают деревню и угоняют жителей. Пережитое плохо отразилось на состоянии преподобного, вскоре он умирает, а Розе приходится бежать вместе с Чарли. Беспрерывно ссорясь друг с другом, чопорная миссионерка и бесшабашный капитан плывут по реке навстречу опасным и романтическим приключениям.',105,'1000000 $',0,434,7.177,7.7,'https://image.openmoviedb.com/kinopoisk-images/1704946/662715ab-b763-4067-bd9f-3fba9f450bd4/orig','movie'),('2024-04-07 20:28:02.256182','2024-04-07 20:28:02.256182',11912,'Зеленая миля',1999,'Пол Эджкомб — начальник блока смертников в тюрьме «Холодная гора», каждый из узников которого однажды проходит «зеленую милю» по пути к месту казни. Пол повидал много заключённых и надзирателей за время работы. Однако гигант Джон Коффи, обвинённый в страшном преступлении, стал одним из самых необычных обитателей блока.',189,'60000000 $',18,435,9.076,8.6,'https://image.openmoviedb.com/kinopoisk-images/1599028/4057c4b8-8208-4a04-b169-26b0661453e3/orig','movie'),('2024-04-07 20:28:02.885851','2024-04-07 20:28:02.885851',11913,'Бен-Гур',1959,'Иерусалим, 26 год нашей эры. Два друга детства, иудей Бен-Гур и римский трибун Мессала, встречаются после долгой разлуки взрослыми людьми. Мессала просит назвать самых ярых противников власти Рима, но Бен-Гур не может предать собственный народ и отказывается, что приводит к конфликту. Вскоре Мессала, воспользовавшись обстоятельствами, решает отомстить бывшему другу и укрепить свою власть. По надуманному обвинению он бросает в тюрьму мать и сестру Бен-Гура, а его самого отправляет на галеры.',212,'15000000 $',0,436,8.065,8.1,'https://image.openmoviedb.com/kinopoisk-images/1704946/da133add-04d7-409d-b135-c12c95ca5c08/orig','movie'),('2024-04-07 20:28:03.469451','2024-04-07 20:28:03.469451',11914,'Это случилось однажды ночью',1934,'Элли собирается замуж за знаменитого летчика Кинга Вестли, но ее отец презирает того, считая светским бездельником, поэтому он сажает дочь под замок и ищет основания для аннулирования помолвки. Элли удается бежать, и она отправляется навстречу суженому в Нью-Йорк на автобусе. В том же автобусе едет только что уволенный репортер Питер. Ему необходима сенсация, чтобы восстановить отношения с редактором. В лице беглой наследницы миллионов, которую ищет полиция всей страны, судьба улыбается ему.',105,'325000 $',0,437,7.919,8.1,'https://image.openmoviedb.com/kinopoisk-images/1773646/42b13491-e8b3-4de1-a82c-3bc0903be412/orig','movie'),('2024-04-07 20:28:04.069493','2024-04-07 20:28:04.069493',11915,'Филадельфийская история',1940,'Холодная красавица миссис Трейси разведена и готовится вновь выйти замуж за Джорджа, управляющего нефтяной компанией ее отца. Казалось бы, сомнений нет, но вдруг накануне торжества неожиданно появляется ее бывший муж Декстер в сопровождении двух корреспондентов - симпатичного молодого человека по имени Коннор и мисс Имбири - которые должны осветить в желтой прессе это светское событие.',112,'{}',12,438,7.578,7.9,'https://image.openmoviedb.com/kinopoisk-images/1777765/84c8b23f-07ec-48ca-b226-d9bd75dbde4d/orig','movie'),('2024-04-07 20:28:04.629752','2024-04-07 20:28:04.629752',11916,'Город бога',2002,'Город Бога — самая опасная фавела Рио-де-Жанейро, и именно здесь растут трое детей: Ракета, Малыш Фишка и Бенни. Поначалу они только наблюдают, как другие подростки грабят мотели и мелкие лавки, но круговорот насилия затягивает и их. Фишка — теперь Малыш Зе, главный наркоторговец и гроза всего района. Бенни — его лучший друг и правая рука, но его тяготит криминальный образ жизни. И только Ракете удается оставаться в стороне. Он мечтает стать фотографом и становится свидетелем и собирателем хроники гангстерских разборок, утопивших Город Бога в крови.',130,'3300000 $',18,439,8.02,8.6,'https://image.openmoviedb.com/kinopoisk-images/1599028/253edce8-cf8c-4045-a40b-81fc19374b00/orig','movie'),('2024-04-07 20:28:05.315297','2024-04-07 20:28:05.315297',11917,'Воспитание Крошки',1938,'Дэвид Хаксли &#151; чудаковатый палеонтолог, последние четыре года жизни по косточке воссоздающий скелет бронтозавра. За день до свадьбы злодейка-судьба сталкивает его со Сьюзан, неуемной молодой девицей, которая тут же положила на него глаз и начала причинять бесконечные неприятности, пытаясь заполучить его.',102,'1073000 $',0,440,7.707,7.8,'https://image.openmoviedb.com/kinopoisk-images/1704946/e840ca57-354a-44bf-a282-53add07fd18c/orig','movie'),('2024-04-07 20:28:05.840892','2024-04-07 20:28:05.840892',11918,'Принцесса Мононоке',1997,'Убив вепря, юный принц Аситака навлек на себя смертельное проклятие. Старая знахарка предсказала, что только он сам способен изменить свою судьбу, и отважный воин отправился в опасное путешествие. Так он оказался в загадочной стране, где люди под предводительством злой госпожи Эбоси воевали с обитателями леса: духами, демонами и гигантскими существами, каких Аситака раньше никогда не видел. \nИ была с ними принцесса Мононоке - повелительница зверей и дочь волчицы. Теперь судьба всех зависит только от одного воина - принца Аситаки.',134,'2400000000 ¥',12,441,8.232,8.3,'https://image.openmoviedb.com/kinopoisk-images/10835644/a9b9e3a8-5124-4181-856b-f4ffcbfcc525/orig','anime'),('2024-04-07 20:28:06.581058','2024-04-07 20:28:06.581058',11919,'Простая история',1999,'Семидесятитрехлетний Элвин Стрэйт, доживающий последние годы вместе с полоумной дочкой в тихом провинциальном городке, отправляется в путь, чтобы повидаться со своим старшим братом Лайлом, пережившим сердечный приступ. Элвин покупает подержанную газонокосилку (у него нет прав на вождение автомобиля) и отправляется в путь через два штата. Его ждут случайные придорожные знакомства, помощь добрых людей и, наконец, встреча с братом.',112,'10000000 $',12,442,7.825,8,'https://image.openmoviedb.com/kinopoisk-images/1629390/b63e41d4-4702-475a-b1ed-bcfc965e1a6a/orig','movie'),('2024-04-07 20:28:07.242080','2024-04-07 20:28:07.242080',11920,'Хладнокровный Люк',1967,'Однажды ночью выпив, Люк решил развлечься и свинтил газовым ключом дюжину монетоприемников на автостоянке, за что и получил два года ремонтно-строительных работ на дорогах в южных штатах. Еще во время войны он много раз испытывал свою судьбу на прочность, и тюрьма стала очередной проверкой, которую Люк, похоже, и искал.',126,'3200000 $',16,443,7.686,8.1,'https://image.openmoviedb.com/kinopoisk-images/1900788/6a3f204c-f052-4ba7-9ca6-5888db587022/orig','movie'),('2024-04-07 20:28:07.812950','2024-04-07 20:28:07.812950',11921,'Терминатор 2: Судный день',1991,'Прошло более десяти лет с тех пор, как киборг из 2029 года пытался уничтожить Сару Коннор — женщину, чей будущий сын выиграет войну человечества против машин.\n\nТеперь у Сары родился сын Джон и время, когда он поведёт за собой выживших людей на борьбу с машинами, неумолимо приближается. Именно в этот момент из постапокалиптического будущего прибывает новый терминатор — практически неуязвимая модель T-1000, способная принимать любое обличье. Цель нового терминатора уже не Сара, а уничтожение молодого Джона Коннора.\n\nОднако шансы Джона на спасение существенно повышаются, когда на помощь приходит перепрограммированный сопротивлением терминатор предыдущего поколения. Оба киборга вступают в смертельный бой, от исхода которого зависит судьба человечества.',137,'102000000 $',18,444,8.36,8.6,'https://image.openmoviedb.com/kinopoisk-images/1704946/ade65029-952f-488d-87b2-20c676970151/orig','movie'),('2024-04-07 20:28:08.430187','2024-04-07 20:28:08.430187',11922,'Телохранитель',1961,'В некий японский городок приходит самурай. Самурай выглядит совершенно не по-самурайски: плохо пострижен, не причёсан. А в городе две организованные преступные группировки, созданные местечковыми олигархами из лиц, находящихся под следствием и в розыске, терроризируют жителей городка, жестоко страдающих от бандитского беспредела. Проявляя недюжинную оперативную смекалку и мастерски работая мечом, попеременно нанимаясь телохранителем то в одну, то в другую банду, самурай искусно сокращает поголовье уродов, попутно решая собственные задачи.',110,'{}',16,445,7.99,8.2,'https://image.openmoviedb.com/kinopoisk-images/1599028/b090023f-852b-4151-bb20-a370928d367d/orig','movie'),('2024-04-07 20:28:09.085290','2024-04-07 20:28:09.085290',11923,'Гроздья гнева',1940,'После тюремного срока за убийство Том Джоад возвращается на своё семейное ранчо, которое к тому времени полностью разорилось и пребывает в запустении. В отсутствие какой-либо перспективы найти работу в засушливой Оклахоме вся семья собирает свой скарб и отправляется на «землю обетованную» - в Калифорнию. \nНо трудный путь и тяжкие условия не приносят искомой надежды, и даже единство семьи подвергается испытаниям.',129,'800000 $',18,446,7.584,8.1,'https://image.openmoviedb.com/kinopoisk-images/1704946/654e8b09-5458-43a8-9f35-3b83f79d13d2/orig','movie'),('2024-04-07 20:28:09.596862','2024-04-07 20:28:09.596862',11924,'Звёздные войны: Эпизод 6 — Возвращение Джедая',1983,'В шестом эпизоде «Звездных войн» Дарт Вейдер создает вторую «Звезду Смерти». Он объединяет все силы зла, чтобы с помощью этого смертоносного оружия нанести последний сокрушительный удар по повстанцам и их союзникам.\n\nЛюк Скайуокер вместе с принцессой Лейей и верными дроидами R2D2 и C-3PO отправляется спасать своего друга Хана Соло, который попал в плен к отвратительному Джаббе Хатту - могущественному повелителю преступников.\n\nПовстанцы высаживаются на планету Эндор, чтобы оттуда вместе с Люком и его отрядом предпринять последнюю атаку на Имперский флот, атаку, от которой зависит судьба Галактики. В этом эпизоде Люк Скайуокер и Дарт Вейдер встречаются в последний раз... ибо из поединка между отцом и сыном живым выйдет только один...',131,'32500000 $',12,447,8.155,8.3,'https://image.openmoviedb.com/kinopoisk-images/6201401/1ae91486-01cd-424e-8562-119a73add1e6/orig','movie'),('2024-04-07 20:28:10.221938','2024-04-07 20:28:10.221938',11925,'Форрест Гамп',1994,'Сидя на автобусной остановке, Форрест Гамп — не очень умный, но добрый и открытый парень — рассказывает случайным встречным историю своей необыкновенной жизни.\n\nС самого малолетства парень страдал от заболевания ног, соседские мальчишки дразнили его, но в один прекрасный день Форрест открыл в себе невероятные способности к бегу. Подруга детства Дженни всегда его поддерживала и защищала, но вскоре дороги их разошлись.',142,'55000000 $',18,448,8.921,8.8,'https://image.openmoviedb.com/kinopoisk-images/1599028/3560b757-9b95-45ec-af8c-623972370f9d/orig','movie'),('2024-04-07 20:28:10.906665','2024-04-07 20:28:10.906665',11926,'Мышьяк и старые кружева',1944,'Не зря возражал отец Элейн против брака его дочери с Мортимером в канун Хэллоуина. Всё сразу пошло наперекосяк. Молодожёны переезжают в большой мрачный дом семьи Брюстер в Бруклине, неподалёку от старинного кладбища. В доме живут две милые старые тётушки Мортимера и абсолютно сумасшедший двоюродный брат, считающий себя президентом Рузвельтом.\n\nНеожиданно появляется ещё один брат – убийца-маньяк, только что сбежавший из тюрьмы. Может, хотя бы старушки нормальны? Увы…',118,'1120175 $',12,449,7.817,7.9,'https://image.openmoviedb.com/kinopoisk-images/1600647/267825f9-a7ea-47fc-a8d7-f3eb2b0d38f8/orig','movie'),('2024-04-07 20:28:11.507921','2024-04-07 20:28:11.507921',11927,'Дикая банда',1969,'Начало XX века. Эпоха Дикого Запада подходит к концу. Во время ограбления офиса железной дороги банда под предводительством стареющего Пайка Бишопа попадает в засаду. Завязывается ожесточённая перестрелка, в которой погибают несколько бандитов и много местных жителей. С трудом вырвавшись из ловушки и оставшись без награбленного, Бишоп и четверо оставшихся в живых подельников решают провернуть последнее дело в Мексике, чтобы сорвать большой куш и уйти на покой. Однако всё идёт не совсем по плану, а в погоню за бандитами уже отправлен отряд стрелков во главе с бывшим членом банды Диком Торнтоном.',145,'6000000 $',18,450,7.7,7.9,'https://image.openmoviedb.com/kinopoisk-images/1898899/3e86b010-5bf7-4120-9f6a-cd9c90b3b5c9/orig','movie'),('2024-04-07 20:28:12.158443','2024-04-07 20:28:12.158443',11928,'Непрощенный',1992,'История Уильяма Мунни — бывшего хладнокровного убийцы, нашедшего в себе силы покончить с грязным ремеслом. Он стал фермером, завел семью. Но все складывается совсем не так, как ему хотелось.',131,'14400000 $',18,451,7.82,8.2,'https://image.openmoviedb.com/kinopoisk-images/4486362/756e6a92-87df-4082-a1d8-81117a7c03fe/orig','movie'),('2024-04-07 20:28:12.718084','2024-04-07 20:28:12.718084',11929,'Рождественская история',1983,'Индиана, 1940 год. Девятилетний Ральфи мечтает об идеальном рождественском подарке - настоящей двухсотзарядной пневматической винтовке Красного Наездника.\n\nВорчливый папаша и заботливая мамочка, естественно, против, полагая, что их драгоценный сынуля может себя покалечить! И тогда Ральфи решает обратиться за помощью к самому Санта-Клаусу.',93,'3300000 $',12,452,6.902,7.9,'https://image.openmoviedb.com/kinopoisk-images/1898899/f0ce249b-880b-467f-bb99-5936bb376e78/orig','movie'),('2024-04-07 20:28:13.332178','2024-04-07 20:28:13.332178',11930,'Ночь охотника',1955,'Мальчику Джону и его сестричке Пэрл «посчастливилось» увидеть, как их отца увозит полиция, схватив его за ограбление и убийство двух человек. Отца приговаривают к смерти и вешают, в наследство детям остаются украденные деньги, которые отец спрятал, взяв с Джона и Пэрл слово, что они никому не расскажут о тайнике, даже матери. В тюрьме он познакомился с проповедником Гарри Пауэллом, а на деле — безжалостным убийцей, помешанном на религии, со словами «любовь» и «ненависть», вытатуированными на пальцах рук. Пауэлл решает добраться до тайника и для этого женится на доверчивой вдове.',92,'795000 $',100,453,7.182,8,'https://image.openmoviedb.com/kinopoisk-images/4486454/689c3463-2827-428b-91a2-6a093a053951/orig','movie'),('2024-04-07 20:28:13.981259','2024-04-07 20:28:13.981259',11931,'Почти знаменит',2000,'История о том, как простой американский мальчишка Уильям Миллер волею случая стал корреспондентом авторитетного музыкального журнала «Роллинг Стоун» и отправился по заданию редакции в турне с группой «Стиллуотер».\n\nВ компании суровых рокеров, юных фанаток и бурлящих в крови гормонов парень делает свой первый шаг в полную удивительных приключений взрослую жизнь расклешенных семидесятых. И уж, поверьте, эти самые приключения не заставят себя ждать!',123,'60000000 $',18,454,7.643,7.9,'https://image.openmoviedb.com/kinopoisk-images/10671298/872350a9-e317-40bd-9deb-4521eeaaa4c2/orig','movie'),('2024-04-07 20:28:14.650128','2024-04-07 20:28:14.650128',11932,'Молодой Франкенштейн',1974,'Молодой доктор Фредерик Франкентшейн, внук Виктора Франкенштейна, невероятно стыдящийся близкого родства со знаменитым бароном, отправляется в Трансильванию, чтобы вступить во владение замком, оставленным дедом ему в наследство. Фредерик долгие годы был уверен, что работа его дедушки &#151; полнейшая ерунда, но найдя в замке книгу с описанием его экспериментов и внимательно изучив её, молодой человек резко меняет мнение.',108,'2800000 $',16,455,7.325,8,'https://image.openmoviedb.com/kinopoisk-images/1773646/9ee7cd96-ee35-41ca-a32a-270df1c48b5a/orig','movie'),('2024-04-07 20:28:15.216042','2024-04-07 20:28:15.216042',11933,'Унесённые ветром',1939,'Могучие ветры Гражданской войны в один миг уносят беззаботную юность южанки Скарлетт О`Хара, когда привычный шум балов сменяется грохотом канонад на подступах к родному дому. Для молодой женщины, вынужденной бороться за новую жизнь на разоренной земле, испытания и лишения становятся шансом переосмыслить идеалы, обрести веру в себя и найти настоящую любовь.',222,'3977000 $',12,456,8.384,8.2,'https://image.openmoviedb.com/kinopoisk-images/4716873/44bc3765-61ca-4487-8efd-045138a7dfd0/orig','movie'),('2024-04-07 20:28:15.925518','2024-04-07 20:28:15.925518',11934,'Лагерь для военнопленных №17',1952,'Когда двое сбежавших американских заключённых Второй мировой были убиты, немецкий военнопленный, спекулянт лагерных казарм, Джей Джей Сефтон стал подозреваться в доносе.',115,'1661530 $',100,457,7.267,8,'https://image.openmoviedb.com/kinopoisk-images/1599028/5a202bfd-1f59-405a-97e7-2e13a60828b4/orig','movie'),('2024-04-07 20:28:16.560798','2024-04-07 20:28:16.560798',11935,'Корпорация монстров',2001,'Склизкий гад в сливном бачке, мохнатый зверь, похожий на чудовище из «Аленького цветочка», гигантские мокрицы под кроватью — все они существуют на самом деле. Все, что им нужно — пугать детей, потому что из детских криков они получают электричество.\nПолнометражный мультфильм рассказывает о кризисах в мире монстров, их жизни. Но однажды вся мирная жизнь монстров оказывается под угрозой: в их мир попадает ребенок. А с детьми столько хлопот, что они могут довести даже монстров.',92,'115000000 $',0,458,8.13,8.1,'https://image.openmoviedb.com/kinopoisk-images/1599028/cb32895b-a8c3-4362-83cd-eaa3990b456b/orig','cartoon'),('2024-04-07 20:28:17.324102','2024-04-07 20:28:17.324102',11936,'Бильярдист',1961,'Бильярдист и кидала Эдди Фелсон вместе с напарником действуют по проверенной схеме. Сначала Эдди позволяет противнику выигрывать, потом взвинчивает ставки и обирает соперника до нитки. Вскоре Эдди решает бросить вызов одному из сильнейших бильярдистов страны по прозвищу Толстяк Миннесота.',134,'2000000 $',16,459,7.836,8,'https://image.openmoviedb.com/kinopoisk-images/1599028/6972ba99-e615-4059-9a29-7678cf305744/orig','movie'),('2024-04-07 20:28:17.888059','2024-04-07 20:28:17.888059',11937,'На Западном фронте без перемен',1930,'Рассказ о простых немецких школьниках старших классов, которые под действием патриотической пропаганды идут на войну, принимая её как игру, и не знают, что впереди их ждет только смерть.',136,'1200000 $',12,460,7.958,8.1,'https://image.openmoviedb.com/kinopoisk-images/1946459/0fab1c78-d573-4128-a29e-60bc9fc9fbef/orig','movie'),('2024-04-07 20:28:18.461740','2024-04-07 20:28:18.461740',11938,'Разговор',1974,'Гарри Коул — лучший на Западном побережье эксперт по прослушивающим устройствам. Записав по заказу крупного бизнесмена беседу некой парочки, гуляющей по площади, Коул нарушает свое главное правило — не совать нос в дела заказчика — и пытается предотвратить убийство, которое, как ему кажется, вот-вот должно произойти.',113,'1600000 $',16,461,7.571,7.7,'https://image.openmoviedb.com/kinopoisk-images/1629390/8f0efe6b-1ed1-40a9-8879-545ac01d5040/orig','movie'),('2024-04-07 20:28:19.080632','2024-04-07 20:28:19.080632',11939,'Быть Джоном Малковичем',1999,'Кукольник-неудачник по имени Шварц устраивается на работу в странную и невероятно тесную контору. В своем кабинете новоиспеченный клерк Крэйг обнаруживает крошечную потайную дверцу. Удивлению не было границ, когда он обнаружил, что за дверцей скрыт ход... в мозг голливудской звезды Джона Малковича! И тогда предприимчивый кукловод решает организовать доходное предприятие по организации экскурсий в голову звезды для всех желающих.',113,'13000000 $',18,462,7.255,7.7,'https://image.openmoviedb.com/kinopoisk-images/1704946/20d85f7c-e113-4a80-8e4c-a0d0912025b7/orig','movie'),('2024-04-07 20:28:19.695911','2024-04-07 20:28:19.695911',11940,'Поговори с ней',2002,'В поисках интересного персонажа для статьи журналист Марко встречается со знаменитой женщиной-тореро Лидией. Их знакомство перерастает в страстную любовь, но все надежды рушит трагедия на корриде: удар разъяренного быка повергает Лидию в кому. Проводя дни и ночи в больнице, Марко знакомится с медбратом Бениньо. Он не первый год заботится о впавшей в кому Алисии, которую страстно любит, не надеясь на взаимность.\nСхожие судьбы объединяют мужчин, но Бениньо счастлив, а Марко страдает, будучи не в силах выразить Лидии свои чувства. Видя отчаяние Марко, Бениньо дает ему совет: «Поговори с ней». Теперь только сокровенные разговоры связывают любимых, и может быть, простые слова однажды сотворят чудо, на которое так надеются Марко и Бениньо…',112,'{}',18,463,7.756,7.9,'https://image.openmoviedb.com/kinopoisk-images/1629390/2f3e65ba-618e-4d0e-808a-dd74742adb23/orig','movie'),('2024-04-07 20:28:20.288104','2024-04-07 20:28:20.288104',11941,'Человек-слон',1980,'Доктор Тривз находит Меррика в «фрик-шоу». Внешность его настолько ужасающая, что ему приходится носить просторное одеяние, чтобы никто не увидел его пугающих наростов по всему телу. Забрав Меррика в больницу после очередного избиения хозяином, Тривз с удивлением обнаруживает в нем человека интеллектуально развитого и духовного. Профессиональный интерес сменяется состраданием, феномен становится моден в высшем свете, сама королева благословляет оставить его в больнице навсегда.',125,'5000000 $',18,464,8.109,8.2,'https://image.openmoviedb.com/kinopoisk-images/1946459/8daaaf75-004f-4740-a020-004fd6b37094/orig','movie'),('2024-04-07 20:28:20.900169','2024-04-07 20:28:20.900169',11942,'Торжество',1998,'В шикарном загородном особняке намечается торжество. На юбилей почтенного отца большого семейства съезжаются дети и родственники. В зале накрыт изумительный стол, откупорены изысканные вина. За столом нет только одной из дочерей юбиляра, покончившей с собой при таинственных обстоятельствах. Праздник начинается. Старший сын произносит первый тост. Никто не подозревает, что собравшимся нарядным гостям предстоит услышать шокирующую и жуткую правду...',105,'1300000 $',18,465,7.405,8,'https://image.openmoviedb.com/kinopoisk-images/1704946/07a3c8aa-f536-4ff0-8483-8e898a863c82/orig','movie'),('2024-04-07 20:28:21.485240','2024-04-07 20:28:21.485240',11943,'Малхолланд Драйв',2001,'Загадочная девушка, после автомобильной аварии страдающая потерей памяти, выбирает себе имя Рита с рекламного плаката к фильму с Ритой Хейворт и пытается начать новую жизнь в Голливуде. Но тайны прошлого неотступно преследуют ее.\n\nКто были те двое мужчин, что сидели в одной машине с ней и погибли в аварии? Почему полиция подозревает, что она была ими похищена? И случайно ли в ее жизни появляется новая подруга, начинающая актриса Бетти?',147,'15000000 $',18,466,7.668,7.9,'https://image.openmoviedb.com/kinopoisk-images/1777765/477bd555-16ee-47aa-be90-6a252c189414/orig','movie'),('2024-04-07 20:28:22.173200','2024-04-07 20:28:22.173200',11944,'Свой человек',1999,'Джеффри Уайгэнда увольняют с поста вице-президента крупнейшей табачной компании за то, что он протестует против использования в табачной продукции компонента, вызывающего у курильщиков наркотическую зависимость. Лоуэлл Бергман, продюсер популярного телешоу, узнает об этом и убеждает Уайгэнда выступить с разоблачительным интервью по телевидению...\n\nЕстественно, это очень не нравится столпам табачной индустрии, заверяющих в безвредности производимой продукции. Олигархи принимают самые суровые меры, чтобы информация не стала достоянием гласности. От Уайгэнда уходит жена, Лоуэлла Бергмана отправляют в отпуск. Там, где задействованы большие деньги, бесполезно бороться за справедливость, но Лоуэлл и Уайгэнд не прекращают борьбу.',157,'90000000 $',18,467,7.636,7.8,'https://image.openmoviedb.com/kinopoisk-images/1898899/9b7539de-4e5d-4e0a-b887-e7cd33d4222b/orig','movie'),('2024-04-07 20:28:22.793430','2024-04-07 20:28:22.793430',11945,'Взвод',1986,'В сентябре 1967 года куда-то в приграничный район между Вьетнамом и Камбоджей прибыл рядовой 25-го пехотного полка Крис Тэйлор. Прибыл, чтобы своими глазами увидеть, как выглядит подлинный ад. Не потусторонний, вымышленный, сочинённый писателями или художниками, а натуральный, вполне земной ад, на территории которого схлестнулись друг с другом сержант Боб Барнс и сержант Илайес Гродин. Они тоже думали, что будут воевать с партизанами-вьетконговцами, но оказалось, что иногда приходится драться со своими.',120,'6000000 $',16,468,8.003,8.1,'https://image.openmoviedb.com/kinopoisk-images/1629390/a02bf265-5cca-47ff-8778-1632925207f6/orig','movie'),('2024-04-07 20:28:23.441297','2024-04-07 20:28:23.441297',11946,'Однажды в Америке',1983,'В бурные двадцатые годы, когда Америка веселилась под звуки джаза, и каждый бродяга мечтал стать миллионером, в трущобах Нью-Йорка встретились несколько отчаянных парней. Убирая с дороги конкурентов, безжалостно карая предателей и нагло проворачивая хитроумные аферы, они стали королями преступного мира золотой эры «сухого закона». Они поклялись отдать жизнь друг за друга, зная, что самое главное для них — это дружба, долг и справедливость — не утопить в реках крови и бездонном океане денег. Спустя много лет судьба жестоко обошлась с легендарными гангстерами, заставив их исполнить свою клятву. Это случилось однажды в Америке…',229,'30000000 $',18,469,8.273,8.3,'https://image.openmoviedb.com/kinopoisk-images/1704946/6d167cdd-8413-4ecc-8452-cee93be46d51/orig','movie'),('2024-04-07 20:28:24.082485','2024-04-07 20:28:24.082485',11947,'Его девушка Пятница',1939,'Уолтер Берне — главный редактор газеты, Хильди Джонсон — его бывшая жена и лучший репортер. Однажды она сообщает Уолтеру, что выходит замуж и увольняется. Уолтер все еще любит Хильди, да и лучшего сотрудника терять не хочет, поэтому он дает ей последнее задание — взять интервью у приговоренного к смерти Эрла Уильямса. Это будет ее лучший репортаж, вершина карьеры.',92,'{}',18,470,7.441,7.8,'https://image.openmoviedb.com/kinopoisk-images/4303601/c7bfdb56-a3e2-4620-b970-8fba7bfa3d24/orig','movie'),('2024-04-07 20:28:24.692203','2024-04-07 20:28:24.692203',11948,'Крепкий орешек',1988,'В суперсовременном небоскребе Лос-Анджелеса полицейский Джон Макклейн ведет смертельную схватку с бандой политических террористов, взявших в заложники два десятка человек, в число которых попадает и его жена. Началось все с того, что парень приехал в город к жене, оказался на рождественском приеме, а кончилось настоящей войной...',133,'28000000 $',18,471,8.045,8.2,'https://image.openmoviedb.com/kinopoisk-images/1704946/f55f782b-2dcd-4e4c-be87-0cc13333f857/orig','movie'),('2024-04-07 20:28:25.309606','2024-04-07 20:28:25.309606',11949,'Индиана Джонс и последний крестовый поход',1989,'На этот раз бесстрашный Индиана разыскивает самую таинственную реликвию в истории человечества — Святой Грааль. В этом археологу помогает его отец, профессор Джонс старший. Теперь под бдительным оком своего отца Индиане предстоит совершить много благородных подвигов и потрясающих открытий. В новых странствиях храброму археологу доведется добыть чашу, которую держал в руках Иисус Христос и получить автограф… самого Адольфа Гитлера.',127,'48000000 $',12,472,8.074,8.2,'https://image.openmoviedb.com/kinopoisk-images/4774061/0e5b1224-39cf-4b6d-af24-4ec58d53bed2/orig','movie'),('2024-04-07 20:28:25.901371','2024-04-07 20:28:25.901371',11950,'Великая иллюзия',1937,'Первая мировая война. Самолет французских летчиков Морешаля и Больде сбит немецким асом фон Рауффенштайном, но оба пилота остались живы и попали в лагерь для военнопленных. Там же находятся несколько британских офицеров, с которыми новички объединяются в работе над тоннелем для побега.\nПосле победы французов на Западном фронте Морешаля, Болдье и остальных французских военнопленных переводят в другую тюрьму, где комендантом назначен их «старый знакомый» фон Рауффенштайн. Комендант тепло встречает французов, замечая, что из «его» тюрьмы побег невозможен...',114,'{}',12,473,7.817,8.1,'https://image.openmoviedb.com/kinopoisk-images/10893610/a3dd386e-51df-48f8-bb31-7ab169e35f0f/orig','movie'),('2024-04-07 20:28:26.471408','2024-04-07 20:28:26.471408',11951,'Гладиатор',2000,'В великой Римской империи не было военачальника, равного генералу Максимусу. Непобедимые легионы, которыми командовал этот благородный воин, боготворили его и могли последовать за ним даже в ад.\n\nНо случилось так, что отважный Максимус, готовый сразиться с любым противником в честном бою, оказался бессилен против вероломных придворных интриг. Генерала предали и приговорили к смерти. Чудом избежав гибели, Максимус становится гладиатором.\n\nБыстро снискав себе славу в кровавых поединках, он оказывается в знаменитом римском Колизее, на арене которого он встретится в смертельной схватке со своим заклятым врагом...',155,'103000000 $',18,474,8.584,8.5,'https://image.openmoviedb.com/kinopoisk-images/1599028/7c3460dc-344d-433f-8220-f18d86c8397d/orig','movie'),('2024-04-07 20:28:27.234547','2024-04-07 20:28:27.234547',11952,'Спартак',1960,'История гладиатора Спартака, его возлюбленной Варинии и честолюбивого римского полководца Красса. Непреодолимая тяга к свободе заставляет Спартака поднять легендарное восстание рабов, ставшее важнейшей вехой мировой истории.',197,'12000000 $',0,475,7.853,7.9,'https://image.openmoviedb.com/kinopoisk-images/1629390/f45c47dc-541e-459b-9dbe-5f56861e7ee9/orig','movie'),('2024-04-07 20:28:27.950369','2024-04-07 20:28:27.950369',11953,'Назад в будущее',1985,'Подросток Марти с помощью машины времени, сооружённой его другом-профессором доком Брауном, попадает из 80-х в далекие 50-е. Там он встречается со своими будущими родителями, ещё подростками, и другом-профессором, совсем молодым.',116,'19000000 $',12,476,8.646,8.5,'https://image.openmoviedb.com/kinopoisk-images/1599028/73cf2ed0-fd52-47a2-9e26-74104360786a/orig','movie'),('2024-04-07 20:28:28.559483','2024-04-07 20:28:28.559483',11954,'Магнолия',1999,'Эта история произошла в долине Сан-Фернандо в дождливый день, когда на небе не было ни облачка. Благодаря вмешательству высших сил, а также нагромождению совпадений, случайностей, действий разных людей, их жизни и судьбы переплетутся и проникнут друг в друга в течение одного дня, финал которого будет незабываемым.',189,'37000000 $',18,477,7.392,8,'https://image.openmoviedb.com/kinopoisk-images/6201401/cb5ccf61-e366-41dd-a7bc-a2f4a163e835/orig','movie'),('2024-04-07 20:28:29.077802','2024-04-07 20:28:29.077802',11955,'Золотая лихорадка',1925,'История о злоключениях извечного любимца публики, маленького бродяги, который на этот раз отправляется на золотые прииски Аляски и как всегда порадует вас бесконечным калейдоскопом трюков и комических ситуаций.',95,'923000 $',0,478,8.05,8.1,'https://image.openmoviedb.com/kinopoisk-images/1946459/1e5c3624-ecd2-42a6-a296-e089a9c7e8d9/orig','movie'),('2024-04-07 20:28:29.781735','2024-04-07 20:28:29.781735',11956,'Отточенное лезвие',1995,'Карл после совершенного им жестокого преступления провел двадцать пять лет в сумасшедшем доме. Возвратившись в город своей молодости, в один из южных штатов Америки, он ведет себя спокойно и разумно. Это помогает ему найти работу и подружиться с мальчиком и его матерью-вдовой. Однако появление отвратительного и грубого любовника этой женщины ставит Карла перед мучительным выбором и ведет к резким переменам в жизни всех, вовлеченных в эту историю.',135,'1000000 $',18,479,7.693,8,'https://image.openmoviedb.com/kinopoisk-images/1629390/42132596-55b5-4d54-b2a7-f85ca3b5f628/orig','movie'),('2024-04-07 20:28:30.299607','2024-04-07 20:28:30.299607',11957,'Шарада',1963,'Очаровательная американка Регги Ламберт, подав на развод, уезжает на курорт, где знакомится с привлекательным незнакомцем Питером Джошуа. По возвращении в Париж ее ждет ужасная новость: ее муж убит при загадочных обстоятельствах, а все семейные сбережения были сняты с банковского счета и исчезли в неизвестном направлении.\n\nИ вот в жизни героини во второй раз появляется ее недавний знакомый под другим именем, а за ним - целая толпа «однополчан» ее покойного супруга, жаждущих заполучить кругленькую сумму, которую ее благоверный украл во время Второй мировой войны. Все ее преследователи уверены, что она-то уж точно знает о местонахождении злосчастного наследства. \n\nПо мере того как охотники за «военным трофеем» начинают погибать один за другим, Регине становится все сложней разобраться, кому она может доверять.',113,'4000000 $',18,480,7.915,7.8,'https://image.openmoviedb.com/kinopoisk-images/1777765/a7b4d4fa-5de9-4a8d-8860-cd9c191dd4ef/orig','movie'),('2024-04-07 20:28:30.959052','2024-04-07 20:28:30.959052',11958,'Броненосец «Потемкин»',1925,'Сюжет, основанный на подлинном историческом событии, образно выразил основные социальные тенденции ХХ века: массовое стремление к свободе, борьбу с тиранией, защиту человеческого достоинства, призыв к единению людей во имя  равноправия. Новаторская форма фильма и сегодня оказывает глубокое влияние на развитие выразительных средств кино.',75,'{}',0,481,7.923,7.9,'https://image.openmoviedb.com/kinopoisk-images/1773646/4172eb77-5859-4a09-90b8-3e9bcc793ca4/orig','movie'),('2024-04-07 20:28:31.622535','2024-04-07 20:28:31.622535',11959,'История игрушек',1995,'В спальне Энди его игрушки начинают жить своей жизнью, как только он выходит из комнаты. В день рождения мальчика царит паника — все боятся появления новой игрушки, которая перетянет внимание на себя. И только любимчик Эдди, ковбой Вуди, ни о чем не переживает. Однако, когда мальчик получает в подарок фигурку астронавта Базза Лайтера, Вуди очень быстро оказывается забыт. И тогда ковбой решает вернуть себе первое место в сердце Энди.',81,'30000000 $',0,482,7.949,8.3,'https://image.openmoviedb.com/kinopoisk-images/1704946/46fd178b-9a99-4974-a7b5-4b56bbc4b08e/orig','cartoon'),('2024-04-07 20:28:32.338468','2024-04-07 20:28:32.338468',11960,'Бразилия',1985,'Сэм Лоури вполне доволен жизнью. Он работает мелким служащим и согласен мириться с необустроенным бытом вопреки воле матери, входящей в элиту системы. Но внезапно он встречает девушку, которую постоянно видит в своих снах. Чтобы снова встретить её, он решается сменить работу.',132,'15000000 $',18,483,7.738,7.9,'https://image.openmoviedb.com/kinopoisk-images/1704946/40df2a3e-0cd8-4508-9340-9f0f3d8f17f5/orig','movie'),('2024-04-07 20:28:32.992172','2024-04-07 20:28:32.992172',11961,'Приключения Робин Гуда',1938,'Как известно из легенд, добрый король английский Ричард отправился в Крестовый поход и попал там в плен. Принц Джон захватил трон и, движимый жаждой наживы, начал обирать народ.\n\nРазоренный им сэр Робин Локсли ушел в Шервудский лес и под именем Робин Гуда возглавил банду разбойников, объявив войну прихвостням принца Джона - рыцарю Гаю Гизборну и трусливому шерифу Ноттингема.\n\nПопутно он сражался за сердце томно-мечтательной леди Марианны - прекрасной Оливии Де Хэвилленд.',98,'1900000 $',12,484,7.017,7.9,'https://image.openmoviedb.com/kinopoisk-images/1629390/d0247eed-df05-41e4-92f8-b509cf77b847/orig','movie'),('2024-04-07 20:28:33.624616','2024-04-07 20:28:33.624616',11962,'Житие Брайана по Монти Пайтон',1979,'Оказывается, 2000 лет назад волхвы слегка промахнулись и из-за небольшой астрономической ошибки явили, было, свои дары не тому новорожденному, которому следовало. Дитя звали Брайан, и он просто родился в тот же час и лишь домом дальше, чем Сами-Знаете-Кто. По причине сего инцидента потом все путали Брайана с Мессией, а ему было лень разубеждать своих поклонников.\n\nОднако в почитании масс помимо приятной стороны есть и другая, и вот Брайан с тревогой обнаруживает себя в роли отчаянного религиозного лидера народного Фронта Иудеи, борющегося за свободу от римского ига - и в эпицентре больших неприятностей с оккупационными властями!…',94,'4000000 $',16,485,7.806,8,'https://image.openmoviedb.com/kinopoisk-images/1900788/abec4924-5899-4f94-be6b-2a3cfaf4d3ad/orig','movie'),('2024-04-07 20:28:34.116862','2024-04-07 20:28:34.116862',11963,'Трамвай «Желание»',1951,'Бланш Дюбуа приезжает в Новый Орлеан к беременной сестре Стелле, живущей с мужем Стэнли в местных трущобах. Бланш сообщает сестре, что разорена, ушла с работы и жить ей негде и не на что. Стэнли, воплощение естественности и грубости, сразу невзлюбил её за пристрастие к алкоголю и неуместное кокетство. Вскоре у Бланш появляется поклонник и призрачная надежда на замужество, но Стэнли расстраивает их помолвку.',122,'1800000 $',12,486,7.98,7.9,'https://image.openmoviedb.com/kinopoisk-images/1773646/1b1666b7-b135-4ca5-914e-2d05bdc74c38/orig','movie'),('2024-04-07 20:28:34.641382','2024-04-07 20:28:34.641382',11964,'Вечер в опере',1935,'Ловкач Отис Дрифтвуд придумал способ прикарманить денежки богатой вдовы, делами которой он управлял. Вдовушка спала и видела, как бы пробиться в высшее общество и Отис подговорил её вложить круглую сумму в нью-йоркскую оперу. Вместо прославленного тенора Ласпари Отис нанял певца из хора, а остальное присвоил. Певец оказался действительно хорош и за 10 долларов отработал на всю тысячу, а заодно покорил сердце любимой хористки.',96,'{}',12,487,6.968,7.8,'https://image.openmoviedb.com/kinopoisk-images/1773646/fa51a908-1b45-450a-a9d2-a4204f66cdab/orig','movie'),('2024-04-07 20:28:35.242039','2024-04-07 20:28:35.242039',11965,'Сука-любовь',2000,'Мехико-Сити, фатальная авария. Сталкиваются три жизни, раскрывая предательскую сторону человеческой природы. Будоражащая и волнующая история об искуплении и об уязвимости и сложности человеческой жизни.',153,'2000000 $',18,488,7.914,8.1,'https://image.openmoviedb.com/kinopoisk-images/6201401/8bc62570-5a5d-4926-8afb-267bcf2eefc1/orig','movie'),('2024-04-07 20:28:35.908874','2024-04-07 20:28:35.908874',11966,'Свидетель обвинения',1957,'Сэр Уилфрид Робартс - тяжело больной адвокат, которому врачи запретили заниматься уголовными делами. Выполнить их рекомендации он смог только благодаря заботливой домашней медсестре мисс Плимсолл. Но когда его поверенный приводит к нему домой подозреваемого в убийстве Леонарда Воула, Робартс не может устоять и соглашается вести дело.',116,'3000000 $',12,489,8.162,8.4,'https://image.openmoviedb.com/kinopoisk-images/1773646/e317311b-2ad4-4a05-9578-5a9cae5d40cd/orig','movie'),('2024-04-07 20:28:36.647182','2024-04-07 20:28:36.647182',11967,'Кто боится Вирджинии Вульф?',1966,'Два часа ночи в Новой Англии. Джордж — подавленный профессор истории, женатый на Марте, распутнице, чей отец является ректором колледжа, где преподает Джордж. После двадцати лет брака их союз постоянно скачет от любви к ненависти. Марта любит сравнивать своего слабого супруга со своим сильным отцом, зная, что это злит её мужа. Накануне вечером они отправились на вечеринку факультета, где познакомились с молодыми сотрудниками Ником и Хани. Ник, преподаватель биологии, считает себя сердцеедом, а Хани, по определению Марты, серая мышка. Супружеская пара постарше приглашает вторую зайти в их комфортабельный дом и выпить по рюмочке на прощанье. Всю ночь напролёт они выпивают, танцуют и играют в психологические «игры».',131,'7500000 $',16,490,7.82,8,'https://image.openmoviedb.com/kinopoisk-images/1599028/7218bf31-9bf7-4fa2-ae0f-c9ea35ce9794/orig','movie'),('2024-04-07 20:28:37.155443','2024-04-07 20:28:37.155443',11968,'Изгоняющий дьявола',1973,'В семью известной актрисы приходит беда — её несовершеннолетняя дочь начинает вести себя неадекватным образом. Мать полагает, что это следствие её личной трагедии, врачи подозревают психическое заболевание, но не могут поставить диагноз. Специально приглашенный священник подозревает, что девочка одержима дьяволом.',122,'12000000 $',18,491,7.693,8.1,'https://image.openmoviedb.com/kinopoisk-images/1898899/f1914ada-0b00-4afa-8560-b928cc597a9e/orig','movie'),('2024-04-07 20:28:37.856757','2024-04-07 20:28:37.856757',11969,'Человек, который застрелил Либерти Вэланса',1962,'Сенатор Рэйнс Стоддард возвращается в город Шинбон на Диком Западе, чтобы присутствовать на похоронах своего друга, Тома Донифона. Журналисту, который расспрашивает его о причине визита, сенатор рассказывает историю о том, как начиналась его карьера — карьера человека, который застрелил Либерти Вэланса.',123,'3200000 $',12,492,7.447,8.1,'https://image.openmoviedb.com/kinopoisk-images/1773646/62dfa2b2-fbd0-477f-9a4f-7dff52550c18/orig','movie'),('2024-04-07 20:28:38.483512','2024-04-07 20:28:38.483512',11970,'Вся президентская рать',1976,'С того момента, как репортеры «Вашингтон пост» наткнулись на эту историю, мир замер в ожидании. «Уотергейт» свалил всех - президента Никсона, сенаторов, дипломатов - и окончательно развеял доверие американцев к своему правительству.',138,'8500000 $',18,493,7.504,7.9,'https://image.openmoviedb.com/kinopoisk-images/1900788/038fb033-887e-4dd0-b71e-8a1d782d0cc2/orig','movie'),('2024-04-07 20:28:39.445763','2024-04-07 20:28:39.445763',11971,'День, когда остановилась Земля',1951,'В разгар холодной войны в Вашингтоне совершает посадку летающая тарелка: в ней прибывают посланник Клаату и его могучий робот Горт, делегированные федерацией планет, чтобы поставить народам Земли ультиматум о прекращении ядерных испытаний.\n\nЗапаниковавшие военные открывают по космолету огонь и ранят посланника. Клаату осознает, что единственный способ договориться с землянами — это узнать их изнутри: он совершает побег из госпиталя и начинает собственное исследование планеты.',92,'1200000 $',12,495,6.994,7.7,'https://image.openmoviedb.com/kinopoisk-images/1773646/105f47da-f43c-4c0f-99df-d989a7079e7a/orig','movie'),('2024-04-07 20:28:40.058908','2024-04-07 20:28:40.058908',11972,'Особое мнение',2002,'2054 год. Уже шесть лет существует особый предпреступный отдел. На основе психических технологий разработана экспериментальная программа, с помощью которой работники отдела могут узнать о еще не совершенном убийстве и арестовать подозреваемого еще до совершения им преступления.\n\nТакая система осуждения преступников и предотвращения преступлений получает все большее распространение. Эта система работает идеально, но самое страшное начинается тогда, когда ты сам оказываешься обвиненным в еще не совершенном убийстве.\n\nОднажды руководитель предпреступного отдела Джон Андертон сам оказывается подозреваемым преступником. Он обвиняется в том, что совершит убийство человека, которого пока он даже не знает.\n\nДжон не верит в это, но теперь он вынужден сам скрываться от своих коллег. Единственная для него возможность доказать свою невиновность - это показать, что новая программа допускает ошибки и отнюдь не так идеальна, как этого хотелось бы многим...',145,'102000000 $',18,496,7.742,7.6,'https://image.openmoviedb.com/kinopoisk-images/1599028/68aca81c-7f19-473b-a464-1af55226f8f5/orig','movie'),('2024-04-07 20:28:40.778201','2024-04-07 20:28:40.778201',11973,'Римские каникулы',1953,'В Рим с официальным визитом прибывает юная принцесса Анна. Дни её расписаны по минутам – приемы, посещения фабрик, интервью… в общем, тоска! Она совсем девчонка, ей хочется свободы и она убегает из дворца на улицу, где гуляют, поют и целуются жители Вечного города.\nУвы, незадолго до побега доктор сделал ей укол снотворного и принцесса засыпает на скамейке. А мимо проходит возвращающийся домой после вечера за карточным столом американский журналист Джо Брэдли. Рано утром по заданию редактора он должен быть на пресс-конференции у принцессы Анны, которую он в глаза никогда не видел…',118,'1500000 $',6,497,8.259,8,'https://image.openmoviedb.com/kinopoisk-images/1599028/6f5b0576-7bbe-4200-b3be-2e46380d4fd3/orig','movie'),('2024-04-07 20:28:41.434259','2024-04-07 20:28:41.434259',11974,'Останься со мной',1986,'Действие фильма переносит зрителя в 50-е годы. Лето подходит к концу, но сезон развлечений омрачен таинственным исчезновением мальчика. Четверо друзей-подростков отправляются на его поиски. Дети взялись за трудное дело, ведь им так хочется поскорее стать старше...',89,'8000000 $',16,498,7.835,8.1,'https://image.openmoviedb.com/kinopoisk-images/1900788/e87570f4-723a-4da6-80be-9ac0b77bf390/orig','movie'),('2024-04-07 20:28:42.092213','2024-04-07 20:28:42.092213',11975,'Траффик',2000,'Верховный Судья Роберт Уэйкфилд получает задание возглавить войну против торговцев наркотиками. Наркобароны и коррумпированные полицейские, частные детективы и безобидные домохозяйки выстраиваются в запутанную схему. В процессе судья обнаруживает, что его собственная семнадцатилетняя дочь сидит на героине. Но машина правосудия уже запущена.',147,'48000000 $',18,499,7.163,7.6,'https://image.openmoviedb.com/kinopoisk-images/1946459/2d12b502-54b6-4ad6-92bf-7d78b31ae460/orig','movie'),('2024-04-07 20:28:42.774727','2024-04-07 20:28:42.774727',11976,'Собачий полдень',1975,'В жаркий бруклинский полдень трое воодушевленных неудачников решают ограбить банк. Их план практически сразу выходит из под контроля — один из них трусит и сбегает, а через некоторое время банк оказывается окружён полицией, толпами зевак и тележурналистами. Так «хорошо спланированное» ограбление превращается в цирк.',130,'1800000 $',16,500,7.665,8,'https://image.openmoviedb.com/kinopoisk-images/1704946/c3963b39-f546-4e78-bf56-4c490cf778ab/orig','movie'),('2024-04-07 20:28:43.432852','2024-04-07 20:28:43.432852',11977,'Три цвета: Красный',1994,'Красивая девушка-модель выясняет, что её новый знакомый, судья на пенсии, очень любит вторгаться в личную жизнь других людей.',96,'{}',16,501,7.852,8.1,'https://image.openmoviedb.com/kinopoisk-images/4774061/db352b98-b29a-4e48-96e1-fcbba874fc07/orig','movie'),('2024-04-07 20:28:44.162716','2024-04-07 20:28:44.162716',11978,'12 обезьян',1995,'2035 год... Чудовищный, неизлечимый вирус уничтожил пять миллиардов человек, то есть 99% населения Земли. Оставшиеся в живых люди вынуждены обитать под землей.\n\nУголовник Джеймс Коул добровольно отправляется в опасное путешествие на машине времени. Он должен попасть в прошлое, чтобы помочь ученым найти источник возникновения этого ужасного вируса и раскрыть загадку таинственных «Двенадцати обезьян»...',129,'29000001 $',18,502,7.797,8,'https://image.openmoviedb.com/kinopoisk-images/1629390/9156c8ee-f5c5-41f0-b38c-9687104ac943/orig','movie'),('2024-04-07 20:28:44.769702','2024-04-07 20:28:44.769702',11979,'Парни что надо',1983,'Фрагментарная история американской астронавтики с 1947 по 1963 год, когда после долгих и трагических испытаний американцы, наконец, вышли в космос.',193,'27000000 $',16,503,6.948,7.8,'https://image.openmoviedb.com/kinopoisk-images/1629390/0901aefc-9290-4d1d-a96d-8506db91b57c/orig','movie'),('2024-04-07 20:28:45.421846','2024-04-07 20:28:45.421846',11980,'Тень сомнения',1942,'Молодая женщина узнаёт, что посещающий её «дядя Чарли» - не тот, кем кажется.',108,'{}',18,504,7.509,7.8,'https://image.openmoviedb.com/kinopoisk-images/1629390/8b1d9d77-e833-4238-9886-b9b7c1d705d4/orig','movie'),('2024-04-07 20:28:46.053287','2024-04-07 20:28:46.053287',11981,'Убийство',1956,'Бывший заключенный Джонни Клэй планирует ограбление ипподрома, надеясь сорвать куш в 2 миллиона. Для осуществления тщательного проработанного плана он привлекает еще четырёх человек — кассира, продажного полицейского, бывшего алкоголика и бармена. Но всё пойдёт не по плану, потому что один из сообщников решил внести в него свои изменения.',84,'320000 $',16,505,7.657,7.9,'https://image.openmoviedb.com/kinopoisk-images/1946459/4a3c19c6-e7d9-4c3c-b274-67e2b2ed0e70/orig','movie'),('2024-04-07 20:28:46.695947','2024-04-07 20:28:46.695947',11982,'Полуночный ковбой',1969,'Джо Бак, жизнерадостный и наивный парень из крохотного техасского городка, направляется в Нью-Йорк, чтобы использовать свои незаурядные сексуальные способности для удовлетворения потребностей богатых женщин за плату. Но дела у него идут не слишком хорошо, и вскоре уличный бомж-туберкулезник Риццо убеждает Джо, что ему необходим менеджер.\n\nХотя Джо не в восторге от того, что ему приходится обслужить в сортире гомосексуалистов, он и Риццо становятся настоящими друзьями. Они хотят заработать много денег и уехать во Флориду...',113,'3600000 $',18,506,7.719,7.8,'https://image.openmoviedb.com/kinopoisk-images/1704946/af030140-db86-451a-8bc7-6991754654a2/orig','movie'),('2024-04-07 20:28:47.214009','2024-04-07 20:28:47.214009',11983,'Терминатор',1984,'История противостояния солдата Кайла Риза и киборга-терминатора, прибывших в 1984 год из пост-апокалиптического будущего, где миром правят машины-убийцы, а человечество находится на грани вымирания.',108,'6400000 $',18,507,7.98,8.1,'https://image.openmoviedb.com/kinopoisk-images/1600647/537869cd-5fb8-4993-af4c-c5f6a30e61ba/orig','movie'),('2024-04-07 20:28:47.863034','2024-04-07 20:28:47.863034',11984,'Земляничная поляна',1957,'78-летний профессор из Стокгольма вспоминает и пересматривает разочарования своей долгой жизни. Вместе с женой сына он едет на машине на вручение почётной премии, посещая по пути места, где прошла его молодость, встречая разных людей и старых знакомых, вспоминая сны и былое.',91,'{}',18,508,8.019,8.1,'https://image.openmoviedb.com/kinopoisk-images/9784475/a740a845-db2b-461d-9a52-60559a481bf5/orig','movie'),('2024-04-07 20:28:48.385451','2024-04-07 20:28:48.385451',11985,'Харви',1950,'Элвуд П. Дауд, человек, упивающийся собственным красноречием, добр настолько, что его доброта захлестывает жизнь всех вокруг. Как-то вечером Элвуд возвращается домой и видит здоровенного кролика, метра два ростом, по имени Харви, подпирающего фонарный столб. Невидимый для всех остальных, Харви становится его другом и следует за ним повсюду, очень мешая семье Элвуда. Родные считают, что Элвуд окончательно свихнулся и его следует поместить в сумасшедший дом...',104,'{}',12,509,7.66,7.9,'https://image.openmoviedb.com/kinopoisk-images/1898899/6846be12-e477-410d-bab3-22474daf23eb/orig','movie'),('2024-04-07 20:28:49.006553','2024-04-07 20:28:49.006553',11986,'Четыреста ударов',1959,'12-летний Антуан Дуанель — трудный подросток. Его мать занята личной жизнью, и у нее нет ни времени, ни желания вникать в проблемы сына. Отчим — человек слабохарактерный, не имеет влияния ни на жену, ни на сына. Учитель лишь наказывает мальчика. Антуан и его приятель все реже посещают школу и убегают из дома.',98,'{}',16,510,8.074,8.1,'https://image.openmoviedb.com/kinopoisk-images/4716873/edba2051-77f5-4788-bcf3-1ec8ae3512b5/orig','movie'),('2024-04-07 20:28:49.575802','2024-04-07 20:28:49.575802',11987,'Эд Вуд',1994,'Фильм рассказывает истинную историю странной и пестрой жизни самой одиозной фигуры американского кино - Эда Вуда, признанного худшим режиссером за всю историю Голливуда!',127,'18000000 $',18,511,7.576,7.8,'https://image.openmoviedb.com/kinopoisk-images/1898899/6d21f349-5f3f-4300-b030-bef9bc040121/orig','movie'),('2024-04-07 20:28:50.166041','2024-04-07 20:28:50.166041',11988,'Быть или не быть',1942,'Действие происходит в Польше до и во время немецкой оккупации. В одном театре Варшавы работают муж и жена - Йосиф и Мария Тура. Ставят антинацистскую пьесу, но ее запрещают, и приходится играть «Гамлета». Чрезвычайно тщеславный и ранимый Йосиф Тура играет самого принца датского, один из зрителей, молодой и красивый летчик, встает и уходит из зала в самый ответственный для артиста момент, когда произносится знаменитый монолог «Быть или не быть». Откуда знать актеру, что именно эти слова были для офицера паролем, указывающим, что можно идти в гримерную красавицы Марии Тура...',99,'{}',16,512,7.77,8.1,'https://image.openmoviedb.com/kinopoisk-images/1773646/f5720e4b-849d-4389-8a83-5632b07f0750/orig','movie'),('2024-04-07 20:28:50.785348','2024-04-07 20:28:50.785348',11989,'Ганди',1982,'В 1869 году, когда Ганди родился, его страна ещё была украшением Британской империи и одной из драгоценностей королевы Виктории. 30 января 1948 года, в день его убийства, Индия была свободной. Это стало плодом его трудов, трудов долгой титанической жизни.',191,'22000000 $',100,513,8.051,8,'https://image.openmoviedb.com/kinopoisk-images/1773646/bad5d424-8745-4ad6-830e-89058b504049/orig','movie'),('2024-04-07 20:28:51.522282','2024-04-07 20:28:51.522282',11990,'Лев зимой',1968,'1183 год. Во время Рождественских празднеств стареющий король Англии Генрих II должен назвать имя наследника.\r\n\r\nНа это событие прибывают жена короля Элеанора Аквитанская, которая провела десять лет в тюрьме за участие в заговоре против монарха, любовница короля - тщеславная принцесса Алэ, ее брат, король Франции Филипп II Август и трое сыновей Генриха II: Ричард Львиное Сердце, Джеффри и Джон. Все члены семьи люто ненавидят друг друга. Их объединяет лишь одно - непомерная жажда власти и готовность пойти на любое предательство ради нее.',134,'4000000 $',12,514,7.737,7.9,'https://image.openmoviedb.com/kinopoisk-images/1773646/685f1639-76cb-47a5-909e-fc792a571b7c/orig','movie'),('2024-04-07 20:28:52.175532','2024-04-07 20:28:52.175532',11991,'На игле',1995,'История четырёх друзей-наркоманов в Эдинбурге 1990-х годов. Кто-то из них пытается завязать, а кто-то озабочен только тем, как достать очередную дозу.',93,'3500000 $',18,515,7.954,8.1,'https://image.openmoviedb.com/kinopoisk-images/1777765/f47dc447-7360-43a4-aa05-5ac408203f5e/orig','movie'),('2024-04-07 20:28:52.757349','2024-04-07 20:28:52.757349',11992,'Бонни и Клайд',1967,'Молодые и отчаянные любовники Бонни и Клайд легко и изящно грабят банки в 1930-е. Но их романтизм и «робингудство» довольно быстро перерастают в лужи и реки крови, в хаос и смерть.',111,'2500000 $',18,516,7.701,7.7,'https://image.openmoviedb.com/kinopoisk-images/1599028/270cdbf7-4ff7-4b1f-bca0-69950222668f/orig','movie'),('2024-04-07 20:28:53.410214','2024-04-07 20:28:53.410214',11993,'Всё о моей матери',1999,'На мать-одиночку Мануэлу обрушивается самое ужасное из земных несчастий — в автокатастрофе погибает её единственный сын Эстебан. \n\nПодвергнувшись спонтанному порыву, убитая горем женщина возвращается в город своей бурной юности — Барселону. Там она встречается с призраком Прошлого, чьи уродливые когти безжалостно царапают судьбы людей в Настоящем. Мануэле предстоит встреча с отцом Эстебана и его окружением, от которых она сбежала 16 лет назад.',101,'{}',18,517,7.774,7.8,'https://image.openmoviedb.com/kinopoisk-images/1704946/c3d4a829-613c-43ab-85ee-4674bdc27417/orig','movie'),('2024-04-07 20:28:54.036629','2024-04-07 20:28:54.036629',11994,'Это – Spinal Tap',1984,'Несколько месяцев из жизни стареющей британской рок-группы Spinal Tap, постепенно скатывающейся с высот былой славы на самое дно музыкального мира во время прощального турне по Соединенным Штатам.',82,'2500000 $',16,518,6.852,7.9,'https://image.openmoviedb.com/kinopoisk-images/1599028/dd2d38e0-511c-432b-903f-623a172351ae/orig','movie'),('2024-04-07 20:28:54.613481','2024-04-07 20:28:54.613481',11995,'Человек дождя',1988,'Грубоватому и эгоистичному молодому человеку Чарли в наследство от отца достались лишь розовые кусты да «Бьюик» 1949 года, а львиная доля наследства уходит его брату-аутисту Раймонду. Задавшись целью отобрать «свою долю», Чарли похищает старшего брата. Но когда выясняет, что Раймонд обладает недюжими математическими способностями, памятью и внимательностью, решает использовать это в корыстных целях.',133,'25000000 $',18,519,8.242,8,'https://image.openmoviedb.com/kinopoisk-images/6201401/74259ac0-8003-4282-b0c9-ffe915ccd6fb/orig','movie'),('2024-04-07 20:28:55.156834','2024-04-07 20:28:55.156834',11996,'Телесеть',1976,'Постоянный «гвоздь программы» новостей телестанции UBS-TV Говард Били погорел: во время прямого эфира у него случился нервный срыв. По иронии, публичное бесчинство подняло его и без того баснословный рейтинг, к неожиданному ликованию боссов UBS.\n\nКак следствие, прославившись «безумным пророком прямого эфира», вскоре он превратился в пешку для безжалостного теленачальства, которое выдаивало из него сумасшедшие выходки при любом удобном случае. Само собой, когда «пророк» стал не впрок, с ним надо было срочно что-то решать, желательно перед камерой, и при полной аудитории.',121,'3800000 $',16,520,7.691,8.1,'https://image.openmoviedb.com/kinopoisk-images/1773646/fc24f338-9074-4b62-a01b-ba20c7be6311/orig','movie'),('2024-04-07 20:28:55.686653','2024-04-07 20:28:55.686653',11997,'Носферату, симфония ужаса',1922,'Начало XIX века. Молодой служащий Хуттер отправляется из Бремена в карпатские леса в замок зловещего графа Орлока, решившего перебраться в город. Хуттер выясняет, что Орлок &#151; вампир, и от его заражающего укуса парня спасает лишь супруга Элен.',94,'{}',18,521,7.64,7.9,'https://image.openmoviedb.com/kinopoisk-images/4303601/e951ebfd-073a-4b0c-8b41-17d6db97e997/orig','movie'),('2024-04-07 20:28:56.267252','2024-04-07 20:28:56.267252',11998,'Карты, деньги, два ствола',1998,'Четверо молодых парней накопили каждый по 25 тысяч фунтов, чтобы один из них мог сыграть в карты с опытным шулером и матерым преступником, известным по кличке Гарри-Топор. Парень в итоге проиграл 500 тысяч, на уплату долга ему дали неделю.\nВ противном случае и ему и его «спонсорам» каждый день будут отрубать по пальцу, а потом... Чтобы выйти из положения, ребята решили ограбить бандитов, решивших ограбить трех «ботаников», выращивающих марихуану для местного наркобарона. Но на этом приключения четверки не заканчиваются...',107,'960000 £',18,522,8.558,8.1,'https://image.openmoviedb.com/kinopoisk-images/1599028/6492653f-11d5-4087-a1d2-ec7a74f161d3/orig','movie'),('2024-04-07 20:28:56.960459','2024-04-07 20:28:56.960459',11999,'Перекресток Миллера',1990,'Америка тридцатых годов. Время сухого закона. Преступные кланы в любой момент готовы развязать кровавую войну за контроль над поставками нелегального алкоголя. Том Рейган — умный и авторитетный преступник, бывший советник одного из мафиозных боссов. Он своего рода антигерой, абсолютно аморальный, эгоистичный и подлый человек.\n\nНо тем не менее своими незаурядными способностями оставаться живым после самых крутых разборок вызывает искренние симпатии. Он умело балансирует между двумя готовыми в любой момент сорваться бандами, пытаясь удержать их от начала войны. Но долго так продолжаться не может, и у Тома возникают такие проблемы, от решения которых будут зависеть судьбы слишком многих людей…',115,'14000000 $',16,523,7.583,7.7,'https://image.openmoviedb.com/kinopoisk-images/1704946/e5222bd4-bc6d-4370-bd1a-e33f3f5668ee/orig','movie'),('2024-04-07 20:28:57.623429','2024-04-07 20:28:57.623429',12000,'Дилижанс',1939,'Из городка Тонто в Нью-Мехико выезжают на дилижансе несколько человек. Док Бун, пьяница, давно выгнанный из гильдии врачей. Даллас, проститутка, чьи сексуальные приключения так разозлили местных женщин, что те выгнали ее из своего не самого высшего общества. Хэтфилд, шулер, выдающий себя за джентльмена-южанина, у которого свои причины покинуть Тонто.\nОн тем не менее делает вид, что вызвался сопроводить беременную Люси к ее мужу, кавалеристу. Хенри Гэйтвуд, помпезный банкир, садится в дилижанс с небольшим саквояжем, который он не выпускает из рук.\nСэмюэл Пикок, торговец виски, везет ящик образцов. Эти шесть человек составляют список пассажиров, а наверху сидит кучер Бак, верзила, ненавидящий индейцев, и крутой, грубый, но честный и простодушный Керли, представитель закона с дробовиком.\nЧерез какое-то время уже в пути к ним присоединяется Ринго Кид, у которого охромела лошадь. Дилижанс тронулся, ждите приключений!',96,'392000 $',12,524,7.491,7.8,'https://image.openmoviedb.com/kinopoisk-images/1900788/2ebe237a-b96a-4857-9448-3ae402263def/orig','movie'),('2024-04-07 20:28:58.294829','2024-04-07 20:28:58.294829',12001,'Генрих V: Битва при Азенкуре',1989,'1415 год. Претендуя на титул короля Франции, молодой английский монарх Генрих V, вторгается на земли, которые он считает своими по праву. Несмотря на крайне тяжелую военную кампанию, английское войско продолжает одерживать победы. Но в местечке Азенкур, ослабленная армия англичан сталкивается с многократно превосходящими силами французов. Несмотря на это, Генрих, король - воин, решает дать бой, который войдет в историю...',137,'9000000 $',12,525,7.105,7.5,'https://image.openmoviedb.com/kinopoisk-images/1629390/c736679d-bd5b-4052-a443-bb438f3279d2/orig','movie'),('2024-04-07 20:28:58.977307','2024-04-07 20:28:58.977307',12002,'Большой куш',2000,'Фрэнки Четыре Пальца должен был переправить краденый алмаз из Англии в США своему боссу Эви, но, сделав ставку на подпольный боксерский поединок, он попал в круговорот весьма нежелательных событий. Вокруг него и его груза разворачивается сложная интрига с участием множества колоритных персонажей лондонского дна &#151; русского гангстера, троих незадачливых грабителей, хитрого боксера и угрюмого громилы грозного мафиози. Каждый норовит в одиночку сорвать большой куш.',104,'10000000 $',18,526,8.553,8.2,'https://image.openmoviedb.com/kinopoisk-images/4303601/47fe48f6-ff17-4411-a12f-d337bea2639d/orig','movie'),('2024-04-07 20:28:59.653566','2024-04-07 20:28:59.653566',12003,'День сурка',1993,'Телевизионный комментатор Фил Коннорс каждый год приезжает в маленький городок в штате Пенсильвания на празднование Дня сурка. Но на этот раз веселье рискует зайти слишком далеко. Время сыграло с ним злую шутку: оно взяло да и остановилось.\n\nТеперь на календаре Фила чернеет одна и та же дата - 2 февраля, из которой он никак не может выбраться. Неунывающий ведущий пытается извлечь выгоду из своего комичного положения: впереди у него уйма времени и безмятежное предсказуемое будущее.\n\nОтныне с ним не случится ничего плохого... и ничего хорошего. У Фила осталась одна заветная мечта, простая и незамысловатая - 3 февраля...',101,'14600000 $',12,527,8.14,8,'https://image.openmoviedb.com/kinopoisk-images/1599028/ed4f90cb-188b-4cac-a41a-c175ff9b9e48/orig','movie'),('2024-04-07 20:29:00.323591','2024-04-07 20:29:00.323591',12004,'Лора',1944,'Детектив МакФерсон ведет расследование убийства красавицы Лоры...',88,'1020000 $',100,528,7.395,7.9,'https://image.openmoviedb.com/kinopoisk-images/1900788/b401369e-46b6-494c-97d2-6a0b2b6ef78e/orig','movie'),('2024-04-07 20:29:00.938880','2024-04-07 20:29:00.938880',12005,'39 ступеней',1935,'Ричард знакомится в Лондонском мюзикхолле с Аннабеллой, которая просит укрыть ее от идущих по ее следу убийц. Ричард не воспринимает это всерьез, но разрешает ей переночевать у него. Той же ночью девушка вваливается в его спальню с ножом в спине…\n\nБегущего в панике Ричарда принимают за убийцу-маньяка и полиция всей Англии начинает охоту. Чтобы доказать свою невиновность, ему придется пройти все круги Ада… ',84,'{}',12,529,7.362,7.6,'https://image.openmoviedb.com/kinopoisk-images/1946459/50cd39f6-9304-43de-83d4-19f2bea7413e/orig','movie'),('2024-04-07 20:29:01.568283','2024-04-07 20:29:01.568283',12006,'Игры разума',2001,'От всемирной известности до греховных глубин — все это познал на своей шкуре Джон Форбс Нэш-младший. Математический гений, он на заре своей карьеры сделал титаническую работу в области теории игр, которая перевернула этот раздел математики и практически принесла ему международную известность.\n\nОднако буквально в то же время заносчивый и пользующийся успехом у женщин Нэш получает удар судьбы, который переворачивает уже его собственную жизнь.',135,'58000000 $',12,530,8.544,8.2,'https://image.openmoviedb.com/kinopoisk-images/4303601/80f21137-eebb-4cdc-8124-96c68c07c2a8/orig','movie'),('2024-04-07 20:29:02.191800','2024-04-07 20:29:02.191800',12007,'Дорога',1954,'Фильм о нечеловеческой жестокости и человеческом страдании, о непростых отношениях немножко сумасшедшей, немножко святой, взъерошенной, смешной, неуклюжей и нежной Джельсомины и мрачного, массивного, грубого и звероподобного Дзампано - женщины и мужчины, совершенно чуждых друг другу, но волею судеб, неизвестно почему, оказавшихся вместе...',108,'{}',16,531,8.011,8,'https://image.openmoviedb.com/kinopoisk-images/1900788/cf7a4d92-75d5-47a8-bc75-396fafe282f8/orig','movie'),('2024-04-07 20:29:02.723074','2024-04-07 20:29:02.723074',12008,'Наёмный убийца',1989,'История о двух мужчинах, которые становятся друзьями, потому что не желают продаваться, не желают вести жизнь, не отвечающую их чувствам и устремлениям. Джеффри - профессиональный убийца, который, выполняя задание, случайно лишает зрения певицу Дженни.\n\nМежду слепой певицей и убийцей возникает взаимная привязанность, но самые близкие отношения у Джеффри завязываются с идущим по его следу полицейским инспектором, который признает в наемном убийце родственную душу.\n\nДжеффри хочет оплатить Дженни операцию по восстановлению зрения, но, чтобы добыть деньги, он должен согласиться на совершение еще одного, последнего, как он надеется, задания.',111,'{}',18,532,7.752,7.8,'https://image.openmoviedb.com/kinopoisk-images/1900788/3aabcbf6-32ed-46e0-b5b2-516ac21b36bd/orig','movie'),('2024-04-07 20:29:03.354575','2024-04-07 20:29:03.354575',12009,'Неприкасаемые',1987,'Полиция борется с королем преступного мира, знаменитым гангстером Аль Капоне.',119,'25000000 $',18,533,7.796,7.8,'https://image.openmoviedb.com/kinopoisk-images/1704946/ae8d11fe-2205-4328-a5d3-1c45d10ce1b8/orig','movie'),('2024-04-07 20:29:04.019871','2024-04-07 20:29:04.019871',12010,'Кинг Конг',1933,'На отдаленном, диком острове научная экспедиция захватывает громадную человекообразную обезьяну и, не мудрствуя лукаво, привозит ее в Нью-Йорк для показа праздной публике.\n\nКто бы мог подумать, что этот жуткий монстр, способен на такое тонкое чувство, как любовь - эта чертова обезьяна, жить не может без миниатюрной и нежной главной героини...',100,'670000 $',0,534,7.085,7.9,'https://image.openmoviedb.com/kinopoisk-images/1946459/a026a740-8a78-4ad5-95fa-3a8027fe38ec/orig','movie'),('2024-04-07 20:29:04.664305','2024-04-07 20:29:04.664305',12011,'8 с половиной',1963,'Измотанный режиссёр погружается в водоворот воспоминаний и фантазий, где невозможно отличить вымысел от реальности.',138,'{}',18,535,7.985,8,'https://image.openmoviedb.com/kinopoisk-images/9784475/0ce35b23-02c5-4636-a32a-d3e820aaafef/orig','movie'),('2024-04-07 20:29:05.295544','2024-04-07 20:29:05.295544',12012,'Фантазия',1940,'Необычайный, поражающий воображение мультконцерт, небывалое ранее единение музыки и мультипликации. Дисней и знаменитый дирижер Леопольд Стоковски решили воспроизвести на экране фантазии, возникающие в сознании людей при прослушивании музыкальных шедевров.\n\nКартина состоит из 8 классических композиций, проиллюстрированных сюжетными инсценировками и ритмичными абстракциями, предвосхищающими чудеса компьютерной графики.',125,'2280000 $',0,536,7.689,7.7,'https://image.openmoviedb.com/kinopoisk-images/1773646/41fdf2c0-9f9d-4f6c-a3e2-23d555bdb9e4/orig','cartoon'),('2024-04-07 20:29:06.009552','2024-04-07 20:29:06.009552',12013,'Военно-полевой госпиталь',1969,'Врачи передвижного госпиталя в Корее, чтобы немного скрасить своё безрадостное существование, постоянно шутят и глумятся друг над другом.',116,'3500000 $',16,537,7.332,7.4,'https://image.openmoviedb.com/kinopoisk-images/1946459/cc4fa6b8-c5cd-49de-8cf3-287fb9a9a664/orig','movie'),('2024-04-07 20:29:06.623672','2024-04-07 20:29:06.624673',12014,'Стальной гигант',1999,'Жители тихого американского городка становятся свидетелями ослепительной вспышки и падения огромного объекта. Спустя несколько дней мальчуган по имени Хогарт Хьюз находит в окрестностях гигантского робота, прилетевшего на Землю из далекой космической галактики.\nНесмотря на свой грозный вид, инопланетный гость оказывается добрейшим созданием. Между ним и отважным мальчишкой завязывается настоящая дружба. Но узнавшие о существовании робота правительство и военные решили уничтожить пришельца. Хогарт - единственный, кто может спасти стального гиганта.',86,'70000000 $',6,538,8.124,8.1,'https://image.openmoviedb.com/kinopoisk-images/1599028/c1e64d5a-0c45-4eef-9395-95d2dd12eeb0/orig','cartoon'),('2024-04-07 20:29:07.440027','2024-04-07 20:29:07.440027',12015,'Умница Уилл Хантинг',1997,'Уилл Хантинг - 20-летний вундеркинд из Бостона, который то и дело ввязывается в неприятные истории. И когда полиция арестовывает его за очередную драку, профессор математики берет его под свою опеку, но при одном условии: Уилл должен пройти курс психотерапии. Сеансы «перевоспитания», начавшиеся с недоверия, постепенно перерастают в дружбу между Уиллом и его наставником.',126,'10000000 $',18,539,8.085,8.3,'https://image.openmoviedb.com/kinopoisk-images/1629390/0e2ecf70-4309-4e53-839b-ff3c9d8b0129/orig','movie'),('2024-04-07 20:29:08.036176','2024-04-07 20:29:08.036176',12016,'Красавица и чудовище',1991,'В заколдованном замке, скрытом в темном лесу, живет ужасное Чудовище. Растопить лед в его сердце и вернуть ему человеческий облик, сняв заклятие, может только прекрасная девушка, которая полюбит его таким, какой он есть.',84,'25000000 $',6,540,8.268,8,'https://image.openmoviedb.com/kinopoisk-images/1599028/ed078f6d-65a8-4c2c-a8df-aba6383b841f/orig','cartoon'),('2024-04-07 20:29:08.839942','2024-04-07 20:29:08.839942',12017,'Будучи там',1979,'Садовник, вся жизнь которого прошла в уходе за садом и телевизором, оказывается без работы, поскольку его прежний хозяин умер, а новые хозяева выставляют его на улицу. Зная внешний мир только по программам телевидения и общению с чернокожей кухаркой, он, делая первые неуверенные шаги в незнакомом для него мире, тут же попадает под колеса лимузина богатой дамы и оказывается в ее доме, где ему предстоит познакомиться и очаровать ее мужа и начать свое восхождение в мир влиятельных людей...',130,'{}',16,541,7.663,7.9,'https://image.openmoviedb.com/kinopoisk-images/1773646/21e00697-6f18-4cfb-b19c-d1de7e5e8027/orig','movie'),('2024-04-07 20:29:09.462770','2024-04-07 20:29:09.462770',12018,'Планета обезьян',1967,'В 3978 году космический корабль землян терпит крушение на далекой планете. Выжившие в катастрофе астронавты удивляются, как она похожа на их дом. Вскоре они узнают, что планета населена разумными обезьянами и деградировавшими до животного состояния людьми. Обезьяны захватывают астронавтов в плен, но после продолжительных пыток один из них совершает побег вместе с симпатичной девушкой-шимпанзе, которая открывает ему страшные тайны.',112,'5800000 $',12,542,7.706,8,'https://image.openmoviedb.com/kinopoisk-images/1629390/e8258a92-26a5-48e6-b4a0-a1b905998a26/orig','movie'),('2024-04-07 20:29:10.030680','2024-04-07 20:29:10.030680',12019,'Клерки',1994,'Один день из жизни Данте и Рэндала — приятелей, которые работают в небольшом продуктовом магазине и пункте видеопроката в захудалом районе Нью-Джерси.',92,'27000 $',18,543,7.726,7.7,'https://image.openmoviedb.com/kinopoisk-images/1777765/cb253cb5-addb-42e9-b311-0294944e7dd4/orig','movie'),('2024-04-07 20:29:10.569190','2024-04-07 20:29:10.569190',12020,'Инопланетянин',1982,'Инопланетянин прилетает на землю в составе научно-исследовательской группы с мирными намерениями. Специалисты из NASA замечают приближение летающей тарелки и решают, что обязаны отловить хотя бы одну из инопланетных тварей. Несчастные существа улетают так спешно, что забывают захватить одного из коллег.',115,'10500000 $',18,544,7.791,7.9,'https://image.openmoviedb.com/kinopoisk-images/1629390/df360301-084a-4eec-90ab-7954b143de18/orig','movie'),('2024-04-07 20:29:11.185901','2024-04-07 20:29:11.185901',12021,'Рио Браво',1958,'Шериф маленького городка Рио Браво Джон Ченс арестовывает убийцу. Брат арестованного, известный бандит, собирает самых отчаянных головорезов со всей округи для его освобождения.\nГород наводнен преступниками, но Ченс принимает вызов. На помощь к шерифу приходят лишь пьяница, певица и молодой, но быстрый стрелок. Горстка смельчаков стоит за правое дело...',141,'{}',12,545,7.53,8,'https://image.openmoviedb.com/kinopoisk-images/1773646/70556704-0fb6-4555-8202-22cb25139e98/orig','movie'),('2024-04-07 20:29:11.790655','2024-04-07 20:29:11.790655',12022,'О, где же ты, брат?',2000,'У мошенника Эверетта МакГилла на воле срочное дело, но как убежать из тюрьмы, если ты скован одной цепью с двумя заключенными? МакГилл рассказывает своим сокамерникам историю о припрятанном миллионе долларов и о том, что скоро все это богатство окажется под водой.\n\nОн обещает разделить награбленное на троих, и его тюремные братья соглашаются отправиться на спасение денежек. Но о том, ради чего на самом деле затеяна вся эта одиссея, знает только Эверетт.',103,'26000000 $',12,546,7.377,7.7,'https://image.openmoviedb.com/kinopoisk-images/10671298/ea64cdb1-2cc4-4fd3-b0fa-63512dc270f5/orig','movie'),('2024-04-07 20:29:12.573341','2024-04-07 20:29:12.573341',12023,'Полуночная жара',1967,'В Америке 60-х годов, когда расовые предрассудки еще были сильны, белый шериф из провинциального городка вынужден объединить усилия с темнокожим детективом из Филадельфии для расследования жестокого убийства.\n\nИх взаимная неприязнь на расовой почве подкрепляется абсолютным несходством характеров и различными методами ведения следствия. Таким образом, расследование преступления превращается в личную разборку между крутыми полицейскими. Но чтобы выйти на след таинственного убийцы им нужно научиться работать вместе.',110,'2000000 $',16,547,7.605,7.9,'https://image.openmoviedb.com/kinopoisk-images/10671298/9c9bce5b-2b1d-48e1-88af-da6ad8c98c80/orig','movie'),('2024-04-07 20:29:13.197220','2024-04-07 20:29:13.197220',12024,'Проклятый путь',2002,'Внешне вполне среднестатистический американец Майкл Салливан живёт жизнью нормального гражданина 30-х годов XX века. Он хороший отец, крепкий семьянин, ответственный работник; но одно не дает покоя его старшему сыну Майклу — куда именно отец уезжает на своей машине каждое утро и что за люди окружают его — в костюмах идеального покроя, но со странной хитрецой в глазах? Однажды Майкл забирается на заднее сиденье машины отца и становится свидетелем его работы. Проблема в том, что Майкл Салливан — самый настоящий гангстер, выполняющий деликатные поручения, где нет места лишним свидетелям. Из-за этого жизнь его сына оказывается под угрозой. Чтобы спасти его, Майкл вынужден пойти против боссов мафии.',117,'80000000 $',18,548,7.636,7.7,'https://image.openmoviedb.com/kinopoisk-images/1599028/e939f7fe-7c8c-4537-84f5-be85531f594d/orig','movie'),('2024-04-07 20:29:13.817526','2024-04-07 20:29:13.817526',12025,'Тихий человек',1952,'Американский боксер Шон Торнтон возвращается к себе на родину в Ирландию, где влюбляется в чудесную девушку Мэри Кэт. Она - его идеал, такое светлое чувство он испытал впервые.\n\nОднако он подзабыл, что за народ живет в его родных краях. Ему приходится иметь дело с местными традициями и обычаями (включая выплату «калыма»).\n\nДа и тупоголовый упрямый братец юной феи далеко не подарок, он ведь главный забияка и драчун в городке. Но храброму Шону все нипочем - ведь он влюблен, решителен и смел, крепкий парень и может постоять за себя, боксерская школа не забыта.',129,'{}',12,549,6.827,7.7,'https://image.openmoviedb.com/kinopoisk-images/1898899/afd4cc2c-22fe-4588-8975-4dcb67104ea6/orig','movie'),('2024-04-07 20:29:14.469132','2024-04-07 20:29:14.469132',12026,'Избавление',1972,'Четверо отправляются в путешествие в дикую и пустынную местность в Аппалачах. Они спускаются вниз по реке на двух лодках. В их намерения входит просто отдохнуть, развеяться и посмотреть живописные места...\n\nОни не знали, что попадут в засаду к малограмотным местным горцам, головорезам и садистам. Злодеи «рады» туристам из города, им не терпится по-своему развлечься с вновь прибывшими. Для четверых путников наступает решительный момент...',109,'2000000 $',12,550,7.247,7.7,'https://image.openmoviedb.com/kinopoisk-images/6201401/b48f0781-b21e-470c-9e0b-53fee8fde1c9/orig','movie'),('2024-04-07 20:29:15.090082','2024-04-07 20:29:15.090082',12027,'Белоснежка и семь гномов',1937,'Принцесса Белоснежка в раннем детстве потеряла мать, а её отец-король женился вновь. Тщеславная и злобная Королева, завидуя красоте юной падчерицы, вынуждает девочку ходить в лохмотьях и делать чёрную работу, помыкает ею как служанкой. Узнав от волшебного зеркальца, что Белоснежка стала самой прекрасной девушкой на свете, завистница решила погубить прелестную падчерицу. Но бедная девушка не погибла в лесу, а наоборот, встретила там настоящих друзей — забавных семерых гномов: Профессора, Ворчуна, Весельчака, Скромника, Чихоню, Соню и Молчуна.',83,'1499000 $',0,551,7.926,7.6,'https://image.openmoviedb.com/kinopoisk-images/1898899/23fff4a5-a498-4be8-b7d6-e833ccc84945/orig','cartoon'),('2024-04-07 20:29:15.966256','2024-04-07 20:29:15.966256',12028,'Близкие контакты третьей степени',1977,'Сбои в подаче электроэнергии, возвращение из ниоткуда самолетов, исчезнувших в 1945 году, обескураживают ученых. Наименее скептичные люди науки расценивают эти явления, как прямое доказательство существования разумной инопланетной формы жизни. Выехавший на повреждение электрик Рой Нери встретился с настоящим НЛО: автомобиль, в котором ехал Рой, попал под мощный пучок света, затем над шоссе пронеслись 4 светящихся шара и пропали за горизонтом. После контакта с внеземной цивилизацией Рой оказывается во власти странных видений, и это происходит не только с ним.',138,'20000000 $',12,552,7.174,7.6,'https://image.openmoviedb.com/kinopoisk-images/10592371/a79f9bc4-9f22-4dc7-8699-877a3d778ae4/orig','movie'),('2024-04-07 20:29:16.678788','2024-04-07 20:29:16.678788',12029,'Тонкий человек',1934,'В канун Рождества убита секретарша богатого изобретателя Ваната. Все подозрения падают на него потому, что полиция не может найти профессора в городе.',91,'226408 $',12,553,7.145,7.9,'https://image.openmoviedb.com/kinopoisk-images/1900788/e8908446-bee7-40f9-a598-aa4ab9220eb0/orig','movie'),('2024-04-07 20:29:17.355020','2024-04-07 20:29:17.355020',12030,'Человек, которого не было',2001,'1949 год, Санта-Роза, Калифорния. Молчаливый парикмахер Эд Крэйн неторопливо стрижёт клиентов в своём салоне, в то время как его жена крутит шашни со своим боссом, галантерейщиком Большим Дэйвом, который недавно скопил деньги на новый магазин.\nВнезапно Эду выпадает возможность разбогатеть на зарождающемся бизнесе химической чистки одежды. Чтобы обзавестись капиталом, он шантажирует Большого Дэйва, понимая, что успеха в жизни он может добиться, лишь пойдя на крайние меры.',116,'20000000 $',16,554,7.586,7.5,'https://image.openmoviedb.com/kinopoisk-images/1898899/31a6f645-f136-4a9b-9d02-09c12744cf33/orig','movie'),('2024-04-07 20:29:17.998519','2024-04-07 20:29:17.998519',12031,'Большой Лебовски',1998,'Лос-Анджелес, 1991 год, война в Персидском заливе. Главный герой по прозвищу Чувак считает себя совершенно счастливым человеком. Его жизнь составляют игра в боулинг и выпивка. Но внезапно его счастье нарушается, гангстеры по ошибке принимают его за миллионера-однофамильца, требуют деньги, о которых он ничего не подозревает, и, ко всему прочему, похищают жену миллионера, будучи уверенными, что «муж» выплатит за нее любую сумму.',117,'15000000 $',18,555,7.803,8.1,'https://image.openmoviedb.com/kinopoisk-images/6201401/86be967f-598d-46f2-bc59-bc222e2ca837/orig','movie'),('2024-04-07 20:29:18.641039','2024-04-07 20:29:18.641039',12032,'Красная река',1947,'На Запад идет большой караван. Тяжелые, медленные повозки тащат измотанные лошади и скорость этого усталого, еле-еле передвигающегося «организма» настолько мала, что это уже даже представляет опасность, так как на такой караван легче всего напасть и разграбить.\n\nИ тогда самый отчаянный и пассионарный малый по имени Том Дансон решает наплевать на все, в том числе и на свою возлюбленную Фен, и податься на Юг. Туда, где настоящего ковбоя манит сказочно богатая и многообещающая Красная Река. Как только они перевалили через небольшой холм, то услышали сзади звуки выстрелов и увидели мощные клубы черного дыма.',133,'3000000 $',0,556,7.277,7.8,'https://image.openmoviedb.com/kinopoisk-images/1946459/687eb47a-9c55-480d-95de-823b684cc417/orig','movie'),('2024-04-07 20:29:19.236704','2024-04-07 20:29:19.236704',12033,'Призрачный мир',2001,'Подруги Энид и Ребекка, закончив школу, решили не идти в колледж, а отдохнуть от учёбы. Однажды девицы решают разыграть одинокого неудачника Сеймура, торгующего старыми виниловыми пластинками. Однако со временем Энид начинает необъяснимым образом тянуть к этому одинокому и застенчивому человеку. Сближаясь с ним, она отдаляется от Ребекки.',111,'7000000 $',16,557,7.12,7.3,'https://image.openmoviedb.com/kinopoisk-images/1629390/d3068bcb-f09e-4d9a-8c14-40b10edd04ab/orig','movie'),('2024-04-07 20:29:19.894999','2024-04-07 20:29:19.894999',12034,'Мулен Руж',2001,'Париж, 1899 год. Знаменитый ночной клуб «Мулен Руж» — это не только дискотека и шикарный бордель, но и место, где, повинуясь неудержимому желанию прочувствовать атмосферу праздника, собираются страждущие приобщиться к красоте, свободе, любви и готовые платить за это наличными.\n\nЗа любовь самой известной куртизанки Парижа, блистательной Сатин, борются двое мужчин, один из которых — бедный писатель Кристиан, с головой окунувшийся в сумасшедший мир ночных развлечений, второй — богатый герцог, готовый купить весь «Мулен Руж», лишь бы Сатин провела с ним ночь.',123,'50000000 $',18,558,7.85,7.6,'https://image.openmoviedb.com/kinopoisk-images/1599028/e2ce49ad-b53f-4394-ab3d-b274fb7feba7/orig','movie'),('2024-04-07 20:29:20.561780','2024-04-07 20:29:20.561780',12035,'Птицы',1963,'Классический фильм А.Хичкока, в котором ужасающая картина нападения птиц на американский поселок переплетается с историей любовных взаимоотношений молодой женщины с понравившимся ей мужчиной.',119,'2500000 $',12,559,7.549,7.6,'https://image.openmoviedb.com/kinopoisk-images/1900788/adc65361-43b8-49a0-912a-387bb5803c6b/orig','movie'),('2024-04-07 20:29:21.230538','2024-04-07 20:29:21.230538',12036,'Жан де Флоретт',1986,'Вернувшись с военной службы, молодой Юголен решил выращивать цветы, но гвоздикам нужна вода. Богатый дядюшка готов помочь племяннику в надежде, что тот продолжит его род. Он решил прикупить поле с родником у соседа-врага.',120,'{}',100,560,7.904,8.1,'https://image.openmoviedb.com/kinopoisk-images/1773646/3caa64f5-3738-4074-9d01-5da02a444a2a/orig','movie'),('2024-04-07 20:29:21.905694','2024-04-07 20:29:21.905694',12037,'Славное будущее',1997,'После трагической аварии школьного автобуса в городок приезжает адвокат Митчелл Стивенс. Он встречается с пострадавшими семьями, намереваясь предъявить от их имени иск к компании.\nОднако, в результате выясняются определенные обстоятельства, заставившие Митчелла иначе оценить случившееся.',112,'5000000 CA$',18,561,6.966,7.5,'https://image.openmoviedb.com/kinopoisk-images/1773646/9d624c3b-240e-46a8-b040-8001917b1e2d/orig','movie'),('2024-04-07 20:29:22.469749','2024-04-07 20:29:22.469749',12038,'Человек, который хотел быть королем',1975,'Воспользовавшись наивностью и необразованностью населения Кафиристана, британские солдаты Дэниел и Пичи предоставляют местным жителям доказательства своего божественного происхождения и достигают вершин власти.',123,'8000000 $',100,562,7.775,7.8,'https://image.openmoviedb.com/kinopoisk-images/1704946/94d22418-57f8-4789-b247-377f585b9403/orig','movie'),('2024-04-07 20:29:23.082277','2024-04-07 20:29:23.082277',12039,'Отныне и во веки веков',1953,'Роберт Ли Пруит после несчастного случая переведен в другую часть. Способный боксер, он отказывается выступать на ринге, ибо во время тренировочного боя нанес своему другу травму, в результате чего тот ослеп.\nОднако для армейского начальства спорт - неплохой инструмент карьеры, и нежелание рядового Пруита выходить на ринг рассматривается как нечто очень близкое к измене. Именно этот отказ делает Пруита в глазах начальства, и в первую очередь капитана Хомса, подрывным элементом. Среди большого количества весьма колоритных представителей гарнизона выделяются, рядовой Анджело Маджио, который попадает в военную тюрьму, славящуюся своей непримиримостью к смутьянам.\nСержант Милтон Уорден, напротив, ненавидя офицерство и как институт и как сумму конкретных лиц, сопротивляется по-своему - безукоризненным знанием своих обязанностей и высоким профессионализмом, делающим его просто незаменимым в роте. Впрочем, его месть начальству принимает и вполне конкретные формы - он заводит роман с женой своего ротного командира Карен Хомс, которая не испытывает к своему мужу ничего, кроме презрения.\nОднако ни Милтон, ни Карен не питают иллюзий насчет долговечности своего романа, который тем не менее грозит перерасти рамки обычной интрижки и превратиться в большую, всепоглощающую любовь...\nПройдет всего несколько дней и наступает седьмое декабря 1941 года, когда японские ВВС нанесут массированный удар по американской военной базе Перл-Харбор на Гавайях и по судьбам героев этого фильма.',118,'1650000 $',0,563,7.159,7.6,'https://image.openmoviedb.com/kinopoisk-images/1599028/30175dd1-b462-49bd-8b95-52e281bccfce/orig','movie'),('2024-04-07 20:29:23.687574','2024-04-07 20:29:23.687574',12040,'Человек на все времена',1966,'События, исторически достоверно воспроизведенные на экране, происходят в Англии XVI века, во времена правления короля Генриха VIII. В основе сюжета — конфликт между королем и лордом-канцлером Томасом Мором, великим гуманистом, государственным деятелем, выдающимися юристом и философом.',120,'2000000 $',12,564,7.359,7.7,'https://image.openmoviedb.com/kinopoisk-images/1900788/7529aa61-aa6f-4838-938b-66e185a930a0/orig','movie'),('2024-04-07 20:29:24.297580','2024-04-07 20:29:24.297580',12041,'Игра на вылет',1972,'Преуспевающий автор детективных романов сэр Эндрю Уайк приглашает к себе в гости Майло Тиндла, любовника своей жены. Тот прибывает в роскошный особняк писателя, где получает неожиданное предложение. Сэр Эндрю знает об их связи и даже готов отпустить жену.\nНо так как она привыкла жить в роскоши, небогатому ловеласу необходимо инсценировать ограбление дома Уайков. Сэр Эндрю получит страховку, а Майло продаст украденное и сможет дать любовнице достойное содержание.',138,'{}',12,565,7.937,8,'https://image.openmoviedb.com/kinopoisk-images/1599028/ddeb4242-0caa-4363-94f8-715ec622c4b1/orig','movie'),('2024-04-07 20:29:24.812561','2024-04-07 20:29:24.813562',12042,'Можешь рассчитывать на меня',2000,'Жизнь матери-одиночки переворачивается с ног на голову после того, как ее младший брат внезапно возвращается погостить…',111,'1200000 $',100,566,6.813,7.5,'https://image.openmoviedb.com/kinopoisk-images/1900788/754b911a-2ef1-4fe9-ad6c-bda921a36fa4/orig','movie'),('2024-04-07 20:29:25.350693','2024-04-07 20:29:25.351601',12043,'Французский связной',1971,'Нью-йоркские полицейские Джимми Дойл по прозвищу Попай и Бадди Руссо по кличке Хмурый пытаются выследить банду преступников, занимающихся контрабандой наркотиков из Франции.',104,'1800000 $',18,567,7.557,7.7,'https://image.openmoviedb.com/kinopoisk-images/1599028/666bc89d-29c5-42f6-a02c-18dbe1ae205e/orig','movie'),('2024-04-07 20:29:26.011806','2024-04-07 20:29:26.011806',12044,'Страсти Жанны д\'Арк',1928,'1431 год. Жанна д`Арк предстает перед судом по обвинению в ереси.',82,'{}',16,568,8.023,8.1,'https://image.openmoviedb.com/kinopoisk-images/1898899/3d220aa9-81d0-40c6-95f5-c6e3169cc692/orig','movie'),('2024-04-07 20:29:26.640216','2024-04-07 20:29:26.640216',12045,'Поля смерти',1984,'Корреспондент «Нью-Йорк Таймс» Сидней Шенберг пишет репортажи о гражданской войне между «красными кхмерами» и правительством. Его незаменимый помощник и друг – добрый, умный и интеллигентный Дит Пран. Как переводчику и проводнику ему нет равных.\n\nКогда «красные кхмеры» побеждают, американцы эвакуируются из Камбоджи. Дит Пран отправляет с ними семью, но сам остается с Сиднеем, чтобы помочь ему написать о перевороте.\n\nИностранному журналисту Шенбергу удастся выбраться из страны, но положение Прана совсем иное: он местный и совершенно беззащитен перед революционным террором «красных кхмеров»…',142,'14400000 $',16,569,7.337,7.8,'https://image.openmoviedb.com/kinopoisk-images/1704946/d8bfa9d1-f4d3-4648-bf71-5d7778d6c4aa/orig','movie'),('2024-04-07 20:29:27.218382','2024-04-07 20:29:27.218382',12046,'Игрок',1992,'Крупный чиновник на голливудской киностудии Гриффин Милл наделен правом решать, какой из предлагаемых сценариев запустить в производство. У него сотни врагов, потому что большинству проектов он вынужден говорить «нет». Его начинает запугивать некто, подбрасывая угрожающие записки. Гриффин нервничает и в приступе ярости совершает нелепейшее убийство безвинного драматурга. Он сходится с вдовой убитого, художницей-авангардисткой и пытается решить две трудные задачки: избежать кары за преступление и сохранить руководящее кресло, зашатавшееся в результате студийных интриг.',124,'8000000 $',18,570,7.038,7.5,'https://image.openmoviedb.com/kinopoisk-images/1898899/7022dc53-c0c1-4e70-a44a-9f4aeba8cb64/orig','movie'),('2024-04-07 20:29:27.911337','2024-04-07 20:29:27.911337',12047,'Схватка',1995,'Нил МакКоли - один из лучших преступников Лос-Анджелеса. Ему противостоит лучший детектив Винсент Ханна. Две сильнейшие команды сходятся друг против друга в смертельной схватке.',171,'60000000 $',18,571,8.034,8.3,'https://image.openmoviedb.com/kinopoisk-images/4774061/9c1474d4-f356-456e-a006-1318328691e7/orig','movie'),('2024-04-07 20:29:28.512575','2024-04-07 20:29:28.512575',12048,'И твою маму тоже',2001,'Двое друзей, не обремененных моральными принципами и мучимые подростковыми гормонами, ищут под жарким солнцем Мексики приключений. Познакомившись на празднике с испанской красоткой Луизой, чье сердце безнадежно разбито, они приглашают её отправиться в поездку на мифический пляж с романтическим названием «Небесные уста» - в мир фантазий и грез, где исполняются мечты. Решив развеяться, Луиза принимает их приглашение. ',106,'2000000 $',18,572,6.97,7.7,'https://image.openmoviedb.com/kinopoisk-images/1900788/effe7157-12bc-4b1c-8268-488cbc752c8c/orig','movie'),('2024-04-07 20:29:29.046750','2024-04-07 20:29:29.046750',12049,'100 девчонок и одна в лифте',2000,'Студент колледжа Мэтью оказывается в лифте с девушкой своей мечты. Однако там нет света, и он не видит её лица. Утром парень решает найти покорившую его сердце незнакомку. Всё, что ему известно о ней: она одна из ста девушек женского общежития. Герой решает проникнуть туда и отыскать её.',94,'{}',16,573,6.658,5.8,'https://image.openmoviedb.com/kinopoisk-images/1599028/cc722d95-d5b6-4e21-be8d-926926f79f35/orig','movie'),('2024-04-07 20:29:29.640705','2024-04-07 20:29:29.640705',12050,'15 минут славы',2001,'Эмиль и Олег, приехав в Нью-Йорк по своим бандитским делам, воруют видеокамеру, и начинают снимать свои криминальные похождения. Очень скоро они переходят от незначительных преступлений к поражающим своей жестокостью убийствам. Желая продемонстрировать свои «подвиги» наибольшему количеству зрителей, они продают видеозаписи на телевидение. Передача, которая решилась пустить это в эфир, моментально становится самой высоко рейтинговой, а наши герои новыми звездами экрана. Но полицейские тоже смотрят телевизор, и тоже не прочь прославиться на всю Америку, пристрелив убийц в прямом эфире...',120,'60000000 $',16,574,6.242,6.1,'https://image.openmoviedb.com/kinopoisk-images/1898899/16a119d4-239d-46af-80b0-b47107bb2f54/orig','movie'),('2024-04-07 20:29:30.314075','2024-04-07 20:29:30.314075',12051,'Круглосуточные тусовщики',2001,'1976 год, Манчестер. Выпускник Кэмбриджа Тони Уилсон — главный пропагандист культовой группы Sex Pistols на ТВ. Он и его друзья основывают новый лэйбл звукозаписи, где создаются первые альбомы Joy Division и Happy Mondays.',117,'{}',18,575,7.097,7.3,'https://image.openmoviedb.com/kinopoisk-images/1629390/c64edb9f-59af-4828-8f48-eb563272516d/orig','movie'),('2024-04-07 20:29:30.976571','2024-04-07 20:29:30.976571',12052,'28 дней',2000,'Избалованная славой и деньгами писательница Гвен Каммингс решила, что ей можно всё: расстроить свадьбу сестры, напившись до полусмерти, угнать лимузин, разнести вдребезги соседский дом. Но реабилитационный центр для хронических алкоголиков, по мнению нью-йоркского суда, должен её отрезвить. За 28 дней Гвен предстоит стать совсем другим человеком.',103,'43000000 $',16,576,6.886,6.1,'https://image.openmoviedb.com/kinopoisk-images/1900788/df8e30d8-eb69-4781-80ec-d9d222018413/orig','movie'),('2024-04-07 20:29:31.580331','2024-04-07 20:29:31.580331',12053,'28 дней спустя',2002,'Группа «зеленых» экстремистов вторгается в центр исследования приматов и выпускает из секретной научной лаборатории обезьяну, зараженную вирусом неудержимой агрессии. Смертельный вирус, передающийся через кровь за считанные секунды, приводит к мгновенному заражению и, соприкоснувшись с любым живым существом, превращает его в кровожадного монстра. \n\n28 дней спустя вся Великобритания охвачена страшной эпидемией: многие эвакуируются, другие ищут безопасные места в надежде спастись. Те, кому посчастливилось не заразиться, вместе с группой военных прячутся в заброшенном доме.',113,'8000000 $',18,577,7.45,7.5,'https://image.openmoviedb.com/kinopoisk-images/1898899/2a574893-50c3-4643-b807-8813795ba9a7/orig','movie'),('2024-04-07 20:29:32.310479','2024-04-07 20:29:32.310479',12054,'Формула 51',2001,'После инцидента в далёком прошлом нелегальный химик-фармацевт Элмо Макэлрой работает в Лос-Анджелесе на бандита по прозвищу Ящерица. Однажды Элмо изобретает новый супернаркотик и решает избавиться от Ящерицы, чтобы отправиться в Ливерпуль, где он планирует осуществить крупную сделку и навсегда отойти от дел. Но Ящерица выживает и отправляет за Элмо наёмную убийцу Дакоту.',93,'27000000 $',18,578,7.207,6.3,'https://image.openmoviedb.com/kinopoisk-images/1600647/2546ec76-a4b8-4249-8ef2-a8348d08eea3/orig','movie'),('2024-04-07 20:29:33.074960','2024-04-07 20:29:33.074960',12055,'Шестой день',2000,'В начале третьего тысячелетия самым суровым законом стал «закон Шестого дня». Он запрещал клонирование людей и создание искусственных копий человека. Но огромная подпольная империя вопреки запрету выращивает человечество нового будущего, сотни управляемых теней.\n\nНалаженная машина преступления не давала сбоев, пока в ее совершенный механизм не вмешалась случайность: пилот вертолета Адам Гибсон неожиданно приоткрыл непроницаемую завесу заговора. Теперь он – последний рубеж обороны, отделяющий цивилизацию от общества зомби.',123,'82000000 $',18,579,6.818,5.9,'https://image.openmoviedb.com/kinopoisk-images/4486454/bf6ee782-f65a-40e7-992a-231ce1a88cbe/orig','movie'),('2024-04-07 20:29:33.729244','2024-04-07 20:29:33.729244',12056,'8 женщин',2001,'Занесённая снегом французская глубинка. В поместье собирается семья для встречи Рождества. Но праздник не состоится. Хозяин дома убит. 8 женщин, близких хозяину дома, начинают расследование.\n\nКаждая из них под подозрением. У каждой есть мотив для убийства. День расследования открывает многие семейные тайны, которые были под семью замками.',110,'8000000 €',18,580,7.628,7,'https://image.openmoviedb.com/kinopoisk-images/1900788/0a04b206-e9f6-481b-bc2a-bf1df4eb70f7/orig','movie'),('2024-04-07 20:29:34.473496','2024-04-07 20:29:34.473496',12057,'8 миля',2002,'Детройт, 1995 год. Блестящая и многообещающая политика индустриального развития города терпит крах и приводит к хаосу и неразберихе, что в результате выливается в один из самых серьезных в американской истории конфликтов между белым и цветным населением. Люди, мирно жившие рядом, оказались по разные стороны баррикад.\n\nШоссе «8 Миля», отделяющее Детройт от пригорода, становится разделительной полосой между черными и белыми. Происходящее в городе находит свое отражение в музыке. В бедных кварталах пригорода, где главная цель — выживание, для многих обитателей хип-хоп становится эмоциональной отдушиной, средством, помогающим вырваться из жесткой повседневной реальности.',110,'41000000 $',18,581,7.719,7.2,'https://image.openmoviedb.com/kinopoisk-images/1704946/de906015-a4b2-4d32-ac60-2d09ba361363/orig','movie'),('2024-04-07 20:29:35.050604','2024-04-07 20:29:35.050604',12058,'Мой мальчик',2002,'Возраст Уилла Фримана уже приближается к сорока годам, а он довольно успешно смог избежать в своей жизни обязательств перед кем бы то ни было. Этот состоятельный англичанин никогда не был женат, у него нет детей, у него даже никогда не было постоянной работы.\n\nОтец Уилла был автором популярной рождественской песни, и тем самым избавил своего сына от проблем с деньгами. Уилл живёт на проценты, получаемые от использования песни его отца. Чтобы наконец-то повзрослеть и найти себе женщину, Уилл начинает ходить на специально организованные встречи родителей-одиночек, выдавая себя за отца, у которого якобы есть сын. На одной из встреч Уилл встречает двенадцатилетнего Маркуса, сына одной из матерей-одиночек.\n\nМальчик и Уилл привязываются друг к другу и становятся лучшими друзьями. Маркус находит в Уилле понимающего взрослого, который помогает ему справляться с проблемами, а Уилл начинает постепенно заботиться о мальчике, чувствовать перед ним свою ответственность и взрослеть...',97,'30000000 $',12,582,7.348,7.1,'https://image.openmoviedb.com/kinopoisk-images/1599028/5639aaca-6c64-4f43-bcb1-5fbf6eb8daf5/orig','movie'),('2024-04-07 20:29:35.786027','2024-04-07 20:29:35.786027',12059,'О Шмидте',2002,'66-летний сотрудник страховой компании Уоррен Шмидт выходит на пенсию. Пытаясь привыкнуть к новому статусу, он начинает переосмысливать прожитую жизнь. После внезапной смерти жены Уоррен решает навестить дочь, живущую в другом штате, накануне её свадьбы с человеком, который ему никогда не нравился.',125,'30000000 $',18,583,7.277,7.2,'https://image.openmoviedb.com/kinopoisk-images/6201401/8719b910-284b-4159-a58e-99fc7807ff33/orig','movie'),('2024-04-07 20:29:36.324559','2024-04-07 20:29:36.324559',12060,'Адаптация',2002,'Взявшись за адаптацию книги журналистки Сьюзен Орлеан «Похититель орхидей», знаменитый сценарист Чарли Кауфман оказывается в душевном и творческом тупике. Странные чувства, овладевшие им, мешают ему работать. Но однажды Чарли решает описать в сценарии всё происходящее с ним. Вскоре автор замечает, что действительность и вымысел начинают переплетаться самым причудливым и неожиданным образом.',115,'19000000 $',18,584,7.002,7.7,'https://image.openmoviedb.com/kinopoisk-images/1898899/bdb01722-620f-4ff9-bf29-30f7a8389fbf/orig','movie'),('2024-04-07 20:29:36.885566','2024-04-07 20:29:36.885566',12061,'Али',2001,'Мохаммед Али является великим героем Америки, кумиром всего мира, и в то же время, одной из самых недооцененных персон XX века. Борясь за гражданские права в родной стране в сложные, бурные годы, когда громкие политические и социальные события коренным образом меняли мировоззрения людей, Али защищал угнетенных и дарил людям новую надежду. История сделала его живой легендой, и теперь вряд ли найдется на планете хоть один человек, который не слышал гордое имя Али.',157,'107000000 $',18,585,7.478,6.7,'https://image.openmoviedb.com/kinopoisk-images/4774061/660f1414-cb58-4a8e-b316-e92c7af32894/orig','movie'),('2024-04-07 20:29:37.527383','2024-04-07 20:29:37.527383',12062,'И пришел паук',2001,'Из элитной школы похищают девочку Меган, дочь сенатора Роуза. Преступник оказывается оригиналом, каких мало: вместо того чтобы спокойно дождаться своего заслуженного выкупа, он начинает играть с полицией в опасную игру, основными участниками которой становятся доктор Алекс Кросс и Джез Флэниган, его новая напарница из секретной службы, охранявшей школу.',104,'60000000 $',18,586,6.896,6.4,'https://image.openmoviedb.com/kinopoisk-images/1599028/8efd6797-2996-44ed-bf30-f2b44a152ad6/orig','movie'),('2024-04-07 20:29:38.216794','2024-04-07 20:29:38.216794',12063,'Американский пирог 2',2001,'Со времен первого фильма прошел год, все герои теперь учатся не в средней школе, а в колледже, и летом на каникулы решают снять загородный дом, где можно весело провести время, поваляться на пляже и погоняться за девчонками, коих там в избытке.\n\nВпрочем, проблемы себе найдет каждый из героев: к Джиму собирается приехать та самая «студентка по обмену» Надя, с которой он публично облажался в первом фильме, Кевин понял, что просто друзьями с Викки он быть не может, а Крис никак не может заняться сексом по телефону со своей подругой Хезер, уехавшей на учебу в другой город. В довершение всего Пол Финч начал практиковать тантрический секс, считая дни до прибытия Мамы Стифлера.',111,'30000000 $',18,587,7.006,6.4,'https://image.openmoviedb.com/kinopoisk-images/1599028/bed1ea39-ae9f-4dda-a36e-a3d7fedaaab3/orig','movie'),('2024-04-07 20:29:38.743784','2024-04-07 20:29:38.743784',12064,'Американский психопат',2000,'Днем он ничем не отличается от окружающих, и в толпе вы не обратите на него внимания. Но ночью этот благовоспитанный гражданин превращается в изощренного убийцу, терроризирующего спящий город.\n\nСовременный дикарь, презирающий законы человечества, питается только испепеляющим пламенем своей ненависти, которая растет с каждым новым преступлением. Лавина ужаса приближается к критической черте. Скоро наступит момент, когда ее уже нельзя будет остановить.',102,'7000000 $',18,588,7.153,7.6,'https://image.openmoviedb.com/kinopoisk-images/1599028/cd539991-3fae-4931-b7d7-1d9e54cbc969/orig','movie'),('2024-04-07 20:29:39.424193','2024-04-07 20:29:39.424193',12065,'Анатомия',2000,'Студентка медицинского института попадает на учебную практику к известному профессору, но девушка и не подозревала, что ей предстоит изучать странную и жестокую науку: маститый наставник оказывается вовсе не тем, за кого себя выдает.',103,'8400000 DEM',16,589,6.355,6,'https://image.openmoviedb.com/kinopoisk-images/1704946/272f5deb-0a30-4823-8b41-24b06cd99e7c/orig','movie'),('2024-04-07 20:29:40.033642','2024-04-07 20:29:40.033642',12066,'Зверофабрика',2000,'За воротами тюрьмы нормальная жизнь заканчивается. Любой несчастный вступивший в стены этого жуткого старого здания обречен жить по чудовищным, волчьим законам, от которых законопослушный человек придет в неописуемый ужас. Здесь татуированные рецидивисты режут и калечат друг друга, устраивают кровопролитные разборки, и «берут в жены» слабаков, которые не могут за себя постоять.',91,'3600000 $',18,590,6.771,6.6,'https://image.openmoviedb.com/kinopoisk-images/1704946/cc7bc3fc-be1b-411e-aa82-c18bd142ad0a/orig','movie'),('2024-04-07 20:29:40.606371','2024-04-07 20:29:40.606371',12067,'Юбилей',2001,'Когда писатель Джо и его жена - актриса Салли устроили вечеринку в честь шестилетней годовщины их непростого брака, гости и хозяева начали говорить друг другу то, чего они никогда не слышали в Голливуде - правду.',115,'{}',16,591,5.858,6.3,'https://image.openmoviedb.com/kinopoisk-images/1599028/b231fb7e-28a6-4570-bdb8-88cc33b051ef/orig','movie'),('2024-04-07 20:29:41.266209','2024-04-07 20:29:41.266209',12068,'Опасная правда',2001,'Хочешь знать правду? Будь готов стать мишенью… Он считал себя везунчиком в то время, как на самом деле находился на краю пропасти. Майло Хоффман, молодой гений-программист, получил престижное место в суперкорпорации мультимедийного магната Гэри Уинстона, этакого Билли Гейтса нового поколения. Перед Хоффманом открылись перспективы роста, герой уже предвкушал блестящую карьеру, когда...\n\nВнезапно за восхитительным фасадом процветающей фирмы перед ним стали проступать истинные ее черты - пожирающего конкурентов монстра, полного опасных тайн. Слишком поздно Майло понял, что стал винтиком в бесчеловечной машине, пешкой в преступной игре лукавого миллиардера. Решится ли пешка бросить вызов Игроку, который может смахнуть ее с доски одним движением мизинца?...',108,'30000000 $',12,592,6.748,6.1,'https://image.openmoviedb.com/kinopoisk-images/1773646/7e731ad9-ca89-4397-bf38-7c728b24d8a5/orig','movie'),('2024-04-07 20:29:41.939258','2024-04-07 20:29:41.939258',12069,'Арарат',2002,'Сюжет картины разворачивается вокруг Ани, профессора истории искусств, который становится консультантом на съемках эпического фильма под названием Арарат, затрагивающего проблемы геноцида, который снимает американский режиссер. Тем временем 18-летний сын Ани, Раффи, который только что возвратился с дополнительных съемок, проходивших в Турции, подвергается аресту со стороны таможенника в аэропорту Торонто.',115,'15500000 $',16,593,7.766,6.3,'https://image.openmoviedb.com/kinopoisk-images/1773646/3656ff92-e23f-4cce-b86d-b21b1b6fa797/orig','movie'),('2024-04-07 20:29:42.553899','2024-04-07 20:29:42.553899',12070,'Искусственный разум',2001,'В будущем мире вырвавшегося из-под контроля глобального потепления и пугающих достижений науки, смертные живут бок о бок с удивительными и сложными роботами. Но когда продвинутый прототип робота-ребенка по имени Дэвид программируется на проявление бескорыстной любви, члены его человеческой семьи оказываются неготовыми к последствиям такого чувства.\n\nНеожиданно Дэвид оказывается один в странном и опасном мире. С помощью уличного робота Дэвид пускается в поиски загадки своего собственного происхождения.',146,'100000000 $',12,594,7.924,7.2,'https://image.openmoviedb.com/kinopoisk-images/6201401/b8ed8871-42b2-4cf3-872a-c2e5c141c7cb/orig','movie'),('2024-04-07 20:29:43.164215','2024-04-07 20:29:43.164215',12071,'Астерикс и Обеликс: Миссия Клеопатра',2002,'Царица Египта Клеопатра заключает пари с римским императором Юлием Цезарем о том, что её подданные смогут всего за три месяца построить для него грандиозный дворец. Великой чести руководить строительством удостоен архитектор Нумеробис, которого в случае неудачи бросят на растерзание крокодилам.\n\nПонимая, что в такие краткие сроки ему не уложиться, Нумеробис вызывает на помощь своего старого друга друида Панорамикса с зельем, дарующим сверхъестественную силу. А весёлые и находчивые друзья Астерикс и Обеликс сопровождают старца в Египет, чтобы помешать проискам Цезаря, не желающего проигрывать Клеопатре.',107,'50300000 €',12,595,7.292,6.7,'https://image.openmoviedb.com/kinopoisk-images/6201401/b9eeb7d8-d216-4221-9ee6-b28be6203ec2/orig','movie'),('2024-04-07 20:29:43.834747','2024-04-07 20:29:43.834747',12072,'Быстрый бегун',2000,'Двое братьев Амакджуаг (Силач) и Атанарджуат (Быстроногий) бросают вызов злым духам, внесшим раздоры в маленькое кочевое племя инуитов. Атанарджуат завоевывает сердце красавицы Атуат, отвергнувшей ради него хвастливого сына вождя Оки. Поклявшийся отомстить сопернику, Оки со своими родичами нападает на братьев во время сна...',172,'1960000 CA$',16,596,6.916,7.4,'https://image.openmoviedb.com/kinopoisk-images/1704946/1683f3d3-ad90-4cb7-a804-f9e1e065fc49/orig','movie'),('2024-04-07 20:29:44.396305','2024-04-07 20:29:44.396305',12073,'Атлантида: Затерянный мир',2001,'Атлантида... Мечтой найти легендарный затонувший в пучинах океана остров грезили многие смельчаки. Но только юному картографу Майло Тэтчу повезло: в 1914 году в его руки попал таинственный дневник, указывающий путь к Затерянной империи. И вот уже самая могучая подводная лодка в мире под командованием неустрашимого капитана Рурка выходит в открытый океан.\n\nМайло и его спутников ждёт множество незабываемых приключений, превосходящих все похождения капитана Немо: схватка с морским чудовищем, древние загадки, буйство стихий, мистические силы и даже встреча с цивилизацией атлантов. И это лишь малая толика того, что ждёт героев на их пути к тайнам великой Атлантиды.',95,'120000000 $',0,597,7.892,6.9,'https://image.openmoviedb.com/kinopoisk-images/1773646/f98bcf6d-d34c-4d4d-b3cc-f5325bbe3e0d/orig','cartoon'),('2024-04-07 20:29:45.171639','2024-04-07 20:29:45.171639',12074,'Остин Пауэрс: Голдмембер',2002,'В 1975 году отец Остина Пауэрса — знаменитый английский шпион Нейджел Пауэрс — был похищен голландским злодеем Голдмембером. Теперь, в XX веке, знаменитый шпион Остин Пауэрс решает помочь отцу. Заручившись поддержкой давнего врага Доктора Зло, с помощью его машины времени Остин совершает прыжок во времени.\n\nОн оказывается в 1975 году, в эпохе диско. Однако вскоре выясняется, что одержимый идеей завоевать весь мир Доктор Зло, сам был в сговоре с Голдмембером и возможно причастен к похищению отца Остина. Может быть, похищение Нейджела Пауэрса — это всего лишь уловка двух злодеев с целью заманить к себе Остина Пауэрса?\n\nВместе с очаровательной подругой Фокси Клеопатрой Остин пытается распутать злодейские планы Доктора Зло и Голдмембера, чтобы не только выручить своего отца, но и спасти весь мир от этих злодеев.',94,'63000000 $',18,598,5.884,6.2,'https://image.openmoviedb.com/kinopoisk-images/1946459/dd8bed6a-eab1-4524-ac4e-e17c43a990d0/orig','movie'),('2024-04-07 20:29:45.842245','2024-04-07 20:29:45.842245',12075,'Автофокус',2002,'Сейчас мало кто помнит этого актера, но было время, когда имя Боба Крейна гремело на всю Америку. В 60-70-х годах ХХ века он был звездой сверхпопулярного комического шоу «Герои Хогана» и пользовался большим успехом. Однако даже на пике его известности мало кто знал, что красавец Боб вел двойную жизнь, о которой и повествует этот фильм.  Под маской рубахи-парня таился сексуально одержимый человек, устраивавший при помощи своего приятеля, снимавшего происходящее на камеру, изысканные эротические игрища с участием роскошных девочек. Тайной была его частная жизнь, тайной стала и смерть: в 1978 году Крейна нашли убитым. Убийца не найден до сих пор…',105,'7000000 $',18,599,6.335,6.6,'https://image.openmoviedb.com/kinopoisk-images/1773646/25f2642d-2df3-4854-ba90-3d8616813089/orig','movie'),('2024-04-07 20:29:46.465087','2024-04-07 20:29:46.465087',12076,'Авалон',2001,'В отдаленном будущем человечество осваивает виртуальный мир компьютерной игры под названием «Авалон». Лишь немногим удается достичь в игре финального уровня, а те, кто возвращаются, впадают в коматозное состояние. Чтобы попытаться спасти своего возлюбленного от этой участи, Эш преисполнена решимости пройти всю игру и встретиться в финале с загадочным персонажем по имени Призрак.',107,'8000000 $',16,600,6.195,6.4,'https://image.openmoviedb.com/kinopoisk-images/1704946/9c2bb851-9e84-42aa-8555-e9abe154ca36/orig','movie'),('2024-04-07 20:29:47.144735','2024-04-07 20:29:47.144735',12077,'Замороченные',2000,'Кризис в развитии телевизионных шоу заставляет чернокожего сценариста Пьера Делакруа прибегнуть к использованию давно забытого в Америке жанра - менестель-шоу, изначально существовавшего в середине 19 века. В те времена в шоу участвовали только белые актеры, игравшие роль чернокожих.\n\nТеперь сценарист решает использовать только афро-американцев, причем содержание шоу становится весьма не политкорректным и даже расистским, что, тем не менее, не мешает ему стать хитом и перевернуть жизнь всех связанных с ним людей с ног на голову...',135,'10000000 $',100,601,6.277,6.7,'https://image.openmoviedb.com/kinopoisk-images/1773646/a90caec0-baf4-4d92-82cf-f4c3a13937ec/orig','movie'),('2024-04-07 20:29:47.772679','2024-04-07 20:29:47.772679',12078,'Бандиты',2001,'Джо Блейк и Терри Коллинз - необычные и удачливые грабители. Без единого выстрела, на одном обаянии и очаровательном нахальстве они взяли больше банков, чем кто-либо. Но однажды в компанию героев попадает бедовая домохозяйка Кейт Уилер, в которую оба немедленно влюбляются, и всё идёт кувырком.',123,'75000000 $',18,602,6.896,6.5,'https://image.openmoviedb.com/kinopoisk-images/1704946/bd614142-2e19-436d-a1de-e83807bd69c2/orig','movie'),('2024-04-07 20:29:48.433501','2024-04-07 20:29:48.433501',12079,'Парикмахерская',2002,'В фильме рассказана история о том, как молодой человек Кэлвин, получивший в наследство от отца парикмахерскую вскоре продает ее местному богачу, который хочет превратить ее в стрип-клуб.\nПозже поняв, что парикмахерская была для людей не только местом для стрижек, но и местом для общения, Кэлвин пытается найти способы сохранить парикмахерскую.',102,'12000000 $',18,603,6.187,6.3,'https://image.openmoviedb.com/kinopoisk-images/1629390/659f564d-9316-4cda-a6d4-30ff464c21fc/orig','movie'),('2024-04-07 20:29:49.037269','2024-04-07 20:29:49.037269',12080,'Королевская битва',2000,'Королевская битва — санкционированная правительством жестокая игра, в которой школьников заставляют участвовать под угрозой уничтожения. На необитаемом острове 42 старшеклассника на протяжении трёх дней будут безжалостно убивать друг друга с помощью случайных предметов и смекалки. Живым с острова вернётся только один.',114,'4500000 $',18,604,7.458,7.5,'https://image.openmoviedb.com/kinopoisk-images/6201401/d8c82549-250a-40cd-818b-2d0b756050eb/orig','movie'),('2024-04-07 20:29:49.714760','2024-04-07 20:29:49.714760',12081,'Пока не наступит ночь',2000,'История Рейнальдо Аренаса - звезды кубинской поэзии, надежды кубинской революции, любимца Фиделя Кастро, среди прочих подобных высланного с Острова Свободы.',133,'{}',18,605,6.993,7.1,'https://image.openmoviedb.com/kinopoisk-images/1900788/13569e83-cfda-4679-bea1-90ec0277c922/orig','movie'),('2024-04-07 20:29:50.424160','2024-04-07 20:29:50.424160',12082,'В тылу врага',2001,'Молодой лейтенант ВВС США Крис Бернетт, один из лучших военно-морских летчиков, по жизни мечтает о том, чтобы ему выпал шанс поучаствовать в настоящих боевых действиях вместо того, чтобы наблюдать за тренировками своих коллег. Однако его командир, адмирал Рейгарт считает, что Крис еще не готов... Да и боевых действий-то особо как-то не предвидится.\n\nНо вот, во время одной из разведывательных миссий, Бернетт фотографирует то, что не было предназначено для чужих глаз и его самолет сбивают. Летчик оказывается в тылу врага, который хочет уничтожить шпиона. Время идет, и адмирал Рейгарт, рискуя своей карьерой, решает нарушить все правила и организовать спасательную операцию, чтобы вернуть своего ученика...',106,'40000000 $',18,606,6.581,6.4,'https://image.openmoviedb.com/kinopoisk-images/1629390/7b59f948-079e-47c9-8770-8b43f2350fc1/orig','movie'),('2024-04-07 20:29:51.084935','2024-04-07 20:29:51.084935',12083,'Фанатик',2001,'В детстве еврейского мальчика по имени Дэнни Балинт выгнали из религиозной школы за вольнодумство. В 22 года Дэнни выбривает голову и становится скинхедом. Теперь он – лидер банды неонацистов, объявивших войну евреям и устраивающих уличные драки и погромы. По его приказу скины готовы убивать. Но несмотря на то, что авторитет Дэнни среди соратников растет, в душе он остается несостоявшимся раввином, который избивает евреев днем, а ночью прилежно изучает священные манускрипты на иврите.',98,'1500000 $',16,607,7.199,7.1,'https://image.openmoviedb.com/kinopoisk-images/1599028/01ea4902-7b67-411c-9f0a-8a53e6a9b3af/orig','movie'),('2024-04-07 20:29:51.651335','2024-04-07 20:29:51.651335',12084,'Победители шоу',2000,'Во время подготовки к самой престижной собачьей выставке, несколько супружеских пар сделают все, чтобы их питомцы были первыми. Они окружают своих четвероногих друзей большей заботой и любовью, чем собственных жен и мужей.\n\nКонечно, для современной собаки одной заботы ветеринара недостаточно. Мохнатым и хвостатым крайне необходим… психоаналитик! Но одержимым хозяевам четвероногих помощь психолога уже не поможет.',90,'10000000 $',0,608,6.137,7.4,'https://image.openmoviedb.com/kinopoisk-images/1599028/6813683e-380b-4d7d-9cf4-cb3d8d2381d5/orig','movie'),('2024-04-07 20:29:52.183262','2024-04-07 20:29:52.183262',12085,'Большие неприятности',2001,'Таинственный чемодан, набитый чем-то ценным, привлекает внимание совершенно разных людей, кардинально меняя жизни разведенного мужчины, влюбленной парочки, нескольких мошенников, парочки наемных убийц, двух агентов ФБР и еще нескольких человек, которые решили рискнуть своими жизнями ради того, чтобы сорвать куш.',85,'40000000 $',18,609,6.951,6.4,'https://image.openmoviedb.com/kinopoisk-images/4303601/e8401191-be8e-4e69-9862-2228e3e380ae/orig','movie'),('2024-04-07 20:29:52.802222','2024-04-07 20:29:52.802222',12086,'Билли Эллиот',2000,'Чем должен увлекаться сын шахтера? Сомнений нет: боксом и только боксом. Но у 11-летнего Билли Эллиота на этот счет было свое мнение — он обожает балет.\n\nОтец и старший брат Тони впадают в ярость, когда узнают, что он променял бокс на «менее мужественный» балет. И только острая на язык миссис Уилкинсон поддерживает Билли в его желании танцевать, и он получает шанс поступить в Королевскую балетную школу.',110,'5000000 $',18,610,8.008,7.7,'https://image.openmoviedb.com/kinopoisk-images/10671298/9d509077-7025-4875-88f0-f9c3e7e4cca7/orig','movie'),('2024-04-07 20:29:53.435300','2024-04-07 20:29:53.435300',12087,'Именинница',2001,'Застенчивый банковский служащий решился на отчаянный шаг: выписал невесту с интернет-сайта «Из России с любовью». И вскоре в лондонском аэропорту он уже встречает свою загадочную Надю.\n\nОна не говорит по-английски, не выпускает сигарету изо рта и согласна выйти за него замуж. Но слишком многое в ней смущает Джона. К тому же, по хорошей русской традиции, на день рождения Нади неожиданно заваливаются в гости два её «братца».',89,'13000000 $',18,611,6.126,6,'https://image.openmoviedb.com/kinopoisk-images/1773646/ac2b678c-d8c9-4e97-8299-ebd9870aa5fa/orig','movie'),('2024-04-07 20:29:54.091165','2024-04-07 20:29:54.091165',12088,'Чёрный ястреб',2001,'Сомали, 1993 год. Страна вымирает от голода, число жертв превысило триста тысяч человек. Миротворческие силы ООН пытаются восстановить порядок и организовать поставки продовольствия. В помощь им Вашингтон выслал полтысячи человек из элитных подразделений американской армии, знаменитые отряды «Дельта» и армейских рейнджеров.\nВ городе Могадишо хозяйничает и творит беспредел полевой командир Айдид, убивая мирных граждан и отбирая гуманитарную помощь. В определенный момент орлы из Вашингтона решают провести операцию по захвату Айдида в его резиденции.\nМолодой офицер, только что назначенный взводным; матерый сержант, ведущий колонну машин; казарменный писарь, не нюхавший пороху; экипажи сбитых вертолетов, вынужденных ждать подкрепления и эвакуации; двое солдат, которых забыли взять с собой при смене позиции; генерал, сидящий в штабе и наблюдающий через спутниковую связь, как погибают его солдаты.',144,'92000000 $',18,612,7.803,7.7,'https://image.openmoviedb.com/kinopoisk-images/6201401/09e3284b-3362-4df6-986f-15b91562a967/orig','movie'),('2024-04-07 20:29:54.744252','2024-04-07 20:29:54.744252',12089,'Блэйд 2',2002,'Мир вампиров в ужасе от появления новой расы суперкровососов. Именно благодаря этому легендарный Блэйд и его учитель Уистлер вынуждены объединиться со своими кровными врагами - Кровавой Стаей, элитным отрядом вампиров-воинов.',117,'54000000 $',18,613,6.846,6.7,'https://image.openmoviedb.com/kinopoisk-images/1773646/9c0717ab-9521-4447-b4da-1d453b122d99/orig','movie'),('2024-04-07 20:29:55.482273','2024-04-07 20:29:55.482273',12090,'Мерцающие огни',2000,'Настоящий гангстер не знает, что такое нормированный рабочий день. Пора на покой - решает гангстер Торкильд, когда на день рождения друзья дарят ему новый ствол. Чтобы обеспечить себе безбедное будущее, он прикарманивает 4000000 крон, предназначенных крутому злому боссу, и вместе с приятелем устремляется в жаркие края.\nНо когда машина беглецов внезапно ломается на лесной дороге, ловким ворам приходится искать убежище в ресторане, пустующем неподалеку. Дикая глушь - надёжное убежище для пронырливых бандитов, но смогут ли они здесь укрытся от своих разьяренных врагов, которые уже идут по их следам.',109,'{}',18,614,7.035,7.5,'https://image.openmoviedb.com/kinopoisk-images/1704946/f12e231e-06ec-4cfc-8424-0ae83b9efe3f/orig','movie'),('2024-04-07 20:29:56.144759','2024-04-07 20:29:56.144759',12091,'Кровавая работа',2002,'Терри МакКалеб - бывший агент ФБР, специализирующийся на серийных убийствах, перенес операцию по пересадке сердца и теперь находится на пенсии, теша себя починкой своей лодки. Но его талант вновь востребован, и он получает новое задание. А нанимает его некто Граселия Риверс для того, чтобы он расследовал причину гибели ее сестры, сердце которой и было пересажено Терри.\n\nРасследование выявило  очень интересные факты: сестра Граселии была убита, и убийство было обставлено как инцидент во время ограбления. А убийцей, возможно, был человек, за которым Терри охотился многие годы. Непростая работа для престарелого и имеющего проблемы с сердцем шпиона, который предполагал совсем иначе распорядиться своим временем.',110,'50000000 $',16,615,6.59,6.4,'https://image.openmoviedb.com/kinopoisk-images/1900788/a636cd7e-14a0-4237-9074-35a4c245dea5/orig','movie'),('2024-04-07 20:29:56.846822','2024-04-07 20:29:56.846822',12092,'Кокаин',2001,'Джордж Джанг, обыкновенный парень из пригорода, решил осуществить американскую мечту своим способом — стать первым американцем, импортирующим кокаин в больших объемах. Он создал рынок сбыта, подсадив на кокаин самых знаменитых людей Америки.',123,'53000000 $',18,616,7.969,7.5,'https://image.openmoviedb.com/kinopoisk-images/1629390/f6b90ead-f020-4d7f-9796-b41e8d738499/orig','movie'),('2024-04-07 20:29:57.468257','2024-04-07 20:29:57.468257',12093,'Бойлерная',2000,'Устав от несправедливой жизни, молодой шулер Сет Девис открывает в своей квартире подпольное казино. Однажды один из клиентов предлагает парню работу на брокерской фирме, где месячная зарплата превышает годовой доход от казино. Мечта Сета о крупном заработке сбывается, но вскоре парень начинает понимать, что за всё в жизни нужно платить.',120,'26000000 $',18,617,7.058,7,'https://image.openmoviedb.com/kinopoisk-images/4774061/231782df-bea1-471e-8fd8-49aa2c601383/orig','movie'),('2024-04-07 20:29:58.079917','2024-04-07 20:29:58.079917',12094,'Чужой билет',2000,'В канун Рождества неисправимый ловелас Бадди Эмарал, подцепив в аэропорту красотку, уступает свой авиабилет мужчине, спешащему домой к семье. И этот самолет разбивается. Проходит время, и Бадди решает поехать к вдове погибшего, чтобы как-то помочь ей.\n\nОн хочет загладить свою вину, но, познакомившись с Эбби и её детьми, впервые влюбляется по-настоящему. И теперь не знает, как рассказать ей, что он и есть тот, кто должен был лететь в злосчастном самолёте.',106,'35000000 $',18,618,6.986,5.8,'https://image.openmoviedb.com/kinopoisk-images/1629390/c283e138-f1cd-4012-a07d-695e0fee6859/orig','movie'),('2024-04-07 20:29:58.649675','2024-04-07 20:29:58.649675',12095,'Идентификация Борна',2002,'Команда итальянского рыболовецкого судна находит в водах Средиземного моря тело мужчины. У него два пулевых ранения в спине и имплантированный в бедро микрофильм, помеченный номером швейцарского банка. Когда незнакомец приходит в себя, оказывается, что он не помнит, кто он и что с ним случилось, однако он может говорить на нескольких языках и обладает другими необычными способностями.\n\nПолучив в Цюрихе деньги с указанного банковского счета, он узнает свое имя – Джейсон Борн. Но настоящее это его имя или нет? Пытаясь восстановить свое прошлое, он находит свой адрес в Париже, но вместе с этим понимает, что отслеживается убийцей. Борн уговаривает немецкую студентку Мари отвезти его в Париж, чтобы выяснить все о своем прошлом и понять, кто хочет его убить.',113,'60000000 $',12,619,7.774,7.8,'https://image.openmoviedb.com/kinopoisk-images/1629390/14b9e224-6500-4b8b-acd6-4ae219baf17f/orig','movie'),('2024-04-07 20:29:59.364335','2024-04-07 20:29:59.364335',12096,'Боулинг для Колумбины',2002,'США лидируют в мире по числу убийств с применением огнестрельного оружия. Стволов в стране больше, чем телевизоров. Американцы не могут жить без оружия или просто сошли с ума? Кто или что стоит за этим? Расовые проблемы, которые ещё предстоит решить? Голливуд, рок-н-ролл, Интернет? А может, историческая предрасположенность к насилию? В центре фильма – трагический инцидент: перестрелка в колледже Колумбины. Спорный, глубокий, порой ехидный взгляд на взаимосвязь насилия и страха в современной Америке.',120,'4000000 $',16,620,7.683,8,'https://image.openmoviedb.com/kinopoisk-images/1898899/1d511f48-6c35-4cd0-bd07-24f568503bdf/orig','movie'),('2024-04-07 20:30:00.072291','2024-04-07 20:30:00.072291',12097,'Дневник Бриджит Джонс',2001,'Бриджит Джонс заводит дневник, чтобы описывать свои достижения и победы: как она будет избавляться от лишних килограммов и вредных привычек, а также налаживать личную жизнь. Родители хотят сосватать её за сына соседей, скромника Марка, а Бриджит без ума от своего неотразимого начальника Дэниэла. Неожиданно выбор оказывается совсем не простым.',97,'25000000 $',18,621,7.45,6.8,'https://image.openmoviedb.com/kinopoisk-images/1704946/9b43cf93-2c22-47e9-8d1f-dc898b35d504/orig','movie'),('2024-04-07 20:30:00.810137','2024-04-07 20:30:00.810137',12098,'Добейся успеха',2000,'Между девчонками из групп поддержки спортивных команд разгорается нешуточная борьба за звание лучшей. В ход идут самые неожиданные приёмы и ухищрения. Но чтобы стать первой, команде нужно победить в национальном чемпионате, а этого смогут добиться только самые красивые, талантливые, задорные и сексуальные.',98,'28000000 $',12,622,6.821,6.1,'https://image.openmoviedb.com/kinopoisk-images/1704946/b21f52a3-c298-4389-99c9-2f1f7c50f7ae/orig','movie'),('2024-04-07 20:30:01.438846','2024-04-07 20:30:01.438846',12099,'Клуб разбитых сердец: Романтическая комедия',2000,'Лос-Анджелес. Именно там живет 28-летний голливудский фотограф Дэннис. У него много друзей, всех их объединяет не только образ жизни, но и схожие интересы. Парни не задумываются о смысле жизни, развлекаются и каждый день переживают, как последний.\n\nНо в канун своего дня рождения Дэннис неожиданно предается размышлениям о том, как много для него значат друзья, ведь они, по сути, заменяют ему семью.',94,'1000000 $',18,623,6.371,6.9,'https://image.openmoviedb.com/kinopoisk-images/1629390/ec9ddbb3-8f90-46cb-b9f6-c3dc26889cb5/orig','movie'),('2024-04-07 20:30:02.150656','2024-04-07 20:30:02.150656',12100,'Брат якудзы',2000,'После разгрома родного мафиозного клана боевик Ямамото по прозвищу Аники (Старший Брат) бежит из Японии в Америку. Здесь его встречает чужой и не менее жестокий мир безжалостной борьбы за власть в преступной среде, в которой Ямамото решительно отвоевывает себе место, следуя кодексу якудза. Полагаясь только на себя и дорожа верными друзьями, он в одиночку ведет войну с врагами, зная, что в конце кровавого пути его ждет триумф или смерть.',114,'10000000 $',18,624,7.619,7.1,'https://image.openmoviedb.com/kinopoisk-images/1773646/d5eacb28-1537-4cb8-be02-c9d7e12ce681/orig','movie'),('2024-04-07 20:30:02.920835','2024-04-07 20:30:02.920835',12101,'Садист',2001,'Бобби и Марти дружат с самого детства. Только странная у них дружба: патологический садист Бобби зверски измывается над наивным увальнем Марти. И вот однажды «тюфяк» Марти решает раз и навсегда прекратить дикие издевательства и... убить Бобби!',108,'{}',18,625,6.542,6.9,'https://image.openmoviedb.com/kinopoisk-images/1773646/460c3fc6-24c4-48a1-a239-2b913fd3b179/orig','movie'),('2024-04-07 20:30:03.662725','2024-04-07 20:30:03.662725',12102,'Выбор капитана Корелли',2001,'В размеренную жизнь прекрасного греческого острова вмешалась война. На мирный берег высадились итальянские войска. И судьба Пелагии, дочери местного врача, изменилась в один день: вместо скорой свадьбы – расставание с любимым…\nИтальянский офицер, капитан Корелли влюбился в Пелагию, как только ее увидел. Красавица поразила сердце Антонио. Но шла война, а он был солдатом на чужой земле…',131,'57000000 $',18,626,6.886,5.9,'https://image.openmoviedb.com/kinopoisk-images/4774061/b82eeffc-9b3f-4cf4-b3b7-79d4e79132cb/orig','movie'),('2024-04-07 20:30:04.598649','2024-04-07 20:30:04.598649',12103,'Изгой',2000,'Инспектор логистической компании FedEx Чак Ноланд — трудоголик, у которого нет времени даже на собственную невесту. Во время очередной командировки самолет с Ноландом падает в Тихий океан. Чак, единственный, кому посчастливилось спастись, оказывается на необитаемом острове, где ему придется бороться за выживание.',143,'90000000 $',12,627,8.253,7.8,'https://image.openmoviedb.com/kinopoisk-images/1599028/249ec6b5-b02a-4a17-a31a-0fb2d03f963e/orig','movie'),('2024-04-07 20:30:05.235519','2024-04-07 20:30:05.235519',12104,'Смерть в Голливуде',2001,'В ноябре 1924 года произошло странное событие, шокировавшее знаменитую «фабрику грез». Во время круиза на яхте всемогущего медиа-магната Хёрста был убит знаменитый продюсер и режиссер Томас Инс.\n\nОднако об этом не писала пресса, не было проведено расследование, и только невероятные слухи о тайном заговоре и паутине безумных страстей и беззастенчивой лжи, опутавшей неподражаемого Чарли Чаплина, легендарного Уильяма Хёрста, его очаровательную юную любовницу Мэрион Дэвис и несчастную жертву, помогли спустя много лет нарисовать картину загадочного происшествия, правда о котором умерла вместе с «золотой эпохой» сказочного Голливуда…',114,'7000000 $',12,628,6.236,6.4,'https://image.openmoviedb.com/kinopoisk-images/1898899/903b591b-41e0-4e7e-b095-2a27ea8d8a7a/orig','movie'),('2024-04-07 20:30:05.979449','2024-04-07 20:30:05.979449',12105,'Безумный Сесил Б.',2000,'Днем Синклер Стивенз - солидный директор кинотеатра. А по ночам он становится «безумным Сесилом Б.» - подпольным кинорежиссером и кумиром банды кинонеформалов.Он хочет снять свой фильм, и никто не сможет ему помешать!\n\nНе колеблясь ни минуты, он организовывает похищение знаменитой голливудской киноактрисы Хани Уитлок, которая по сюжету фильма должна устраивать погромы в кинотеатрах, где идут голливудские хиты, и организовывать прочие дебоши в общественных местах.\n\nВынужденная играть в картине, которая снимается в «максимально близком к реальности» стиле, она постепенно становится похожей на других актеров-камикадзе и одним из убежденных солдат войны против плохого кино.',87,'10000000 $',16,629,6.873,6.2,'https://image.openmoviedb.com/kinopoisk-images/1946459/15ac0141-701c-4c9c-a494-b502a040f548/orig','movie'),('2024-04-07 20:30:06.706966','2024-04-07 20:30:06.706966',12106,'Клетка',2000,'Женщина-психиатр проникает в сознание серийного убийцы, находящегося в коме. На его счету уже почти десяток жертв — молодых девушек, которых маньяк истязает самым нечеловеческим образом, прежде чем лишить жизни. Последнюю похищенную так и не нашли, но есть надежда, что её ещё можно спасти, а для этого нужно внедриться в тёмные закоулки подсознания психопата и выяснить, где находится камера пыток.',107,'33000000 $',18,630,7.052,6.4,'https://image.openmoviedb.com/kinopoisk-images/6201401/9f141ccb-d9e2-4a6c-b5dc-f71118ecd96d/orig','movie'),('2024-04-07 20:30:07.454718','2024-04-07 20:30:07.454718',12107,'Авансцена',2000,'Танец — вот смысл их жизни. Молодые и амбициозные, будущие звезды хореографии готовы на все ради успеха. Не щадя своих сил, они взлетают на олимп славы.\n\nНа сцене они — боги, но в обычной жизни — простые смертные со своими достоинствами и недостатками. И вот здесь стирается грань между волшебным миром танца и суровой реальностью.',115,'29000000 $',12,631,7.562,6.7,'https://image.openmoviedb.com/kinopoisk-images/1599028/7086cb63-a7a7-47ca-9184-87714b411591/orig','movie'),('2024-04-07 20:30:08.111871','2024-04-07 20:30:08.112878',12108,'В чужом ряду',2002,'Успешный юрист с Уолл-стрит Гэвин Банек и представитель страховой компании Дойл Гипсон, возвращающийся к нормальной жизни после алкоголизма, становятся виновниками аварии. Жертв нет, но ссора этих людей будет иметь серьёзные последствия для каждого из них.',98,'45000000 $',16,632,7.01,6.5,'https://image.openmoviedb.com/kinopoisk-images/1773646/cc86dd00-d26f-4502-90a2-f8d6330d1db1/orig','movie'),('2024-04-07 20:30:08.691454','2024-04-07 20:30:08.691454',12109,'Ангелы Чарли',2000,'Ангелы Чарли - суперсекретное элитное спецподразделение, которому доверяют только невыполнимые задания. С помощью новейших технологий, современного оружия, боевых искусств и убийственного женского очарования Ангелы Чарли творят чудеса. Но настоящим испытанием станет лишь это последнее задание...',98,'93000000 $',12,633,6.576,5.6,'https://image.openmoviedb.com/kinopoisk-images/1773646/452868c6-d94b-4855-88ed-482eadbc968f/orig','movie'),('2024-04-07 20:30:09.436239','2024-04-07 20:30:09.436239',12110,'Чикаго',2002,'Рокси Харт мечтает о песнях и танцах и о том, как сравняться с самой Велмой Келли, примадонной водевиля. И Рокси действительно оказывается с Велмой в одном положении, когда несколько очень неправильных шагов приводят обеих на скамью подсудимых.\n\nВ угрюмых стенах тюрьмы Рокси встречает легендарного адвоката Билли Флинна, который соглашается взяться за ее дело. Карьера Рокси резко идет вверх. Но хитроумная мисс Келли приготовила всем большой сюрприз «под занавес»...',113,'45000000 $',18,634,7.684,7.2,'https://image.openmoviedb.com/kinopoisk-images/1704946/1e91d250-bccf-475b-be3e-5d3fd910957f/orig','movie'),('2024-04-07 20:30:10.170318','2024-04-07 20:30:10.171332',12111,'Побег из курятника',2000,'Курочкам на ферме миссис Туиди приходится нелегко. Для каждой из этих несчастных птиц любое, даже самое погожее утро, может стать последним: в мгновение ока они могут угодить в суп или стать начинкой для пирожка.\n\nБезропотные домашние птички живут в постоянном страхе в ужасных курятниках, напоминающих бараки концлагеря. Все попытки вырваться из страшной фермы на волю оканчиваются провалом. Но однажды на ферме объявляется веселый американский петух Рокки...',84,'45000000 $',0,635,6.956,7.1,'https://image.openmoviedb.com/kinopoisk-images/1704946/02bfc64d-d494-4df3-818a-f23f7810309b/orig','cartoon'),('2024-04-07 20:30:11.013528','2024-04-07 20:30:11.013528',12112,'Шоколад',2000,'Как-то зимним днем в тихом французском городке появляется молодая женщина по имени Виенн. А чуть позже она открывает необычный шоколадный магазин, предлагая посетителям испытать новое удовольствие. И действительно, побывав у нее однажды, люди вновь и вновь поддаются сладкому очарованию &#151; Виенн волшебным образом угадывает чужие желания.',121,'25000000 $',12,636,7.869,7.2,'https://image.openmoviedb.com/kinopoisk-images/1704946/da6e3cc3-1d27-4c1d-868c-c8ee0be45057/orig','movie'),('2024-04-07 20:30:11.644238','2024-04-07 20:30:11.644238',12113,'Взгляд изнутри',2000,'Марк Рид по кличке «Мясник» всегда мечтал стать легендой криминального мира. И если у Америки был Аль Капоне, то Австралия получила «Мясника».',94,'5000000 A$',18,637,6.679,7.1,'https://image.openmoviedb.com/kinopoisk-images/1629390/9b5420b2-58e5-4055-927e-2e99b7eb3d3b/orig','movie'),('2024-04-07 20:30:12.295015','2024-04-07 20:30:12.295015',12114,'Чак и Бак',2000,'Бак в свои двадцать семь остался одиннадцатилетним. К его удивлению встреча с лучшим другом детства - Чаком спустя 15 лет не вернула прежних отношений. Чак стал другим: он был важной шишкой в музыкальной компании, собирался жениться и вообще был очень занят.\n\nИ тогда Бак решает отправиться в Лос - Анджелес и, разобравшись на месте, сделать все, чтобы завоевать былую дружбу!',96,'250000 $',18,638,5.798,6.6,'https://image.openmoviedb.com/kinopoisk-images/1599028/4ca557e0-2a03-4f5a-ad4d-fe7734ed0378/orig','movie'),('2024-04-07 20:30:12.862750','2024-04-07 20:30:12.862750',12115,'Последнее дело Ламарки',2002,'Винсент Ламарка становится офицером полиции, ему поручают расследование дела о торговле наркотиками. Для сбора улик Винсенту необходимо съездить в его родной город, «город у моря». Там он встречает сына от предыдущего брака, и расследование принимает неожиданный оборот, когда он понимает, что его собственный сын – главный подозреваемый...',108,'40000000 $',18,639,6.394,6.1,'https://image.openmoviedb.com/kinopoisk-images/10900341/acc4578a-1fa0-4116-8f9c-2abcda9359b2/orig','movie'),('2024-04-07 20:30:13.521022','2024-04-07 20:30:13.521022',12116,'Золотая пыль',2000,'Калифорния, 1849-й год. Заснеженные поля золотых приисков усеяны бесчисленными охотниками за золотом. Среди них - бедный ирландский иммигрант Дэниел Диллон, его жена Елена, их новорожденная дочь Хоуп. Потеряв дорогу во время пурги, измученные, голодные, они набредают на одинокую хижину.\n\nРазгоряченный алкоголем и жаждой золота, Диллон продает свою жену и ребенка добытчику, который живет в этой хижине. Двадцать лет спустя, это место превращается в процветающий новый город старателей, где разбогатевший Диллон - некоронованный король. Возвращение его жены и уже взрослой дочери в город неминуемо приведет к трагическим последствиям…',120,'20000000 CA$',18,640,6.254,6.3,'https://image.openmoviedb.com/kinopoisk-images/1629390/a608e007-8157-4271-895e-403da7e011f2/orig','movie'),('2024-04-07 20:30:14.270487','2024-04-07 20:30:14.270487',12117,'Признания опасного человека',2002,'По автобиографической книге Чака Бэрриса. Чак Бэррис был автором популярнейших телевизионных развлекательных программ шестидесятых годов. Но не всегда у него дела шли гладко, и однажды, в период очередного кризиса, ему предлагает работу ЦРУ. Бэррису позарез нужны деньги и он соглашается. \r\n\r\nОн проходит военную подготовку, где в совершенстве овладевает искусством профессионально отбирать человеческие жизни. Теперь он живет двумя жизнями: в одной он убивает тех, кого правительство сочло за врагов, а в другой он по-прежнему создатель рейтинговых телевизионных шоу.',113,'30000000 $',12,641,7.033,7,'https://image.openmoviedb.com/kinopoisk-images/1599028/b63b875e-1c80-4053-8c36-0b2c02f90cea/orig','movie'),('2024-04-07 20:30:15.110882','2024-04-07 20:30:15.110882',12118,'Претендент',2000,'Президент США Джексон Ивэнс, которому вскоре предстоит покинуть Белый дом, желая навсегда остаться в истории страны, выдвигает на пост скончавшегося вице-президента женщину, сенатора Лэйн Хенсон, вызывая этим сенсационным решением бурные дебаты в правительстве и обществе.\nЕму решительно противостоит конгрессмен Шелдон Раньон, у которого есть свой кандидат на этот пост. Наплевав на моральные и этические нормы, он придает гласности факты распутного поведения Лэйн Хенсон в студенческие годы, стремясь «похоронить» сенатора любыми, даже самыми грязными средствами.\nТеперь умной и порядочной женщине, поставленной перед самым трудным выбором в ее жизни, предстоит решить - сойти ли ей с политической арены, навсегда запятнав себя позором, или продолжить борьбу, противостоя могущественным и безжалостным врагам.',126,'20000000 $',18,642,6.328,6.9,'https://image.openmoviedb.com/kinopoisk-images/1704946/2f98e132-e77c-4c10-a364-58c9f81fbe1a/orig','movie'),('2024-04-07 20:30:15.789966','2024-04-07 20:30:15.789966',12119,'Граф Монте-Кристо',2002,'Так же, как и в знаменитой классической истории, главным героем фильма является Эдмон Дантес. Этого бесхитростного молодого человека, собирающегося жениться на красавице Мерседес, предает его лучший друг Фернан.\n\nОказавшись заключенным в тюрьму, Эдмон Дантес в течение тринадцати лет вынужден терпеть лишения и лелеять мысли о мести своим обидчикам. С помощью человека, сидящего с ним в соседней камере, Эдмону удается бежать из тюрьмы.\n\nПосле этого он появляется в обществе в качестве богатого благородного и могущественного графа Монте-Кристо, который искусно и беспощадно расправляется с людьми, обманувшими и предавшими его много лет назад...',131,'35000000 $',16,643,6.741,7.7,'https://image.openmoviedb.com/kinopoisk-images/1946459/d8cdc133-694f-46e2-a93e-87d620e90a29/orig','movie'),('2024-04-07 20:30:16.607928','2024-04-07 20:30:16.607928',12120,'Безумные и прекрасные',2001,'Любовь – не только счастье. Она и случай. И испытание. И судьба… Карлос – парень из бедной семьи. Николь – капризная богачка. Обоим по семнадцать лет – и, похоже, это единственное, что у них есть общего. Но кто бы мог подумать, что их почти случайный легкий флирт вдруг так внезапно перерастет в чувство, прихода которого не ожидали оба!\n\nДрузья и близкие героев как один ополчились против их «недопустимой» любви. И вот уже новые Ромео и Джульетта вынуждены отстаивать свое хрупкое чувство перед лицом косного мира, который не хочет понять, что быть такими разными – еще не значит быть не созданными друг для друга.',99,'13000000 $',18,644,7.194,6.4,'https://image.openmoviedb.com/kinopoisk-images/1773646/83047e1f-81ba-488d-abf8-19ffb0b03c41/orig','movie'),('2024-04-07 20:30:17.270548','2024-04-07 20:30:17.270548',12121,'Проклятие нефритового скорпиона',2001,'Страховой агент Бриггс терпеть не может свою начальницу. Деловая и напористая, она пытается изменить всю систему поиска мошенников, которой он отдал всю жизнь. Однажды на вечеринке в клубе «Нефритовый скорпион», они, став участниками гипнотического эксперимента, влюбляются друг в друга.\n\nТеперь, лишь услышав нужный пароль, они, как по мановению палочки, начинают испытывать друг к другу нешуточную страсть. Но невинная на первый взгляд шутка оборачивается хорошо подготовленной аферой, когда выясняется, что нечистый на руку гипнотизер использует свою власть, чтобы без труда обворовывать состоятельных клиентов. И вот начинается настоящий кошмар...',103,'33000000 $',18,645,7.211,6.7,'https://image.openmoviedb.com/kinopoisk-images/1898899/9b1bee3f-5814-40fa-b2df-32dc3c703888/orig','movie'),('2024-04-07 20:30:18.011243','2024-04-07 20:30:18.011243',12122,'Танцующая в темноте',2000,'Иммигрантка из Чехословакии Сельма, которая очень любит мюзиклы, работает на заводе и живёт с сыном в съёмном трейлере. У Сельмы тяжёлая болезнь, из-за которой она теряет зрение. Этот же недуг поражает и её сына. Сельма скрывает свою болезнь и пытается работать вслепую, чтобы заработать деньги, необходимые для лечения сына.',140,'12800000 $',18,646,7.976,7.9,'https://image.openmoviedb.com/kinopoisk-images/1599028/355a7fde-66df-42e4-9360-ee8400221203/orig','movie'),('2024-04-07 20:30:19.247121','2024-04-07 20:30:19.247121',12123,'Опасные игры',2002,'История двух друзей-школьников, жизнь которых, как и у большинства их сверстников, заполнена обычными мальчишескими развлечениями: шалости на уроках, дружеские подначки, издевки над учителями и первая юношеская любовь... Но со временем забавы двух приятелей все ближе подходят к опасной черте - ставкой в новой «игре» становится жизнь человека.',104,'12000000 $',16,647,7.069,6.9,'https://image.openmoviedb.com/kinopoisk-images/1898899/f3b67cd3-d1c2-48cb-b96b-1bda6dc8675c/orig','movie'),('2024-04-07 20:30:19.848816','2024-04-07 20:30:19.848816',12124,'Сорвиголова',2003,'Он живёт в мире вечной ночи, но эта темнота заполнена звуками и запахами, её можно попробовать на вкус и потрогать руками. Адвокат Мэтт Мердок слеп, но остальные органы чувств у него работают, как у супермена. Днём Мердок защищает униженных и оскорблённых в зале суда, а ночью превращается в супергероя в маске, восстанавливая справедливость на улицах города самыми радикальными методами.',103,'78000000 $',12,648,6.128,5.3,'https://image.openmoviedb.com/kinopoisk-images/4774061/0b567ece-de92-42e7-8bca-826f2787dd74/orig','movie'),('2024-04-07 20:30:20.549392','2024-04-07 20:30:20.549392',12125,'Убить Смучи',2002,'Дэнни ДеВито, постановщик чёрных комедий \"Сбрось маму с поезда\" и \"Война в семействе Роуз\", предлагает нам новую картину \"Убить Смучи\", где он как следует \"поджарит\" индустрию телевидения для детей. Робин Уильямс, который блеснёт здесь совершенно неожиданной стороной своего потрясающего чувства юмора, исполняет роль Рэндольфа. Эдвард Нортон играет роль наивного добряка, чей персонаж, носорог Смучи, становится сенсацией. А Кэтрин Киннер сыграет роль телевизионного продюсера, который предпочитает строить свои отношения с ведущими детских программ скажем, по-взрослому. Если прибавить в этот взрывоопасный коктейль \"скользкого\" агента (Де Вито), коварного теле-босса (Джон Стюарт) и все виды сумасшествия, которые только можно себе вообразить, только тогда вы будете готовы пуститься в пляс, либо ухватить носорога за его рог!...',105,'50000000 $',16,649,6.579,6.3,'https://image.openmoviedb.com/kinopoisk-images/1599028/30f7821e-ee1a-48bc-9885-b4287e7f3f76/orig','movie'),('2024-04-07 20:30:21.380709','2024-04-07 20:30:21.380709',12126,'На самом дне',2001,'Она узнала, что ее сын - гей. Она нашла его любовника мертвым. Она единственная, кто это знает, и не хочет, чтобы это кто-нибудь знал. Однако приходит неизвестный и требует крупную сумму наличными за видеокассету с доказательствами. Она думает, что быстро найдет деньги и спасет сына, но что произойдет в следующую минуту, не знает никто...',101,'3000000 $',16,650,6.503,6.5,'https://image.openmoviedb.com/kinopoisk-images/1629390/0aabb20f-e8e1-407f-81c6-d0ff650f2eeb/orig','movie'),('2024-04-07 20:30:22.197898','2024-04-07 20:30:22.197898',12127,'Умри, но не сейчас',2002,'На этот раз Джеймс Бонд в глубокой конспирации проводит операцию в Северной Корее. Однако его разоблачают, после чего Бонд оказывается за решеткой.\n\nСумев выбраться из плена только через несколько месяцев 007 возвращается к своей привычной жизни, однако вскоре ему вновь приходится вступить в противоборство со своими корейскими «друзьями» - он узнает о плане британского миллиардера Густава Грейвса создать супероружие, и о его взаимодействии на этом поприще с корейскими военными...',133,'142000000 $',12,651,7.003,6.1,'https://image.openmoviedb.com/kinopoisk-images/1599028/baa75c87-ab13-446b-9c8e-f751b243bc8a/orig','movie'),('2024-04-07 20:30:22.918978','2024-04-07 20:30:22.918978',12128,'Динозавр',2000,'Путешествие трехтонного игуанодонта по имени Аладар, который был разбужен из своего яйца племенем лемуров и случайно воссоединившегося с себе подобными. Из-за огненных метеоритов, разрушающих ландшафт, и нехватки воды в исчезающих водоемах динозавры оказались в гонке за выживание, где главным их противником стало время.\n\nАладар наживает себе врага в лице бессердечного вожака Крона, когда заступается за беззащитных животных в несущемся сломя голову стаде. Лицом к лицу с такими опасностями, как внезапные оползни и атакующие карнотавры, Аладар и его новые друзья должны преодолеть невероятные трудности до того, как обретут новую родину в прекрасной долине.',82,'127500000 $',6,652,7.748,6.4,'https://image.openmoviedb.com/kinopoisk-images/4774061/61638ed8-affb-4518-a546-e7a042bd0d21/orig','cartoon'),('2024-04-07 20:30:23.756979','2024-04-07 20:30:23.756979',12129,'Тарелка',2000,'До осуществления мечты человечества, высадки на Луне, оставались считанные часы. В самый последний момент выяснилось, что для контроля за посадкой, лучше всего подходит радиотелескоп, расположенный в австралийской глубинке.\n\nДля Клиффа Бакстона, возглавляющего бригаду сотрудников телескопа, стало полной неожиданностью огромное количество важных персон, свалившихся на него, как снег на голову. Выкручиваться пришлось самозабвенно и гениально…',101,'{}',100,653,6.493,7.2,'https://image.openmoviedb.com/kinopoisk-images/1704946/cce9015a-cbfc-4b37-ac95-9f64cacc2a2e/orig','movie'),('2024-04-07 20:30:24.383445','2024-04-07 20:30:24.383445',12130,'Псы-воины',2001,'Отряд британских солдат под командованием сержанта Уэллса отправился на боевое задание в дикие леса горной Шотландии. Но то, что началось как обычные армейские учения, превратилось в настоящий кошмар. Прибыв на секретную военную базу, солдаты обнаружили истекающего кровью капитана Райана и растерзанные останки его подчиненных...',105,'2000000 $',16,654,6.701,6.8,'https://image.openmoviedb.com/kinopoisk-images/1777765/3ead34fb-5fa6-42bb-ab16-9da9e438780d/orig','movie'),('2024-04-07 20:30:25.163085','2024-04-07 20:30:25.163085',12131,'Не говори ни слова',2001,'«Вы хотите того же, что они?... Я никогда не скажу... никому из вас» - вот первые слова Элизабет, обращенные к знаменитому психиатру Натану Конраду. Элизабет, замкнутая в себе девушка, страдающая припадками немотивированной агрессии, причину которой никто до сих пор не смог объяснить и, тем более, устранить.\n\nВ Натане просыпается профессиональный интерес и он принимается за лечение, но проходит совсем немного времени, и он узнает, что Элизабет и ее болезнь каким-то таинственным образом связаны с опасностью, грозящей ему и его семье. Дочь психиатра похищают самым бесцеремонным образом, а за ним и его женой устанавливают круглосуточное наблюдение. Чтобы спасти дочь, Натану необходимо расшифровать шестизначный код, спрятанный в затуманенном сознании его пациентки.',113,'50000000 $',18,655,7.122,6.3,'https://image.openmoviedb.com/kinopoisk-images/1704946/a02fbe8a-9a0d-45b4-ba0f-bfbe61e13b28/orig','movie'),('2024-04-07 20:30:25.969179','2024-04-07 20:30:25.969179',12132,'Любовное настроение',2000,'Гонконг, 1962 год. Су и Чоу снимают соседние комнаты в одной квартире. Их супруги всё время в отлучке. Однажды Чоу узнаёт сумочку Су, подаренную ей мужем, — у его жены такая же. А Су узнаёт галстук Чоу, подаренный ему женой, — такой же есть у её мужа. Оба понимают, что их супруги изменяют им друг с другом.',98,'{}',18,656,7.893,8.1,'https://image.openmoviedb.com/kinopoisk-images/1777765/0f01bd3d-4327-47c0-b879-1164775ca908/orig','movie'),('2024-04-07 20:30:26.597782','2024-04-07 20:30:26.597782',12133,'Эллинг',2001,'Два года Эллинг лечился в психиатрической клинике, и вот настал тот день, когда он должен вернуться к нормальной жизни... Рассказанная с грустной улыбкой история двух душевнобольных, подружившихся в клинике и по выходе решивших держаться друг друга и впредь, еще и свидетельство благополучия норвежского общества: когда сумасшедшие могут, не испытывая финансовых проблем, устраивать свою жизнь наравне с дееспособными гражданами за счет государства - это прекрасно.',89,'15500000 NOK',100,657,6.912,7.5,'https://image.openmoviedb.com/kinopoisk-images/1898899/05fd18c5-5a97-4816-b8ef-07c2ba2d0daa/orig','movie'),('2024-04-07 20:30:27.219790','2024-04-07 20:30:27.219790',12134,'Похождения императора',2000,'Как и положено царственной особе, император Куско - очень занятой человек. Но последнее его занятие грозит обернуться большими неприятностями: правитель решил построить для себя водный парк, предварительно снеся одну из деревень королевства.\n\nЭтот план непременно бы воплотился в жизнь, если бы неприятность не произошла уже с самим императором: недруги превратили его в ламу! Но напасти на этом не закончились: единственным человеком, который мог помочь императору вернуться на трон и в собственное тело, оказывается житель деревни, обреченной на снос. Дорога домой для Куско обещает быть очень долгой.',78,'100000000 $',0,658,7.94,7.4,'https://image.openmoviedb.com/kinopoisk-images/1704946/3ed9d55f-e155-49ec-a370-9f8e51066d61/orig','cartoon'),('2024-04-07 20:30:27.988261','2024-04-07 20:30:27.988261',12135,'Враг у ворот',2001,'1942 год, разгар Сталинградской битвы. Немецкое командование направляет на передовую своего лучшего стрелка, майора Кенига, с особым заданием. Этот опытный и терпеливый профессионал - единственный, кто может попытаться справиться с русским «ангелом смерти» - неуловимым снайпером Василием Зайцевым.\nЗайцев - легенда и икона для защитников Сталинграда. Каждый день он выносит смертный приговор десяткам захватчиков, попавших в перекрестье его прицела. Между двумя уникальными снайперами начинается смертельная схватка, победителем из которой будет суждено выйти лишь одному...',131,'68000000 $',18,659,7.011,7.5,'https://image.openmoviedb.com/kinopoisk-images/1600647/8cc4fbc3-bd0b-4b78-83e9-323cb21ee640/orig','movie'),('2024-04-07 20:30:28.793642','2024-04-07 20:30:28.793642',12136,'Энигма',2001,'В марте 1943 года британская разведка узнаёт, что уже не может читать секретные германские донесения, так как нацисты кардинально усовершенствовали свою шифровальную машину «Энигма». На её разгадку могут уйти годы, но в распоряжении гениального математика Тома Джерико всего четыре дня. Вскоре Тому становится известно, что его любовницу и коллегу Клэр подозревают в связях с нацистами, более того &#151; она бесследно исчезла. Не веря в безумные обвинения, молодой ученый начинает тайное расследование, не догадываясь, какой опасности он подвергает свою жизнь.',119,'{}',18,660,6.721,6.4,'https://image.openmoviedb.com/kinopoisk-images/1773646/618068b7-856f-4993-bf23-378eb1d2f165/orig','movie'),('2024-04-07 20:30:29.635589','2024-04-07 20:30:29.635589',12137,'Эрин Брокович',2000,'История об Эрин Брокович, одинокой женщине с тремя детьми, которую жизнь нечасто баловала светлыми днями. Для таких, как она, нет карьерных перспектив, есть только скромная работа в маленькой юридической фирме. Но для уверенной в себе красотки, не стесняющейся в выражениях, достаточно одного ничтожного шанса, чтобы кардинально изменить свою судьбу. Красота и обаяние помогли ей добиться невиданного успеха, но теперь Эрин потребуется невероятная решительность, чтобы довести дело века до суда.',126,'52000000 $',18,661,7.854,7.4,'https://image.openmoviedb.com/kinopoisk-images/1898899/d45922aa-8bbd-4944-8892-ec97af863e0e/orig','movie'),('2024-04-07 20:30:30.209216','2024-04-07 20:30:30.209216',12138,'Хребет дьявола',2001,'Пугающий рассказ о 12-летнем Карлосе, который после смерти отца попадает в школу Санта-Лусии на попечение директрисы Кармен и профессора Касареса. Отец мальчика был мятежником, убитым в сражении против режима Франко. И хотя приют перегружен большим количеством детей, директор школы сочувствующе принимает молодого Карлоса.',106,'4500000 $',18,662,7.128,7.4,'https://image.openmoviedb.com/kinopoisk-images/1629390/e185a9fc-8b2f-44f9-90a2-5640cb489190/orig','movie'),('2024-04-07 20:30:30.897595','2024-04-07 20:30:30.897595',12139,'Эксперимент',2000,'В ходе научного эксперимента 12 обыкновенных людей добровольно становятся на две недели «заключенными» тюрьмы, в то время как 8 таких же добровольцев становятся надзирателями. Задача первых - соблюдать правила тюремного режима; задача вторых - поддерживать порядок. Но человеческая природа берет свое, и эксперимент выходит из-под контроля: под бесстрастными взглядами ученых надзиратели упиваются властью, унижая заключенных, и в тюрьме назревает бунт…',120,'{}',18,663,7.71,7.7,'https://image.openmoviedb.com/kinopoisk-images/1898899/88ce3bf3-853f-4633-8124-93393724a91b/orig','movie'),('2024-04-07 20:30:31.492803','2024-04-07 20:30:31.492803',12140,'Семьянин',2000,'Судьба в облике чернокожего Санты ставит перед Джеком непростой выбор. Он может быть президентом инвестиционной компании, жить в роскошной квартире, раскатывать на последней модели «Феррари» и при этом оставаться холостяком. А может стать семьянином, но работать продавцом автопокрышек, покупать одежду в супермаркете и ездить на минивэне.',125,'60000000 $',12,664,7.824,6.8,'https://image.openmoviedb.com/kinopoisk-images/4716873/b19fcaf1-a71d-4685-9ec9-5f049a112425/orig','movie'),('2024-04-07 20:30:32.177030','2024-04-07 20:30:32.177030',12141,'Вдали от рая',2002,'1957 год. Жена преуспевающего бизнесмена, Кэти, застает своего мужа Фрэнка в недвусмысленной ситуации: супруг изменяет ей с мужчиной. Кэти тоже дает волю своим чувствам и сближается с чернокожим садовником Рэймондом. Однако население маленького провинциального города, в котором они живут, считает, что это еще хуже, чем ориентация Фрэнка.',107,'13500000 $',18,665,6.702,7.3,'https://image.openmoviedb.com/kinopoisk-images/1900788/01df4a63-424e-4483-8725-66792fff88f5/orig','movie'),('2024-04-07 20:30:32.831908','2024-04-07 20:30:32.832877',12142,'Форсаж',2001,'Его зовут Брайан, и он — фанат турбин и нитроускорителей. Он пытается попасть в автобанду легендарного Доминика Торетто, чемпиона опасных и незаконных уличных гонок. Брайан также полицейский, и его задание — втереться в доверие к Торетто, подозреваемому в причастности к дерзким грабежам грузовиков, совершаемым прямо на ходу.',106,'38000000 $',18,666,7.797,6.8,'https://image.openmoviedb.com/kinopoisk-images/6201401/8277905e-aa09-465d-b0de-7c389a42f215/orig','movie'),('2024-04-07 20:30:33.504416','2024-04-07 20:30:33.504416',12143,'Роковая женщина',2002,'Лора Эш, участвуя в похищении драгоценностей, обманывает сообщников и бежит в Париж. Там она сталкивается с похожей на неё девушкой, которая совершает самоубийство. Лора решает воспользоваться ситуацией и выдать погибшую за себя, а себя — за неё. Ей это удаётся, но спустя семь лет она возвращается в Париж под именем Лили Уоттс, уже в качестве супруги нового посла США во Франции. Однако её прежние сообщники продолжают поиски украденных драгоценностей…',114,'35000000 $',16,667,6.699,6.2,'https://image.openmoviedb.com/kinopoisk-images/1773646/3561a66f-2305-4c20-a613-4db54fa5536b/orig','movie'),('2024-04-07 20:30:34.258253','2024-04-07 20:30:34.258253',12144,'Пункт назначения',2000,'Алекс летит с классом в Париж на 10 дней. В аэропорту он узнает, что время вылета совпадает с его днем рождения. Потом, повинуясь плохому предчувствию, Алекс в панике покидает самолет, и некоторое время спустя самолет взрывается. Но вскоре пассажиры, сошедшие вместе с Алексом, начинают гибнуть один за другим.',98,'23000000 $',18,668,7.498,6.7,'https://image.openmoviedb.com/kinopoisk-images/1773646/47f8260a-2f09-4bce-9e36-04244a8e8463/orig','movie'),('2024-04-07 20:30:34.927892','2024-04-07 20:30:34.927892',12145,'Пункт назначения 2',2003,'Решив провести уикэнд с друзьями подальше от дома, Кимберли становится свидетелем жуткой автокатастрофы: на скоростной магистрали из грузовика начинают выпадать брёвна, что приводит к серии столкновений автомобилей и множеству жертв, среди которых она сама. Секунду спустя Кимберли снова чувствует биение своего сердца: она жива и по-прежнему за рулём машины. Видение? А может быть, предупреждение? Однако теперь и Кимберли, и водители, чьи машины из-за неё не смогли выехать к смерти, обречены — старуха с косой отказывается вычёркивать их из своего списка.',90,'26000000 $',18,669,7.125,6.2,'https://image.openmoviedb.com/kinopoisk-images/1629390/8d93ad26-cd08-4b7a-94a4-d9c4215b5a7b/orig','movie'),('2024-04-07 20:30:35.596568','2024-04-07 20:30:35.596568',12146,'Последняя фантазия',2001,'2065 год. На Землю напали монстры-фантомы из космоса, которым невозможно противостоять. Полупрозрачные чудовища, более похожие на галлюцинации, уже истребили большую часть человечества, и скоро их господство над планетой станет абсолютным. Судьба мира находится в руках горстки смельчаков — ученой Аки Росс, доктора Сиди и техноспецназовца капитана Эдвардса, вступающих в последнее сражение с инопланетной нечистью.',106,'137000000 $',12,670,7.575,6.4,'https://image.openmoviedb.com/kinopoisk-images/1629390/59510c66-6933-4c45-91d4-2af8f860ac80/orig','anime'),('2024-04-07 20:30:36.311702','2024-04-07 20:30:36.311702',12147,'Найти Форрестера',2000,'Писатель Уильям Форрестер долгие годы прожил в добровольном затворничестве от мира. Последний раз о нем слышали сорок лет назад, когда он выпустил в свет превосходный роман, завоевавший Пулитцеровскую премию. Но с тех пор никому не удалось переступить за порог дома этого отшельника.\n\nОднако 16-летнему парнишке по имени Джамал Уоллес удается проникнуть в жилище живой легенды и разговорить нелюдимого старца. И это случайная встреча оказывается судьбоносной. Благодаря ей ушедший в себя Форрестер снова обретает вкус к жизни за пределами своей «башни из слоновой кости». А Джамал, талантливый баскетболист, которому светит блестящая спортивная карьера, открывает, что его истинное призвание – литературное творчество…',131,'43000000 $',12,671,7.839,7.3,'https://image.openmoviedb.com/kinopoisk-images/1773646/3caa977d-44b6-4478-b237-5d105bbb84d7/orig','movie'),('2024-04-07 20:30:36.840811','2024-04-07 20:30:36.840811',12148,'О птичках',2000,'Позитивный красочный мульт, про птичек на проводе. Мелкие воробьи vs Большая птица. Но хорошо смеется тот, кто смеется последний.',3,'{}',0,672,8.219,8,'https://image.openmoviedb.com/kinopoisk-images/1898899/6661f12d-71ef-4b03-a2bd-0d4fdd2f516c/orig','cartoon'),('2024-04-07 20:30:37.221311','2024-04-07 20:30:37.221311',12149,'Четыре пера',2002,'1884 год. Перед самой отправкой британских войск в Судан молодой офицер Гарри Фэвершем подает в отставку. Его близкие и родные воспринимают этот поступок как проявление трусости, и Гарри, чтобы спасти свою честь, принимает решение тайно отправиться на африканский континент…\n\nУ Гарри было все: отец — генерал, любимая девушка, лейтенантская должность в непобедимой английской армии, верные друзья. В один день он лишился всего, с ним осталось только четыре пера позора…',125,'35000000 $',18,673,7.769,6.5,'https://image.openmoviedb.com/kinopoisk-images/1599028/9f13d84c-40cc-49ac-a3f6-77923a794b6f/orig','movie'),('2024-04-07 20:30:37.973307','2024-04-07 20:30:37.973307',12150,'Порок',2001,'Агент ФБР Уэсли Дойл возглавляет следствие по делу техасского серийного убийцы, известного как Рука Божья. Однажды ночью к Дойлу приходит молодой человек по имени Фентон Мейкс и заявляет, что хорошо знает убийцу. Это его младший брат Адам, и все его преступления – лишь небольшая часть длинной истории. Когда Фентон и Адам были ещё детьми, после смерти их матери отец стал утверждать, что ему явился ангел и велел убивать демонов - нормальных с виду людей, несущих миру зло.',96,'11000000 $',18,674,7.016,7.2,'https://image.openmoviedb.com/kinopoisk-images/6201401/80e99a68-d31b-4844-a3f7-4df882033a9e/orig','movie'),('2024-04-07 20:30:38.655682','2024-04-07 20:30:38.655682',12151,'Радиоволна',2000,'Полицейский Джон Салливэн случайно связывается по любительской радиостанции со своим покойным отцом, пожарным Фрэнком Салливэном, который умер во время тушения пожара много лет назад.',119,'31000000 $',16,675,7.824,7.4,'https://image.openmoviedb.com/kinopoisk-images/1704946/b1dc6dd9-616f-4a74-905b-7185edb92dfc/orig','movie'),('2024-04-07 20:30:39.327523','2024-04-07 20:30:39.327523',12152,'Фрида',2002,'Фриде было 20 лет, когда она вышла замуж за самого знаменитого художника Мексики Диего Риверу, немолодого, богатого и развратного. Пройдёт всего несколько лет, и она завоюет Париж, а о его скандале с Рокфеллером напишут все американские газеты.\nИх многочисленные любовные романы не помешают им покорить мир, а вот смогут ли они укротить друг друга?',118,'12000000 $',18,676,7.919,7.3,'https://image.openmoviedb.com/kinopoisk-images/1704946/4248825f-2f55-49b0-9be9-a3661e88ebf7/orig','movie'),('2024-04-07 20:30:40.049994','2024-04-07 20:30:40.049994',12153,'Из ада',2001,'Он - воплощение тьмы и ужаса. Он самый таинственный и знаменитый из всех серийных убийц, известных истории. Он погрузил Англию в атмосферу страха и породил массу слухов и домыслов. Убийца, который знает больше простого мясника или лаборанта. Убивая, он совершает чудовищный ритуал. Его прозвище - Джек-Потрошитель.\nПоймать его пытается инспектор Фред Эбберлайн. С помощью опиума он усиливает свой природный дар ясновидения и приходит к выводу, что дело Джека-Потрошителя – часть злодейского заговора, в который замешан Орден Масонов, выполняющий, в свою очередь, волю королевского дома.',122,'35000000 $',18,677,7.503,6.7,'https://image.openmoviedb.com/kinopoisk-images/1629390/7a48d15c-0380-4a55-8b9e-7c6c5cb0cc30/orig','movie'),('2024-04-07 20:30:40.789469','2024-04-07 20:30:40.790469',12154,'Банды Нью-Йорка',2002,'Нью-Йорк, 1846 год. В диких трущобах города американской мечты действует только один закон — закон силы. Здесь идет в ход любое оружие, никто не считает потерь и не оплакивает погибших. В одной из жестоких стычек от рук вожака коренных американцев, Мясника Билла, погибает предводитель банды ирландцев Вэллон.\nЕго сын Амстердам надолго попадает в исправительную школу, затаив ненависть на Мясника, ставшего хозяином окрестных кварталов. Спустя годы не узнанный никем Амстердам возвратится на родные улицы с единственной целью — отомстить убийце отца.',167,'100000000 $',18,678,7.739,7.5,'https://image.openmoviedb.com/kinopoisk-images/1629390/3baea99c-635d-48c6-9085-aebebfa35a3d/orig','movie'),('2024-04-07 20:30:41.542489','2024-04-07 20:30:41.542489',12155,'Дар',2000,'Вдова Энни Уилсон наделена редким даром ясновидения. И когда происходит таинственное убийство девушки из богатой семьи, ее талант приходится как нельзя кстати в установлении личности убийцы. Но все не так просто, как кажется. Дар опасен для своего носителя, разрушает психику героини и не дает однозначных ответов.\n\nТем временем круг подозреваемых расширяется с каждым днем, вовлекая в эпицентр событий все новых персонажей, каждый из которых может быть убийцей. И чем дальше продвигается Энни в своем расследовании, тем четче осознает, что поиск правды может сокрушить ее разум.',112,'10000000 $',18,679,6.905,6.7,'https://image.openmoviedb.com/kinopoisk-images/1599028/f2460cac-3057-42c1-b46f-8c482b65a292/orig','movie'),('2024-04-07 20:30:42.253423','2024-04-07 20:30:42.253423',12156,'Оборотень',2000,'16-летняя Джинджер и её младшая сестра Бриджит очень любят снимать на видеокамеру фильмы ужасов, безжалостно расходуя огромное количество красной краски. Однажды во время одной из ночных вылазок на Джинджер нападает какое-то чудовище. Бриджит помогает скрыть следы укусов от родителей. К удивлению сестер раны быстро затягиваются, но когда с Джинджер начинают происходить странные изменения, девочки понимают, что их проблемы только начинаются.',108,'5000000 $',16,680,7.025,6.8,'https://image.openmoviedb.com/kinopoisk-images/1704946/7dae0ec7-1749-4b7f-983b-33fbe64d5107/orig','movie'),('2024-04-07 20:30:42.924444','2024-04-07 20:30:42.924444',12157,'Женский бой',2000,'Диана - девчонка упрямая. От этого в жизни у нее одни неприятности. В тех районах Нью-Йорка, где она выросла, иначе нельзя - здесь окружающий мир жесток и бескомпромиссен, здесь действует Закон Джунглей. Здесь выживает тот, кто умеет постоять за себя. Однажды она попадает в боксерский зал и решает, что будет боксером.\n\nПлевать, что бокс - не женское дело. Побеждает упорнейший, а упорства Диане не занимать. Привкус пота и крови, схватка, победа над собой и противником вдыхают смысл в каждый день жизни. Каждый бой - последний, каждая победа - как в первый раз, и пусть проигравший плачет. Кто следующий?',110,'1000000 $',16,681,6.904,6.7,'https://image.openmoviedb.com/kinopoisk-images/1773646/a2972116-1114-4601-a093-6586ec4a22bd/orig','movie'),('2024-04-07 20:30:43.514192','2024-04-07 20:30:43.514192',12158,'Хорошая девочка',2001,'Очаровательная Джастин прозябает в маленьком городке, разочаровавшись в ленивом муже, скучной работе и своей несчастной судьбе. Но всё меняется, когда она находит родственную душу - молодого красавца Холдена, который давно работает рядом с ней.\nБурный роман преображает ее жизнь, но постепенно страсть превращается в одержимость, а любовная интрига - в опасный заговор, и Джастин понимает, что ввязалась в рискованную и непредсказуемую игру.',93,'8000000 $',18,682,6.371,6.4,'https://image.openmoviedb.com/kinopoisk-images/1629390/9ced5226-890b-4612-98fa-e027c0daea93/orig','movie'),('2024-04-07 20:30:44.159771','2024-04-07 20:30:44.159771',12159,'Госфорд-парк',2001,'В пасмурный ноябрьский день 1932 года в имении сэра Уильяма Маккордала, поместье Госфорд Парк, собираются гости: родственники и друзья, аристократы и знаменитости. Посетители сэра Уильяма намереваются провести несколько дней, наслаждаясь роскошью жилища, отдав привычную дань изысканному чревоугодию и великосветским ритуалам.\n\nВсё готово к очередному шикарному и томному празднику беспечных прожигателей жизни. Но внезапно хозяина дома находят мертвым, и, что самое неприятное, кто-то поспособствовал его преждевременной отправке на тот свет.',137,'19800000 $',18,683,6.821,7.2,'https://image.openmoviedb.com/kinopoisk-images/4303601/04e2db8a-b384-4d79-a963-aad6e731d260/orig','movie'),('2024-04-07 20:30:44.914902','2024-04-07 20:30:44.914902',12160,'На чужой вкус',2000,'Антуан, респектабельный владелец фабрики, знакомится с актрисой, которая дружит с официанткой, подругой телохранителя, работающего вместе с шофером, который возит оформительницу интерьеров, жену владельца фабрики, мечтающего дружить с артистами, чтобы вырваться из замкнутой, удушающей среды высшего общества и понять, как он на самом деле одинок. \r\n\r\nВнезапно оказавшись среди людей иного склада ума и иных вкусов, он чувствует, что никогда не поймет их, если не сбросит оковы той жизни, которую он вынужден вести уже много лет. Он чувствует, что он не одинок в своем стремлении, но не догадывается, как грядущие перемены усложнят его внутренний мир и всё, что его окружает.',108,'{}',12,684,6.649,7.2,'https://image.openmoviedb.com/kinopoisk-images/1599028/8afa0b4e-1b98-46b7-9975-ad0bd03906e4/orig','movie'),('2024-04-07 20:30:45.562570','2024-04-07 20:30:45.562570',12161,'Гамлет',2000,'Действие этого фильма, снятого по мотивам бессмертной драмы Шекспира, разворачивается в современном Нью-Йорке. Гамлет предстает в роли режиссера, которому после смерти отца с трудом удается справиться с управлением компанией «Датская корпорация». После трансцендентного опыта общения с призраком своего отца, он погружается в пучину сомнений, нерешительности и страданий...',112,'2000000 $',18,685,6.578,5.9,'https://image.openmoviedb.com/kinopoisk-images/1900788/16297736-28ba-4150-b651-619a493d48d9/orig','movie'),('2024-04-07 20:30:46.202441','2024-04-07 20:30:46.202441',12162,'Ганнибал',2001,'После десяти лет молчания Ганнибал Лектер пишет письмо агенту ФБР Клариссе Старлинг, предлагая ей возобновить их прервавшуюся интеллектуальную дуэль. С помощью миллионера Мейсона Верджера, ставшего очередной жертвой безумного доктора и мечтающего теперь скормить Лектера стае прожорливых кабанов, Кларисса выходит на след неуловимого маньяка и вскоре узнаёт, что за ним уже охотится инспектор флорентийской полиции Ринальдо Пацци.',131,'87000000 $',18,686,7.759,6.8,'https://image.openmoviedb.com/kinopoisk-images/1773646/c0ed19c8-8fa3-48dd-87bf-ec8ba0cce029/orig','movie'),('2024-04-07 20:30:46.897263','2024-04-07 20:30:46.897263',12163,'Хардбол',2001,'Чтобы расплатиться с долгами, мелкий спекулянт, картежник и выпивоха вынужден тренировать бейсбольную команду - самую худшую, какую только можно найти в Чикаго. Связанные с этим драматические и комедийные перипетии неожиданно изменяют к лучшему и его собственную жизнь.',106,'32000000 $',12,687,7.116,6.4,'https://image.openmoviedb.com/kinopoisk-images/1599028/794bee64-4df8-4c85-89bc-c4fe686e0903/orig','movie'),('2024-04-07 20:30:47.580645','2024-04-07 20:30:47.580645',12164,'Гарри Поттер и Тайная комната',2002,'Гарри Поттер переходит на второй курс Школы чародейства и волшебства Хогвартс. Эльф Добби предупреждает Гарри об опасности, которая поджидает его там, и просит больше не возвращаться в школу.\nЮный волшебник не следует совету эльфа и становится свидетелем таинственных событий, разворачивающихся в Хогвартсе. Вскоре Гарри и его друзья узнают о существовании Тайной Комнаты и сталкиваются с новыми приключениями, пытаясь победить темные силы.',161,'100000000 $',12,688,8.133,7.4,'https://image.openmoviedb.com/kinopoisk-images/4774061/1ef65bfb-b16b-42aa-a54a-758395253290/orig','movie'),('2024-04-07 20:30:48.216964','2024-04-07 20:30:48.216964',12165,'Гарри Поттер и философский камень',2001,'Жизнь десятилетнего Гарри Поттера нельзя назвать сладкой: родители умерли, едва ему исполнился год, а от дяди и тёти, взявших сироту на воспитание, достаются лишь тычки да подзатыльники. Но в одиннадцатый день рождения Гарри всё меняется. Странный гость, неожиданно появившийся на пороге, приносит письмо, из которого мальчик узнаёт, что на самом деле он - волшебник и зачислен в школу магии под названием Хогвартс. А уже через пару недель Гарри будет мчаться в поезде Хогвартс-экспресс навстречу новой жизни, где его ждут невероятные приключения, верные друзья и самое главное — ключ к разгадке тайны смерти его родителей.',152,'125000000 $',12,689,8.275,7.6,'https://image.openmoviedb.com/kinopoisk-images/1898899/27ed5c19-a045-49dd-8624-5f629c5d96e0/orig','movie'),('2024-04-07 20:30:48.850274','2024-04-07 20:30:48.850274',12166,'Гарри — друг, который желает Вам добра',2000,'У вас есть настоящие, преданные друзья? Если да, задавались ли вы вопросом, на что они смогут пойти ради вас? И как далеко они готовы зайти тогда, когда от них потребуется помощь? Если вы дружите с Гарри, то вам нечего бояться!\n\nГарри — идеальный друг во всех отношениях. Он чрезвычайно обаятелен и чрезвычайно богат. Гарри — человек обстоятельный и надежный. Но самое главное то, что он никогда, ни при каких обстоятельствах не допустит, чтобы вам в жизни что-то мешало. Ваши проблемы-его проблемы.\n\nУ вас плохая машина? Гарри купит вам новую. У вас возникли трудности? Он устранит их с легкостью иллюзиониста! Правда, если вы вдруг недосчитаетесь недоброжелателей, своих назойливых родителей или занудных родственников, то это не страшно, ибо Гарри желает вам лишь добра.\n\nБлагодаря Гарри ваша жизнь станет гораздо лучше.., если вам удастся ее сохранить.',117,'{}',16,690,6.88,7.1,'https://image.openmoviedb.com/kinopoisk-images/1599028/8ac41483-feb7-46f6-952c-9334dae92c1c/orig','movie'),('2024-04-07 20:30:49.527965','2024-04-07 20:30:49.527965',12167,'Война Харта',2002,'Лейтенант Томми Харт - студент-юрист второго года обучения. Во время Второй мировой войны он становится помощником офицера, попадает в плен и оказывается в немецком лагере для военнопленных. Там он знакомится с другим военнопленным - полковником Уильямом МакНамара.',125,'70000000 $',16,691,6.411,6.3,'https://image.openmoviedb.com/kinopoisk-images/1773646/735d9f8c-683f-4cea-92ee-7bb088cde1bf/orig','movie'),('2024-04-07 20:30:50.102595','2024-04-07 20:30:50.102595',12168,'Сердцеедки',2001,'Очаровательная интриганка Макс Коннерс и ее прилежная ученица (она же - дочь) Пейдж – отличная команда. Некоторые матери учат своих дочерей музыке, танцам и этикету, а Макс передала Пейдж все, что узнала сама за многие годы об авантюрах, мошенничестве и обольщении. Отсутствие капитала, по их мнению, - лишь временное явление, легко поправимое при помощи мужчин.\nНичего неподозревающие обеспеченные жертвы быстро попадаются в коварные сети прекрасных обманщиц. Результат – легкая и беззаботная жизнь на деньги очередного одураченного простофили, лишившегося значительной части своих средств.\nИ все было бы хорошо, но однажды Пейдж совершила роковую ошибку влюбившись на самом деле. Ведь женское сердце не спрашивая свою хозяйку, всегда ищет настоящую любовь. Много лет назад такую же ошибку совершила и Макс.',123,'35000000 $',18,692,7.23,6.2,'https://image.openmoviedb.com/kinopoisk-images/6201401/a10c0aca-1aa9-49da-9919-0d7483247062/orig','movie'),('2024-04-07 20:30:50.720058','2024-04-07 20:30:50.720058',12169,'Сердца в Атлантиде',2001,'Фильм рассказывает нам историю Бобби Гарфилда, 11-летнего мальчика, который познаёт жизнь в Коннектикуте шестидесятых. Бобби дружит с Тэдом Брутиганом, мужчиной, который снимает комнату в его доме. Их дружба через некоторое время перерастает в отношения отца и сына. Несмотря на это, Тэд скоро начинает понимать, что он наделён особым психическим даром…',101,'31000000 $',18,693,7.573,6.9,'https://image.openmoviedb.com/kinopoisk-images/4774061/58fceb6a-3f78-4ffd-aef3-04c6d6ed209f/orig','movie'),('2024-04-07 20:30:51.273796','2024-04-07 20:30:51.273796',12170,'Рай',2001,'У Филиппы погибает муж, но полиция, похоже, не собирается искать виновных. Женщина решает взять правосудие в свои руки, но в результате погибают невинные люди, а она сама оказывается в тюрьме. Но, как оказалось, это не конец жизни, а начало новых отношений, дальнейшего движения к своей цели.',97,'11000000 $',18,694,7.065,6.9,'https://image.openmoviedb.com/kinopoisk-images/6201401/13b8396d-6e11-4cdd-9e92-cc5b7ac383e9/orig','movie'),('2024-04-07 20:30:52.104606','2024-04-07 20:30:52.104606',12171,'Хедвиг и The Angry Inch',2001,'История амбициозного рок-певца Хедвига, который приехал в Америку, чтобы добиться славы и богатства.',95,'6000000 $',16,695,7.184,7.7,'https://image.openmoviedb.com/kinopoisk-images/1898899/b4012238-ae9d-45f9-848d-f389ae0a626e/orig','movie'),('2024-04-07 20:30:52.773947','2024-04-07 20:30:52.773947',12172,'Грабеж',2001,'У Джо Мура есть все - красивая молодая жена, деньги и любимая работа. Он - вор. Его работа накрывается медным тазом, когда его застукивают при помощи охранной камеры. Его соперник Бергман шантажирует его, требуя простить долг, а жена уходит к новичку - другу Бергмана. Мур, его партнёр Бобби Блан и их связной Пинки Пинкус вынуждены собрать команду, которая сделает ограбление по заказу Бергмана, и которое станет последним в карьере Мура.',109,'39000000 $',16,696,6.635,6.5,'https://image.openmoviedb.com/kinopoisk-images/1900788/ab740e3e-af08-43b5-864c-be8e9cfe4e8e/orig','movie'),('2024-04-07 20:30:53.489127','2024-04-07 20:30:53.489127',12173,'Особо тяжкие преступления',2002,'Преуспевающая в своей деятельности адвокат и счастливая супруга потрясена известием о том, что её муж является секретным военным агентом, работающим под прикрытием. Более того, он ещё и обвинён в совершении государственного военного преступления. Поскольку она готовится защищать своего мужа в военном суде, где не всегда действуют правила, которые она превосходно знает, то ей приходит на помощь военный поверенный, который играет по своим правилам.',115,'42000000 $',18,697,7.089,6.4,'https://image.openmoviedb.com/kinopoisk-images/1600647/ef12ad4f-77fc-4e6b-9a49-9322df0739ed/orig','movie'),('2024-04-07 20:30:54.154098','2024-04-07 20:30:54.154098',12174,'Фанатик',2000,'Роб - истинный фанатик своего дела, но к сожалению, этим любимым делом оказывается не шпионская деятельность или полет в космос, а обычная продажа пластинок. Так же как эти пережитки прошлого, его будни спокойно идут по кругу.\n\nНо однажды игла его судьбы с визгом соскакивает: любимая девушка Роба ушла к другому! Теперь одержимому меломану придется прокрутить свою жизнь назад, чтобы найти фальшивую ноту, ведь где-то он должен был совершить ошибку.',113,'30000000 $',18,698,6.856,7.4,'https://image.openmoviedb.com/kinopoisk-images/1600647/4cf9ce59-1dc5-442f-80eb-7b3daa339bca/orig','movie'),('2024-04-07 20:30:54.873768','2024-04-07 20:30:54.873768',12175,'Сын невесты',2001,'Рафаэлю 42. Он живет в тени своего отца, переживает кризис среднего возраста, страдает от чувства вины при встречах с больной матерью, бывшая жена третирует его, он редко видит дочь и не хочет доверять своей новой девушке. И вот, одним печальным серым днем, Рафаэля сваливает с ног сердечный приступ. Тогда-то в его жизни и появляется Хуан - друг из прошлого, способный изменить его будущее.',123,'{}',100,699,6.887,7.8,'https://image.openmoviedb.com/kinopoisk-images/1599028/9e9743a1-bd4b-4088-9cdc-87decdca41d2/orig','movie'),('2024-04-07 20:30:55.508795','2024-04-07 20:30:55.508795',12176,'Яма',2001,'Четверо студентов престижной английской школы решили устроить особенную вечеринку и выбрали для этого бункер времен войны. Бросив вызов родителям, школе, обыденной жизни и самим себе, они спускаются в зловещие катакомбы, чтобы подвергнуть свой разум, свои чувства шокирующим приключениям.',102,'4158370 £',18,700,7.016,6.2,'https://image.openmoviedb.com/kinopoisk-images/1629390/2257c0cd-662b-46bc-a198-2716f5db2d5c/orig','movie'),('2024-04-07 20:30:56.221925','2024-04-07 20:30:56.221925',12177,'Голливудский финал',2002,'Для съемок нового суперхита боссы крупной киностудии нанимают капризного и непредсказуемого Вэла Ваксмана. Это подарок судьбы для всеми забытого обладателя двух «Оскаров», докатившегося до съемок рекламы. Вэл не хочет упустить шанс напомнить Голливуду о себе. Но вскоре из-за перенапряжения его поражает редкий недуг - истерическая слепота.\n\nТеперь несчастному гению придется во всем положиться на помощь верных друзей. Чтобы любой ценой убедить работодателей, что его зрение так же остро. Как и его оригинальное творческое видение. Никто не знает, что ждет Вэла - фурор или провал, ведь еще никто не ставил столь рискованный эксперимент, снимая фильм вслепую!',112,'16000000 $',18,701,6.939,6.5,'https://image.openmoviedb.com/kinopoisk-images/6201401/70b7d1cb-9278-471e-8088-44676493309b/orig','movie'),('2024-04-07 20:30:56.809831','2024-04-07 20:30:56.809831',12178,'Часы',2002,'Писательница Вирджиния Вулф работает над романом «Миссис Дэллоуэй», и её терзают мысли о самоубийстве. Лара Браун, молодая жена и мать, задыхается в рамках своей опрятной жизни в Лос-Анджелесе 1951 года. А Кларисса Вон устраивает вечеринку в Нью-Йорке начала 2000-х годов для близкого друга Ричарда, умирающего от СПИДа.',110,'25000000 $',18,702,7.572,7.5,'https://image.openmoviedb.com/kinopoisk-images/4774061/52defc6f-95ee-4a2d-a203-ddcddb772504/orig','movie'),('2024-04-07 20:30:57.554213','2024-04-07 20:30:57.554213',12179,'Обитель радости',2000,'Нью-Йорк, начало 20-го века. Лили Барт, привлекательная девушка, занимающая видное место в обществе, сталкивается с обратной стороной успеха - ее красота и очарование вызывают нездоровый интерес и зависть. Пока Лили подыскивает себе богатого мужа, чтобы соответствовать ожиданиям общества, она упускает настоящую любовь.',135,'10000000 $',100,703,7.168,7,'https://image.openmoviedb.com/kinopoisk-images/1599028/5568094d-a5cd-47fd-8df7-db7764537442/orig','movie'),('2024-04-07 20:30:58.267653','2024-04-07 20:30:58.267653',12180,'Как отделаться от парня за 10 дней',2003,'Журналистка Энди Андерсон решает написать статью на тему: «Типичные ошибки, которыми женщины отталкивают от себя мужчин». Она планирует найти парня, завязать знакомство, а потом своим поведением добиться, чтобы тот её бросил. Редактор даёт ей на это 10 дней. На беду Энди ее выбор пал на молодого рекламного агента Бенджамина Бэрри, который сам как раз заключил со своим боссом пари, что он сможет влюбить в себя девушку за 10 дней. Может ли такое странное знакомство, основанное на авантюре и замешанное на лжи, привести к взаимности?',116,'50000000 $',12,704,7.327,6.5,'https://image.openmoviedb.com/kinopoisk-images/1629390/72d1e441-c008-476c-9f56-0b1e99e12845/orig','movie'),('2024-04-07 20:30:58.894319','2024-04-07 20:30:58.894319',12181,'Звериная натура',2001,'Лила страдает врожденным дефектом - у нее повышенная волосатость тела. Повышенная настолько, что даже в медицинской энциклопедии рядом с описанием этого феномена помещена ее фотография. Пытаясь найти себя, Лила долгое время жила в лесу и даже написала несколько книг о природе и месте человека в ней, но в жизни всегда настает момент, когда самке больше всего нужна пара.\n\nИ пару Лила находит в профессоре Натане Бронфмане - педантичном зануде, изучающим проблему обучения мышей хорошим манерам. Но однажды на лесной прогулке они натыкаются на дикаря, воспитанного человеком, считавшим себя обезьяной. Натан видит в этом возможность проиллюстрировать свою теорию обучения существ, но самого Паффа, как он окрестил находку, никто не спросил, надо ли ему учиться.',96,'{}',16,705,6.595,6.4,'https://image.openmoviedb.com/kinopoisk-images/1704946/37be1124-cb12-456f-a53b-c0f0a86c2af4/orig','movie'),('2024-04-07 20:30:59.517468','2024-04-07 20:30:59.517468',12182,'Я — Сэм',2001,'Сэм Доусон, 40-летний мужчина с уровнем интеллекта 7-летнего ребёнка, работающий официантом. Ему трудно было бы выжить с такими данными, если бы не дочь, плод случайной связи. Люси выросла вполне нормальным человеком и могла бы заботиться о своём отце, но местная социальная служба забрала её у отца. Сэм хочет вернуть свою дочь. Для ведения этого дела он нанимает адвоката Риту Харрисон. По мере работы над этим делом Рита сама получает несколько уроков о том, что значит быть родителем...',132,'22000000 $',18,706,7.998,7.6,'https://image.openmoviedb.com/kinopoisk-images/1704946/f1a720a0-6a2f-4487-a294-71b44f233b88/orig','movie'),('2024-04-07 20:31:00.073274','2024-04-07 20:31:00.073274',12183,'Ледниковый период',2002,'Действие разворачивается 20 тыс. лет назад. Чтобы избежать приближающегося из-за наступления ледникового периода холода, животные мигрируют на юг. Однако некоторые из них всё-таки решают остаться - одинокий, угрюмый мамонт Манфред, а также бесшабашный ленивец Сид.\n\nСлучайно эта парочка наталкивается на человеческого детёныша. Они решаются вернуть его людям и отправляются в путешествие. По пути они встречают саблезубого хитрого тигра. И теперь этой веселой компании предстоят забавные приключения!',81,'59000000 $',0,707,8.038,7.5,'https://image.openmoviedb.com/kinopoisk-images/1704946/42fd2959-0e98-4ce2-b24e-06392b4cb502/orig','cartoon'),('2024-04-07 20:31:00.904684','2024-04-07 20:31:00.904684',12184,'Идентификация',2003,'Бушует сильный ливень. В поисках укрытия десять путешественников вынуждены остановиться на ночь в старом мотеле. Однако вскоре они с ужасом обнаруживают, что это место становится не спасительным укрытием, а смертельной ловушкой. Люди гибнут один за другим, а убийца по-прежнему не вычислен.',90,'28000000 $',18,708,7.579,7.3,'https://image.openmoviedb.com/kinopoisk-images/1773646/0dc887f2-0ff5-4fa8-b795-e7ff0af6f013/orig','movie'),('2024-04-07 20:31:01.470848','2024-04-07 20:31:01.470848',12185,'Игби идет ко дну',2002,'Молодого парня достала его «веселая» семейка: жестокая мать, высокомерный брат и отец-шизик. Своими вечными переездами они не дают ему прижиться ни в одной школе, пока наконец не прибывают в Нью-Йорк, где парнишка знакомится с такой же замученной жизнью девчонкой, в которую в скором времени влюбляется. Как тут всему не перевернуться с ног на голову?',98,'9000000 $',16,709,6.753,6.8,'https://image.openmoviedb.com/kinopoisk-images/1629390/a2d5a0f6-f8f0-47be-86fa-dfe3d501367e/orig','movie'),('2024-04-07 20:31:02.162668','2024-04-07 20:31:02.162668',12186,'Как важно быть серьезным',2002,'Что произойдет, если два блистательных британских джентльмена от скуки затеют рискованную и непредсказуемую игру в псевдонимы? Как, например, неотразимый Джек, заботливый опекун юной Сесили, приезжающий в Лондон, чтобы под именем Эрнест сделать предложение аристократке Гвендолин, и неутомимый ловкач Олги, предлагающий руку и сердце провинциалке Сесили также под именем Эрнест.\nПодобные забавы не проходят безнаказанно - скоро Гвендолин и Сесили узнают, что к ним сватается один и тот же мужчина! Назревает жуткий скандал, и теперь влюбленным ловеласам придется понять, как всё-таки важно хоть иногда быть серьезным...',97,'15000000 $',12,710,7.434,6.8,'https://image.openmoviedb.com/kinopoisk-images/1777765/dd71ae0e-965a-41f9-baeb-114f15a7f0f1/orig','movie'),('2024-04-07 20:31:02.864574','2024-04-07 20:31:02.864574',12187,'В спальне',2001,'Студент приезжает на каникулы домой и влюбляется в женщину, которая намного старше его. Однако то, что начинается, как обычный летний роман, вскоре перерастает в трагедию.',131,'1700000 $',16,711,6.789,7.4,'https://image.openmoviedb.com/kinopoisk-images/1773646/bcc0a32d-ccb7-41fa-869b-a937ac5ac900/orig','movie'),('2024-04-07 20:31:03.456541','2024-04-07 20:31:03.456541',12188,'Бессонница',2002,'Опытный детектив полиции Лос-Анджелеса Уилл Дормер вместе со своим напарником направлен в маленький городок на Аляске, чтобы расследовать убийство семнадцатилетней девушки. \n\nНапарник Дормера погибает во время одного из полицейских дежурств на пустынном скалистом берегу. Тем временем расследование продвигается, и у полицейских появляется подозреваемый. Это Уолтер Финч — человек романтического склада характера, ведущий уединенный образ жизни. \n\nСмерть напарника лишает детектива сна. Все больше запутываясь в сетях махинаций Финча, Дормер рискует потерять не только сон этими белыми летними ночами.',118,'46000000 $',16,712,7.378,7.2,'https://image.openmoviedb.com/kinopoisk-images/1704946/fee0c93b-5015-4a3e-8a05-12741637db2f/orig','movie'),('2024-04-07 20:31:04.139541','2024-04-07 20:31:04.139541',12189,'Интим',2000,'Она приходит к нему каждую неделю по средам только ради секса. Они занимаются этим, почти не разговаривая. Но однажды она не является к нему в условленный час, и он осознаёт, что вообще ничего не знает о своей безмолвной партнёрше. И когда через неделю она всё-таки появляется, он начинает следить за ней.',119,'{}',18,713,5.938,6,'https://image.openmoviedb.com/kinopoisk-images/1898899/4059887a-ae91-40a5-a615-94c5e73c3f95/orig','movie'),('2024-04-07 20:31:04.823700','2024-04-07 20:31:04.823700',12190,'Айрис',2001,'Одна из величайших писательниц XX века, остроумный мыслитель и проницательный философ Айрис Мёрдок оставила яркий след в современной литературе и заслужила восторженные отклики маститых литераторов и рядовых читателей.\n\nОднако самую правдивую летопись творчества и бытия Айрис Мёрдок составил ее муж, профессор Джон Бэйли, описав в своих книгах более 40 лет их супружеской жизни, начиная со знакомства с юной оксфордской преподавательницей Айрис и заканчивая мучительной борьбой кавалерственной дамы Айрис с жестокой болезнью Альцгеймера, лишившей одаренную романистку возможности творить и жить.',91,'5500000 $',18,714,6.976,7,'https://image.openmoviedb.com/kinopoisk-images/4303601/49e9e743-6570-4448-9c4e-13ca8c2a0864/orig','movie'),('2024-04-07 20:31:05.488796','2024-04-07 20:31:05.488796',12191,'Необратимость',2002,'Темнота ночи, багровые отблески на стенах притона, бледные, как простыня, лица. Герой мечется в лабиринте лестниц и переходов одного из подпольных гей-клубов. Цель — найти и убить человека, которого он никогда даже не видел в глаза. Но у него есть веская причина ненавидеть: незнакомец до смерти изнасиловал его подругу, с которой случайно столкнулся в безлюдном городском переходе.',99,'{}',18,715,7.121,7.3,'https://image.openmoviedb.com/kinopoisk-images/1900788/6858add3-2f7e-433e-9520-6d2bf7268bfe/orig','movie'),('2024-04-07 20:31:06.217105','2024-04-07 20:31:06.217105',12192,'Итальянский для начинающих',2000,'Главные герои — обычные люди, живущие в маленьком провинциальном датском городке: трое мужчин и три женщины, каждый со своими проблемами. Все они посещают курсы итальянского языка при местном муниципалитете — формально каждый по своей причине, фактически же эти курсы становится тем единственным, что даёт им возможность жить дальше. Но внезапно умирает их преподаватель, и курсы хотят закрыть...',112,'1000000 $',18,716,7.14,7,'https://image.openmoviedb.com/kinopoisk-images/1900788/e770d125-edb1-4a96-bc1a-64f9242ef003/orig','movie'),('2024-04-07 20:31:06.934098','2024-04-07 20:31:06.934098',12193,'Чудаки',2002,'Наши герои начисто лишены стыда и инстинкта самосохранения, совсем не обращают внимания на боль и с удовольствием будут мучить себя и других!',85,'5000000 $',18,717,7.202,6.6,'https://image.openmoviedb.com/kinopoisk-images/1629390/adf28c41-8328-4ee2-a4db-09a1cf01d44c/orig','movie'),('2024-04-07 20:31:07.581083','2024-04-07 20:31:07.581083',12194,'Давай! Давай!',2000,'Швед Менс и ливанец Роро - клёвые парни, друзья не разлей вода. Чистят пруды, убирают мусор в городском парке, а в свободное время решают личные проблемы. У красавца-шведа сложности с потенцией. Он отважно сражается с собой, до зубов вооружившись ассортиментом секс-шопов.\n\nРоро попал в силки традиций - он с рождения помолвлен с девушкой Ясмин, но по уши влюблен в другую. Его шведская возлюбленная ждет-не дождется, когда он представит её своей бесчисленной родне. Но тогда Ясмин отправят на родину, в Ливан, а жизнь там гораздо скучнее, чем в старушке-Швеции. Как честный человек, Роро обязан жениться. Осталось решить, на ком! И кто поможет Менсу?',88,'{}',16,718,6.162,6.8,'https://image.openmoviedb.com/kinopoisk-images/1898899/389aa2e0-273b-4c2a-b92a-077d0594cf5a/orig','movie'),('2024-04-07 20:31:08.227590','2024-04-07 20:31:08.227590',12195,'Джей и Молчаливый Боб наносят ответный удар',2001,'Приятели Джей и Молчаливый Боб целыми днями стоят возле стены магазина в Нью-Джерси, пока однажды не узнают, что о них сделали комикс «Пыхарь и Хроник». Комикс будут экранизировать, но выплачивать друзьям гонорар никто не собирается. Неугомонная парочка отправляется на студию Miramax, чтобы восстановить справедливость.',104,'22000000 $',18,719,7.169,6.8,'https://image.openmoviedb.com/kinopoisk-images/1704946/71645bde-8f63-4796-b684-0e9dfd1b5cef/orig','movie'),('2024-04-07 20:31:08.770200','2024-04-07 20:31:08.770200',12196,'Джон Кью',2002,'Джон Кью - рядовой американец, вкалывающий на фабрике и любящий свою семью. Смыслом его жизни является жена Дэниз и сын Майкл. Когда Майкл попадает в больницу с серьезным заболеванием и ему для спасения требуется операция по пересадке сердца, на которую у семьи нет денег, Джон решает сделать все от него зависящее, чтобы спасти мальчику жизнь. Он решает взять в заложники работников больницы с требованием прооперировать сына.',116,'36000000 $',18,720,7.753,7.1,'https://image.openmoviedb.com/kinopoisk-images/1946459/144221e6-4407-481d-95fe-9518e72f4046/orig','movie'),('2024-04-07 20:31:09.386921','2024-04-07 20:31:09.386921',12197,'Ничего себе поездочка',2001,'Парень по имени Фулер уговаривает младшего брата установить в машине старую рацию. Для него это лишь интересная антикварная диковинка, с помощью которой можно позволить себе небольшой розыгрыш, но теперь ребятам придётся своей кровью расплачиваться за невинную, казалось бы, шалость.',97,'23000000 $',18,721,6.932,6.6,'https://image.openmoviedb.com/kinopoisk-images/1773646/e01f31a5-dbb7-474b-9bea-a992e0e92647/orig','movie'),('2024-04-07 20:31:10.005405','2024-04-07 20:31:10.005405',12198,'К-19',2002,'Фильм основан на реальных событиях, произошедших с первой атомной советской подводной лодкой, которая потерпела аварию из-за неполадок в атомном реакторе в 1961 году. К-19 - это зримое свидетельство героизма русских моряков, которые служили на этой подводной лодке.\n\nФильм демонстрирует героизм капитана Алексея Вострикова, который в разгар холодной войны берет на себя командование атомной подводной лодкой К-19 вместо ее первого капитана Михаила Поленина. Миссия Вострикова - быстро подготовить подлодку к погружению, чего бы это ни стоило.\n\nНо Востриков, Поленин и члены экипажа К-19 не могли себе вообразить всего, что от них ожидалось. Они не могли представить, какой ценой обойдется для них стремительность подготовки субмарины к погружению...',138,'100000000 $',12,722,7.544,6.7,'https://image.openmoviedb.com/kinopoisk-images/1629390/9a4141a6-0524-4adb-8642-a7ea1e3159f0/orig','movie'),('2024-04-07 20:31:10.792764','2024-04-07 20:31:10.792764',12199,'Планета Ка-Пэкс',2001,'В Манхэттенский психиатрический институт привозят странного человека в черных очках. Он зовет себя Протом и утверждает, что его родина - далекая планета Ка-Пэкс, откуда он мгновенно перенесся на Землю в луче света. Несмотря на все усилия, опытному доктору Пауэллу не удается разгадать загадку таинственного пациента, который охотно и весьма убедительно доказывает всем свое внеземное происхождение и заранее назначает дату своего возвращения на Ка-Пэкс. \r\n\r\nВскоре Марка Пауэлла, так и не сумевшего приоткрыть тайну личности своего самого удивительного подопечного, начинает тревожить невероятная, но навязчивая мысль: может быть, Прот вовсе не сумасшедший и в его словах есть доля правды...',120,'68000000 $',12,723,8.026,7.4,'https://image.openmoviedb.com/kinopoisk-images/10893610/711a1449-e6bb-467c-b01b-1846c9f87476/orig','movie'),('2024-04-07 20:31:11.466305','2024-04-07 20:31:11.466305',12200,'Кейт и Лео',2001,'Сквозь прореху во времени Лео, герцог Олбанский, попадает в будущее, а точнее - в современный Нью-Йорк. Обаятельный джентльмен XIX столетия неожиданно оказывается в стремительном мире, где успешно завоевывает высоты деловая женщина - Кейт Маккей.\nНевероятное случилось - они встретились! Теперь Лео нельзя оставлять без присмотра ни на минуту. Во всяком случае, до тех пор, пока он не сможет вернуться обратно…',113,'48000000 $',12,724,7.63,6.4,'https://image.openmoviedb.com/kinopoisk-images/1704946/245177a8-7500-41fe-aebb-c1eef3575974/orig','movie'),('2024-04-07 20:31:12.110408','2024-04-07 20:31:12.110408',12201,'Сохраняя веру',2000,'Брайан, Джейкоб и Анна дружили с детства. Брайан стал католическим священником, Джейкоб - раввином, а Анна - деловой женщиной. Джейкобу как раввину необходимо жениться на еврейке. Когда он через несколько лет встретился с Анной, вспыхнула любовь. Брайан тем временем тоже влюбился в Анну. Но Брайан и Джейк служат Богу, и у обоих нет никакой надежды: вероисповедание не позволяет ни одному из них быть вместе с прекрасной Анной. Однако какой бы крепкой ни была вера, ей очень трудно устоять перед искушением...',128,'29000000 $',16,725,6.961,6.4,'https://image.openmoviedb.com/kinopoisk-images/1773646/0823bb99-48f3-463b-ad58-48eb9f8407b6/orig','movie'),('2024-04-07 20:31:12.693336','2024-04-07 20:31:12.693336',12202,'Малыш',2000,'Время движется из прошлого в настоящее и не делает скачков, но иногда этот  совершенный механизм дает сбой. Жертвой такой таинственной  случайности стал сорокалетний Расс, которому выпала участь встретиться…с самим собой из прошлого. Взрослый и ребенок – две стороны одного человека – пытаются кардинально изменить общую судьбу.',104,'65000000 $',12,726,7.172,6.1,'https://image.openmoviedb.com/kinopoisk-images/4774061/0fe7efed-9fbf-42d7-ab17-9760609be4bf/orig','movie'),('2024-04-07 20:31:13.310740','2024-04-07 20:31:13.310740',12203,'Поцелуй дракона',2001,'Офицер китайской разведки приезжает из Гонконга в Париж, чтобы участвовать в опасной операции, цель которой - заманить в ловушку и взять с поличным крупного наркобарона. Но дела идут совершенно непредсказуемо.\n\nГерой попадает в двойную ловушку и становится подозреваемым в убийстве c неопровержимыми уликами против него. Его жизнь теперь зависит от того, сумеет ли он уйти от преследования и доказать свою невиновность.',98,'25000000 $',18,727,7.665,6.6,'https://image.openmoviedb.com/kinopoisk-images/1704946/a7f940f7-b137-4196-a4d2-75ca1c89197f/orig','movie'),('2024-04-07 20:31:13.992440','2024-04-07 20:31:13.992440',12204,'Целуя Джессику Стейн',2001,'Уставшая от романов с неподходящими парнями, Джессика решается ответить на объявление, написанное в газету женщиной. Сначала она лишь хотела найти новую подругу, но вскоре их отношения перешли на другой уровень, и Джессика открыла в себе чувства, о которых даже не подозревала…',97,'1000000 $',18,728,6.01,6.6,'https://image.openmoviedb.com/kinopoisk-images/1704946/f8d8b4c1-cfbf-40db-a55e-6ace103b2ac5/orig','movie'),('2024-04-07 20:31:14.634975','2024-04-07 20:31:14.634975',12205,'История рыцаря',2001,'Он не подчинялся ни одному правилу, ибо был создан для того, чтобы их нарушать. После гибели своего господина слуга Уильям решается на отчаянную авантюру. Юноше удается изменить свою родословную и, присвоив себе доспехи и оружие ушедшего хозяина, предстать перед публикой молодым и родовитым рыцарем Ульрихом фон Лихтенштейном.\n\nТеперь в новом качестве ему предстоит доказывать свое благородное происхождение на рыцарских турнирах копьем и мечом. Отвага и решимость сэра Уильяма закалилась в бесчисленных схватках. Но в качестве последнего испытания пылкому сердцу великого самозванца послана страстная любовь, которой под силу выбить из седла самого неустрашимого воина...',132,'65000000 $',12,729,7.819,7,'https://image.openmoviedb.com/kinopoisk-images/1946459/92fc3675-abe9-4dc2-85e1-86fb7bc8d5cd/orig','movie'),('2024-04-07 20:31:15.258660','2024-04-07 20:31:15.258660',12206,'Принцесса и воин',2000,'Сисси - принцесса - работает медсестрой в психиатрической лечебнице. Бодо - воин - бывший военный, подрабатывающий где придется. Их свел случай, он украл что-то из супермаркета и, убегая от охранников, уцепился за проезжающий грузовик. Водитель отвлекся и сбил Сисси.\n\nОна лежала под грузовиком и задыхалась не в силах пошевелиться. Он появился из толпы зевак, чтобы снова вдохнуть ей жизнь и исчез так же внезапно. Сисси поняла, их встреча не случайна, и теперь она ищет своего спасителя, чтобы разобраться, какова же его роль в ее судьбе.',135,'{}',16,730,7.458,7.4,'https://image.openmoviedb.com/kinopoisk-images/1629390/fbdc9d5b-a500-4e75-ad67-58c498441333/orig','movie'),('2024-04-07 20:31:15.891962','2024-04-07 20:31:15.891962',12207,'Ложь',2001,'Пятнадцатилетний Хоуи в течение недели лишается всего и вся, но находит в себе силы продолжать жить. У него недавно умерла мать. Отец, коррумпированный строительный подрядчик, развлекается с молодой подругой, забыв о собственном сыне, который предоставлен самому себе. \n\nОказавшись в дурной компании, Хоуи начинает грабить владения состоятельных граждан, расположенные вдоль шоссе на Лонг Айленд. Вместе с лучшим другом Гэри они обчистили дом уважаемого в городе пожилого ветерана вьетнамской войны по имени Большой Джон. Опытный вояка вскоре добрался до Хоуи, которому пришлось отвечать за двоих, поскольку его друг, как оказалось, вёл двойную жизнь, и, обманув приятеля, сумел скрыться.\n\nЗнакомство мальчика с Большим Джоном таит много неожиданностей, поскольку вскоре выясняется, что этот человек не тот, за кого его принимают.',97,'700000 $',18,731,6.567,7.1,'https://image.openmoviedb.com/kinopoisk-images/1704946/ed0c84c8-5d30-4105-927f-4450bc962c7a/orig','movie'),('2024-04-07 20:31:16.763924','2024-04-07 20:31:16.763924',12208,'Лантана',2001,'Фильм рассказывает о судьбе пяти семей. Моменты счастья и разлада. Адвокат отчаянно борется за сохранение отношений со своей женой после того, как умирает их ребенок.',121,'{}',18,733,6.571,7.2,'https://image.openmoviedb.com/kinopoisk-images/1773646/51018a29-5b38-4557-affc-008abd57074b/orig','movie'),('2024-04-07 20:31:17.446909','2024-04-07 20:31:17.446909',12209,'Последний замок',2001,'Случилось так, что генерал Ирвин - заслуженный солдат и ветеран многих войн, отслуживший отечеству верой и правдой, стал узником тюрьмы строгого режима.  За всю свою карьеру генерал допустил лишь одну непоправимую ошибку, которая обернулась для него позорным судом военного трибунала и десятью годами заключения.\n\nНо Юджин стойко принял этот удар судьбы. Смирившись со своей участью, разжалованный офицер вступил в стены тюрьмы с единственным намерением - отбыть свой срок и вернуться домой.Но все сложилось иначе… Ирвин делает шокирующее открытие: в тюрьме хладнокровно убивают заключенных.\n\nЗа этими кровавыми преступлениями стоит жестокий комендант тюрьмы - полковник Уинтер. И тогда генерал решает принять на себя командование в последний раз, став во главе отчаянного восстания разгневанных заключенных…',131,'72000000 $',18,734,7.344,6.9,'https://image.openmoviedb.com/kinopoisk-images/1773646/3ceb35bb-f7e9-4e3a-83dd-6eea429e0606/orig','movie'),('2024-04-07 20:31:18.074268','2024-04-07 20:31:18.074268',12210,'Блондинка в законе',2001,'Эль Вудс — красавица, президент университетского женского клуба, носит звание «Мисс Июнь», но главное, она — натуральная блондинка. Ее бойфрэнд — лучший парень университета, и единственное, о чем она мечтает — это стать миссис Уорнер Хантингтон III.\n\nНо оказывается, Уорнер считает Эль слишком поверхностной и вместо долгожданного предложения руки и сердца он открывает Эль свои коварные планы — поступить в Гарвард на юридический факультет и жениться на умной интеллигентной девушке. Проведя пару недель в истерике и съев несколько килограммов шоколадных конфет, Эль отправляется в Гарвард возвращать своего ненаглядного.',96,'18000000 $',12,735,6.779,6.5,'https://image.openmoviedb.com/kinopoisk-images/1629390/7db82a52-5a79-4cc0-91ac-2d32b8f5ee6e/orig','movie'),('2024-04-07 20:31:18.689112','2024-04-07 20:31:18.689112',12211,'Легенда Багера Ванса',2000,'Ветеран войны Раннулф Джуннах когда-то был лучшим игроком в гольф во всей Саванне. Но сейчас он всего лишь разочарованный в жизни пьяница. Внезапно в его жизни появляется таинственный Багер Ванс.\nОн открывает Раннулфу секреты истинного мастерства игры. Теперь Джуннах готов к большому соревнованию.',126,'80000000 $',12,736,7.534,6.7,'https://image.openmoviedb.com/kinopoisk-images/1946459/7cc253a9-62c5-41cf-9458-3ef786968d97/orig','movie'),('2024-04-07 20:31:19.379614','2024-04-07 20:31:19.379614',12212,'Жизнь как дом',2001,'45-летний архитектор Джордж Монро, узнав о своей скорой кончине, понимает, что жизнь его прошла совсем не так, как ему хотелось бы. Он пытается исправить ошибки прошлого, став заботливым и трогательным. Несмотря на то, что его терпеть не могут все члены семьи, которую он покинул десять лет назад, он решает не только во что бы то ни было построить дом, но и привлечь в качестве помощника своего сына.',125,'27000000 $',16,737,7.749,7.4,'https://image.openmoviedb.com/kinopoisk-images/1704946/65597bef-b53f-444f-b18f-734c0e05a50e/orig','movie'),('2024-04-07 20:31:19.926742','2024-04-07 20:31:19.926742',12213,'Жизнь Дэвида Гейла',2002,'Дэвид Гейл — человек, который пробовал жить в соответствии со своими принципами, но, в причудливом повороте судьбы, этот преданный отец, популярный профессор и ярый противник смертной казни окажется в камере смертников за убийство активистки Констанции Харравей. За три дня до исполнения приговора Гейл соглашается дать интервью репортеру Битси Блум.\nНо журналистка вскоре понимает, что ее участие в этом деле не ограничится одним интервью и что жизнь человека находится в ее руках. Поставив на кон свою собственную безопасность, она начинает расследовать те ужасные события, которые окружали смерть Констанции.',130,'38000000 $',18,738,8.084,7.5,'https://image.openmoviedb.com/kinopoisk-images/4483445/09a852e0-394e-457e-b637-880cadc38dd2/orig','movie'),('2024-04-07 20:31:20.690407','2024-04-07 20:31:20.690407',12214,'Лиля навсегда',2002,'16-летняя Лиля живет в маленьком бедном городке. Ее мать уехала в Америку с новым любовником, и Лиля ждет, когда ей пришлют приглашение. Не дождавшись от матери ни писем, ни денег, Лиля понимает, что ее бросили.\n\nУ нее остается единственный друг – 11-летний Володя, с которым они мечтают о лучшей жизни. И однажды у Лили появляется надежда. Она влюбляется во взрослого симпатичного парня по имени Андрей, и он уговаривает Лилю поехать вместе с ним в Швецию...',109,'{}',16,739,7.441,7.8,'https://image.openmoviedb.com/kinopoisk-images/1898899/b0360730-f518-4cd3-ba0c-2938686fb8ec/orig','movie'),('2024-04-07 20:31:21.345925','2024-04-07 20:31:21.345925',12215,'Лило и Стич',2002,'Лило — это маленькая девочка, живущая на Гавайах. Она сирота и живет вместе со своей старшей сестрой Нани. Лило любит всех животных, но больше всего она подружилась с собачкой по имени Стич, которая на самом деле совсем не собачка, а замаскированный инопланетянин.\n\nДело было так: некоего преступника по имени Стич переправляли в интергалактическую тюрьму, но ему удалось ускользнуть и приземлиться на Земле, где он и встретил Лило. И тут Стич прикинулся собакой, дабы скрыться от преследования интергалактической полиции. Теперь Стич учится тому, чему не был обучен — заботе о других.',85,'80000000 $',0,740,7.847,7.3,'https://image.openmoviedb.com/kinopoisk-images/4303601/ab295c60-9fa4-4fe4-9be5-a6f33ead2071/orig','cartoon'),('2024-04-07 20:31:22.277530','2024-04-07 20:31:22.277530',12216,'Вас не догонят',2001,'В дорогом частном колледже, затерянном в густом лесу, шестнадцатилетних воспитанниц учат всему: от иностранных языков до фехтования. Единственное, чему невозможно научить - как скрыть первое чувство любви, если оно направлено на твою соседку по комнате. Как проявить это запретное чувство, чтобы не стать изгоем, чтобы добиться того же в ответ…',103,'{}',16,741,7.413,6.8,'https://image.openmoviedb.com/kinopoisk-images/1599028/bed72d70-4273-4877-991e-5ffd062c85ec/orig','movie'),('2024-04-07 20:31:22.891540','2024-04-07 20:31:22.891540',12217,'Любовь и баскетбол',2000,'Моника и Квинси знают друг друга с детства. Еще когда им было по 11, Квинси был потрясен тем, что какая-то девчонка может играть в баскетбол лучше, чем большинство парней. Но время шло, они становились старше. И на смену дружбе пришло другое чувство – любовь.\nК сожалению, это не продлилось долго – Квинси, мечтая быть как отец известным игроком в НБА, бросает Монику и уходит в профессиональные баскетболисты. Сблизивший их баскетбол их же жестоко и разлучил. Но жизнь не так плоха, и она дарит им случайную встречу, которая может сделать их снова близкими и счастливыми или... чужими и очень далекими.',124,'20000000 $',12,742,7.612,7.2,'https://image.openmoviedb.com/kinopoisk-images/1773646/b773ce9a-0b54-47b2-9ece-1cda561d1b86/orig','movie'),('2024-04-07 20:31:23.520392','2024-04-07 20:31:23.520392',12218,'Обаятельная и привлекательная',2001,'Здесь, словно в ярком калейдоскопе, собраны непредсказуемые ситуации, забавные сцены, горести и радости, которыми наполнена жизнь всех, кто смело идет по жизни в поисках счастья и любви.',91,'250000 $',16,743,6.196,6.7,'https://image.openmoviedb.com/kinopoisk-images/1599028/fcd9a6d2-38a3-4f5b-87a7-c022ee242bc7/orig','movie'),('2024-04-07 20:31:24.167978','2024-04-07 20:31:24.167978',12219,'Люсия и секс',2001,'Люсия, молодая официантка из ресторана в центре Мадрида, уезжает на тихий и спокойный остров в Средиземном море после того, как узнаёт об исчезновении своего возлюбленного, с которым прожила шесть лет. Там, среди восхитительной природы, свежего воздуха и под ярким солнцем, Люсия начинает познавать самые тёмные уголки своего прошлого, проведённого с любимым - как если бы это были запрещённые отрывки из романа, которые автор, находясь вдалеке, ей позволяет теперь прочитать...',128,'{}',16,744,7.086,7,'https://image.openmoviedb.com/kinopoisk-images/1599028/acc62a84-8902-48bb-9fd0-49f3323f0c1f/orig','movie'),('2024-04-07 20:31:24.800640','2024-04-07 20:31:24.800640',12220,'Всё схвачено!',2001,'Два друга, боксеры-любители: Бобби и Рикки не избалованы деньгами. И это сильно портит им жизнь. Но однажды они получают шанс поправить свои дела. Местный авторитет отправляет их с поручением в Нью-Йорк.\n\nИ если для Бобби это просто очередная работа, то для Рикки - путь к давней мечте стать крутым парнем. Шикарный прием на Манхэттене совершенно сбивает Рикки с толку. Мир больших денег: лимузин, клубы, девочки - вот оно, свершилось! И он решает, что тут все схвачено, и они уже крутые бандиты! И когда он почти свыкся с новой ролью, пришло время сделать то, за чем они сюда приехали...',95,'5000000 $',16,745,5.875,6.3,'https://image.openmoviedb.com/kinopoisk-images/1629390/c5343c2d-6e5e-4362-8be5-c14f2b71de9b/orig','movie'),('2024-04-07 20:31:25.423603','2024-04-07 20:31:25.423603',12221,'Мажестик',2001,'История о человеке, ищущем самого себя. Питер, голливудский сценарист, случайно попадает в маленький городок Лоусон в Калифорнии: после автомобильной аварии он полностью теряет память.\nЕго принимают за пропавшего без вести героя Второй мировой. Питер, который сам поверил в это, берется за восстановление заброшенного городского кинотеатра. Невеста героя, которая ждала его несколько лет, также не замечает, что рядом с ней — двойник. Прекрасная жизнь основана на прекрасном обмане. Но правда, рано или поздно, откроется...',153,'72000000 $',12,746,7.671,6.9,'https://image.openmoviedb.com/kinopoisk-images/4774061/df1cb495-523d-450e-8b7e-b9fe54ae6648/orig','movie'),('2024-04-07 20:31:26.002018','2024-04-07 20:31:26.002018',12222,'Малена',2000,'Малена - красавица-вдова, наваждение мужчин и предмет зависти женщин. Жены распускают о ней грязные сплетни. Мужья преследуют ее по пятам и грезят о ней.\n«Мне было 13, когда я увидел ее впервые. Прошло время, я любил многих женщин, и когда мы были близки, они спрашивали: буду ли я помнить их? И я говорил: да, я буду помнить вас. Но единственная, кого я никогда не забуду - та, которая никогда не спрашивала. Малена».',100,'{}',18,747,7.795,7.4,'https://image.openmoviedb.com/kinopoisk-images/6201401/7625fadc-3c19-43f7-9340-f4ba3181f510/orig','movie'),('2024-04-07 20:31:26.696521','2024-04-07 20:31:26.696521',12223,'Человек, который плакал',2000,'1927 год. Обстоятельства разлучают семью из далекой российской глубинки. Отец в поисках заработка эмигрирует в Америку, а малолетняя дочь, пытаясь найти его следы, волею судьбы вскоре оказывается в Христианском приюте в Англии. Здесь она получает новое имя – Сьюзи и билет в новую жизнь, учится петь и забывает родной язык.\nПроходит много лет. И вот уже прелестная девушка, одаренная незабываемым красивым голосом, попадает в Париж. Колыбель любви и нежный возраст красавицы приносят свои плоды. Неизведанное чувство и первая страсть целиком захватывает доверчивую девушку. Но неожиданно безоблачное счастье разбивается начавшейся войной и нацистским вторжением.\nПокинув Париж, потеряв любимого человека и лучшую подругу, Сьюзи устремляется в Америку навстречу неизвестности. Встретит ли она наконец своего отца или же ей в очередной раз суждено остаться в одиночестве?…',100,'{}',16,748,7.014,6.1,'https://image.openmoviedb.com/kinopoisk-images/1773646/bcd696ce-390a-41f3-968a-494839df511f/orig','movie'),('2024-04-07 20:31:27.407845','2024-04-07 20:31:27.407845',12224,'Костолом',2001,'У Дэнни Михэна есть все: деньги, слава, дорогие машины. Он - капитан английской национальной команды по футболу. Но однажды идиллия нарушается; Дэнни получает трехлетний тюремный срок за нападение на офицера полиции в состоянии алкогольного опьянения. Начальник тюрьмы, в которой оказался Дэнни, вложил немало собственных денег в создание футбольной команды и решил заполучить маститого футболиста в качестве тренера для своей команды. Его мечта - выиграть «тюремную лигу». Но Дэнни создает команду из заключенных, которая должна сыграть первый матч со своими тюремщиками. Начальник тюрьмы не возражает; он не верит, что заключенные могут выиграть.',99,'2500000 £',16,749,7.25,6.4,'https://image.openmoviedb.com/kinopoisk-images/1773646/d7b4067a-4549-4fb1-848e-4b84a49039ff/orig','movie'),('2024-04-07 20:31:28.138160','2024-04-07 20:31:28.138160',12225,'Знакомство с родителями',2000,'Обладатель замечательной фамилии, санитар Грэг Трахер, отправляется за город, чтобы познакомиться с родителями своей девушки Пэм. Здесь Грэг собирается торжественно просить руки возлюбленной. Но, к несчастью, Грэг — парень невезучий, и любые благие начинания в его исполнении превращаются в сущий кошмар.\n\nНесчастный Трахер и в самом страшном сне не предполагал, какие его ждут испытания. Дело в том, что отец Пэм, Джек Бернс, — отставной сотрудник ЦРУ, устраивает приятелям дочери свою особую и жесткую проверку. Эта проверка включает в себя даже специальный тест на детекторе лжи!',108,'55000000 $',18,750,7.543,7,'https://image.openmoviedb.com/kinopoisk-images/6201401/0ac1c181-910b-430a-85ee-0d5e407d786c/orig','movie'),('2024-04-07 20:31:28.742963','2024-04-07 20:31:28.742963',12226,'Военный ныряльщик',2000,'1948 год. Бедный темнокожий парень и сын издольщика Карл Брашир решает пойти служить во флот. Но во времена расовой сегрегации у людей с его цветом кожи нет перспектив пробиться дальше работы на кухне. Правда, Карла это не останавливает, и он решает доказать всем, что способен на большее, чем мытьё посуды. Вскоре он получает возможность поступить в школу водолазов, где упёртый и смелый парень сталкивается с расизмом, а также с противодействием жёсткого инструктора Билли Сандея, который старается вышвырнуть Карла из школы любыми способами.',129,'32000000 $',18,751,8.088,7.2,'https://image.openmoviedb.com/kinopoisk-images/1898899/7653e49a-4526-445b-beef-d0448b6413f3/orig','movie'),('2024-04-07 20:31:29.330262','2024-04-07 20:31:29.330262',12227,'Метрополис',2001,'Многомиллионная армия роботов заменила людей на заводах и фабриках. Миром правят могущественные главы планетарных суперкорпораций. На этом фоне разворачивается история девочки-киборга, созданной гениальным ученым и обладающей точным сходством с умершей дочерью деспотичного правителя Метрополиса.\n\nЕй было предназначено стать ключом к власти над всем миром. Но в один роковой день она таинственно исчезает... По ее следу пускается опытный детектив и его сын, не подозревая, что тем самым они ввязываются в величайшую битву Добра и Зла, которую только видела Земля.',108,'15000000 $',0,752,6.842,7.2,'https://image.openmoviedb.com/kinopoisk-images/1704946/dde0d4c0-be66-414a-9602-a2ad5319a2e7/orig','anime'),('2024-04-07 20:31:30.134128','2024-04-07 20:31:30.134128',12228,'Мексиканец',2001,'Мелкий гангстер Джерри Уэлбах получает в один день сразу два ультиматума. Его босс - главарь банды - требует, чтобы Джерри срочно разыскал в Мексике бесценный антикварный пистолет, прозванный «Мексиканец», или... незамедлительно вернул все долги. \r\n\r\nЕго подружка Саманта тоже ставит вопрос ребром: или она или банда. Из двух зол Джерри выбирает меньшее, и отправляется в Мексику за пистолетом. Но вскоре выясняется, что заполучить «Мексиканца» мечтает не он один. Но и два профессиональных киллера...',123,'57000000 $',18,753,7.089,6.1,'https://image.openmoviedb.com/kinopoisk-images/1900788/0d56f7d5-834c-44f9-bbc3-d71dc6f42351/orig','movie'),('2024-04-07 20:31:30.874229','2024-04-07 20:31:30.874229',12229,'Человек без прошлого',2002,'Безработный и безымянный мужчина, обитатель финской провинции, едет в Хельсинки с единственной надеждой - найти работу. Но не успеет он сойти с поезда на вокзале, как тут же будет жестоко избит местными хулиганами буквально до смерти. Его доставят в больницу, где он умрёт. Умрёт, чтобы тут же воскреснуть и, полностью потеряв память, обнаружить себя в совсем другом, нежном Хельсинки. Чтобы забыть прошлое, отказаться от него и получить от судьбы новый шанс. Этот шанс - встреча с Ирмой, женщиной в форме офицера Армии спасения...',97,'8000000 FIM',12,754,7.584,7.6,'https://image.openmoviedb.com/kinopoisk-images/1629390/f423aacc-d5af-412e-94d2-c57e4638fdab/orig','movie'),('2024-04-07 20:31:31.636365','2024-04-07 20:31:31.636365',12230,'Мисс Конгениальность',2000,'Действие фильма начинается в 1982 году в Нью-Джерси. Девочка-очкарик вступается за одноклассника и задает трепку местному хулигану. Прошли годы. И девочка Грэйси стала агентом ФБР. Ее направляют на конкурс красоты «Мисс Америка», где должен появиться серийный убийца по прозвищу «Гражданин». \r\n\r\nГрэйси срочно должна стать красавицей, чтобы изнутри, как участница конкурса разоблачить преступника, и в этом ей помогает опытный консультант Виктор. На наших глазах происходит метаморфоза: гадкий утенок превращается в леди. Грэйси попадает в смешные положения, но отовсюду выходит с честью, даже из дефиле в купальниках...',110,'45000000 $',18,755,7.085,6.3,'https://image.openmoviedb.com/kinopoisk-images/1599028/493b25a3-9b39-4d21-a889-a2a9fb4809bb/orig','movie'),('2024-04-07 20:31:32.298907','2024-04-07 20:31:32.298907',12231,'Свадьба в сезон дождей',2001,'Героями этой истории стали представители «высшего среднего класса» современной Индии. Члены пенджабской семьи, для которой в порядке вещей стало пересечение западного стиля и старых традиций.\n\nСъезжаясь на свадьбу 24-летней Адити в Нью-Дели со всех концов света, ее многочисленные родственники привозят самые разные представления о жизни. Из всех шкафов начинают вываливаться скелеты и тайны...',114,'7000000 ₹',12,756,6.717,7.3,'https://image.openmoviedb.com/kinopoisk-images/1900788/a2742622-2628-439c-af22-022c92813373/orig','movie'),('2024-04-07 20:31:33.152684','2024-04-07 20:31:33.152684',12232,'Бал монстров',2001,'Хэнк гордится своей редкой профессией и рассчитывает, что его сын Сонни продолжит семейную династию. Вот уже несколько поколений мужчины в их семье работают палачами, включая во время казни рубильник электрического стула.',111,'4000000 $',18,757,7.129,7.1,'https://image.openmoviedb.com/kinopoisk-images/1600647/5ce3357d-bd8a-41db-a7a2-2981930d9b72/orig','movie'),('2024-04-07 20:31:33.719556','2024-04-07 20:31:33.719556',12233,'Миля лунного света',2002,'Незадолго до свадьбы трагически погибает невеста Джо. Молодой человек считает своим долгом остаться с родителями погибшей девушки. В то время, как Джо размышляет, сможет ли он когда-нибудь начать жизнь заново, в его судьбе появляется другая&#133;',117,'21000000 $',16,758,6.471,6.6,'https://image.openmoviedb.com/kinopoisk-images/1900788/c850acd4-cde2-4abd-a9ab-4ac1e2366909/orig','movie'),('2024-04-07 20:31:34.322344','2024-04-07 20:31:34.322344',12234,'Человек-мотылек',2001,'Спустя два года после трагической гибели жены журналист Джон Клайн оказывается в маленьком городке в Западной Вирджинии. Удивительные рассказы местных жителей, видевших странное существо, являющееся людям в сумраке ночи и становящееся предвестником чудовищных трагедий, похожее на гигантского человека-мотылька, вынуждают его начать собственное расследование, которое даёт совершенно неожиданные результаты...',119,'32000000 $',18,759,6.828,6.4,'https://image.openmoviedb.com/kinopoisk-images/6201401/001c82bb-dde5-4aeb-9dfd-d902f9bfe2d7/orig','movie'),('2024-04-07 20:31:34.994497','2024-04-07 20:31:34.994497',12235,'Мумия возвращается',2001,'Прошло десять лет... Наш отважный герой, искатель приключений Рик О\'Конелл, теперь богат, счастливо женат на прекрасной Эвелин  и воспитывает своего восьмилетнего сына Алекса.\n\nНо злой рок не дает очаровательной семье О\'Конеллов насладиться спокойной жизнью. Зловещий жрец Имхотеп снова восстал из мертвых! Теперь у Рика, Эвелин и малютки Алекса есть всего семь дней, чтобы спасти мир...',130,'98000000 $',12,760,7.426,6.4,'https://image.openmoviedb.com/kinopoisk-images/1600647/e029b5c2-30b3-4377-a008-fee76d62aad4/orig','movie'),('2024-04-07 20:31:35.680664','2024-04-07 20:31:35.680664',12236,'Отсчет убийств',2002,'В лесной канаве курортного калифорнийского городка Сан-Бенито найден труп девушки. Вести следствие поручают опытному детективу из отдела по расследованию убийств Кэсси Мэйуэзер и её новому напарнику Сэму Кеннеди.\n\nКэсси уходит в расследование с головой. Она тщательно собирает всевозможные улики и на их основе составляет приблизительный портрет убийцы. Сэм умён и энергичен. Но найти убийцу не так просто.',115,'50000000 $',18,761,6.98,6.2,'https://image.openmoviedb.com/kinopoisk-images/1898899/4a35c98d-f927-4f94-868f-1524136af0df/orig','movie'),('2024-04-07 20:31:36.288436','2024-04-07 20:31:36.288436',12237,'Моя большая греческая свадьба',2001,'Афродита, богиня любви и красоты, не благосклонна к Туле Портокалос. Её регулярный ночной кошмар – уже за 30 и ещё не замужем. В толстых очках и с обвисшими прядями она обслуживает клиентов в семейном ресторане своих многочисленных родственников и спит и видит, куда бы сбежать от всех этих тётушек, дядюшек и бабушек.',95,'5000000 $',12,762,6.758,6.6,'https://image.openmoviedb.com/kinopoisk-images/1629390/921a9fa5-6b9c-420d-a58d-efd6ce5f97bf/orig','movie'),('2024-04-07 20:31:36.983105','2024-04-07 20:31:36.983105',12238,'Мой пёс Скип',1999,'Небольшой городок в штате Миссисипи, 1942 год. Маленький стеснительный мальчик Уилл растет замкнутым - у него нет друзей. Его кумир и единственный друг - местная звезда бейсбола и всеобщий любимец Динк Дженкинс, на которого он хочет быть во всем похожим. После ухода Динка на войну, Уилл остается совсем один, и родители дарят ему на день рождения щенка Скипа.\r\n\r\nПоявление собаки в корне меняет жизнь Уилла - у него появляются друзья, любимая девочка и уважение со стороны родителей и окружающих. Случайная ссора со Скипом показывает ему истинную цену настоящей дружбы, и Уилл постепенно мужает...',95,'6000000 $',0,763,7.712,7,'https://image.openmoviedb.com/kinopoisk-images/1946459/6c2805d2-0298-4c8f-a828-0c797dd26f9d/orig','movie'),('2024-04-07 20:31:37.658584','2024-04-07 20:31:37.658584',12239,'Наркобарон',2002,'Детектив Ник Тэллис, отстраненный от службы после трагического задержания опасного наркодилера, получает редкий шанс вернуться на прежнюю работу. Расследование жестокого убийства оперативника отдела по борьбе с наркотиками за два месяца не продвинулось ни на шаг, и начальство надеется, что у Ника есть свежие идеи. Вместе с бескомпромиссным лейтенантом Оаком он пытается выяснить, как погиб агент и кому была выгодна его смерть. Ответы кажутся очевидными, но Ник подозревает, что всё не так просто, как кажется на первый взгляд. Вскоре шокирующие открытия подтвердят его догадку…',105,'6500000 $',16,764,6.738,7.1,'https://image.openmoviedb.com/kinopoisk-images/1946459/d0e2ace6-ef57-4df3-bb2a-be1dfdd4f5a6/orig','movie'),('2024-04-07 20:31:38.442466','2024-04-07 20:31:38.442466',12240,'Ничья земля',2001,'Взвод боснийских солдат заблудился в ночном тумане и к утру, к ужасу своему, обнаружил, что оказался прямо перед сербской передовой, под огнем противника.\n\nПосле завязавшегося скорого, но жестокого боя, в траншее на нейтральной полосе оказались три раненых - серб и два боснийца. Один из боснийцев лежит на мине: если попытаться снять его с этой адской машины - она сработает.\n\nЧто делать заклятым врагам, оказавшимся в такой абсурдной и жуткой ситуации?',98,'14000000 FRF',16,765,7.449,7.9,'https://image.openmoviedb.com/kinopoisk-images/1599028/0d1aced6-c5b7-41e3-a1b5-a5d31844da18/orig','movie'),('2024-04-07 20:31:39.307212','2024-04-07 20:31:39.307212',12241,'Новокаин',2001,'Дантист Фрэнк Сангстер — воплощение американской мечты. Но его процветающий бизнес и радужные планы с красавицей — ассистенткой разбиваются в прах, когда в кресло к Фрэнку усаживается Сюзан Айви…  Сначала у них исчезают наркотики. А вскоре его самого уже разыскивает полиция. За убийство…',95,'8000000 $',16,766,6.425,5.8,'https://image.openmoviedb.com/kinopoisk-images/1773646/d97768cc-512a-4c50-8554-0d971d489422/orig','movie'),('2024-04-07 20:31:40.026867','2024-04-07 20:31:40.026867',12242,'Девять королев',2000,'Два мошенника пытаются обмануть коллекционера и продать ему лист поддельных редких марок.',114,'1500000 $',16,767,7.29,7.9,'https://image.openmoviedb.com/kinopoisk-images/1773646/0ec28a80-697f-4c5a-b1f0-64a1db7bbafb/orig','movie'),('2024-04-07 20:31:40.686287','2024-04-07 20:31:40.686287',12243,'Сестричка Бетти',1999,'Брать чужое нехорошо. Но нечистый на руку продавец автомобилей Дел Сайзмор забыл эту простую истину. За что и был наказан. Два киллера: Чарли и Уэсли помогли ему переселиться в мир иной.\nНевольной свидетельницей этого события стала жена Дела - Бетти, в результате чего ее немного заклинило, и она отправилась искать счастье в объятиях доктора Рэвелла, персонажа популярного телесериала.\nА по пятам за ней следует парочка убийц, у которых осталось к семье Сайзморов незавершенное дело...',110,'35000000 $',18,768,6.368,6.3,'https://image.openmoviedb.com/kinopoisk-images/6201401/c92e08d8-766b-497b-8009-c64a02644d70/orig','movie'),('2024-04-07 20:31:41.474532','2024-04-07 20:31:41.474532',12244,'О',2001,'Джеймс Один, лучший игрок баскетбольной команды, пользуется заслуженной популярностью в колледже. Он встречается с дочерью декана Дези Брэбл и у него есть все шансы на успешное будущее. Но находится человек, которому чужое благополучие не дает покоя — это Хьюго Гоулдинг, партнер Одина по команде. Больное самолюбие толкает Хьюго на реализацию зловещих замыслов, способных погубить не только любовь, но и всю жизнь соперника…',95,'5000000 $',18,769,6.875,6.1,'https://image.openmoviedb.com/kinopoisk-images/1599028/ad52e23f-e5d8-4ce7-b826-3c6a5ff0213c/orig','movie'),('2024-04-07 20:31:42.193781','2024-04-07 20:31:42.193781',12245,'Одиннадцать друзей Оушена',2001,'После выхода из тюрьмы вора Дэнни Оушена не проходит и 24 часов, а он уже планирует организовать самое сложное ограбление казино в истории. Он хочет украсть 160 млн американских долларов из трёх самых преуспевающих казино Лас-Вегаса. Все эти казино принадлежат элегантному и в то же время жестокому дельцу Терри Бенедикту, который только и мечтает о том, как встретится с бывшей женой Дэнни Оушена - Тесс.\n\nВсего за одну ночь Дэнни подбирает команду из одиннадцати «специалистов», способных совершить эту дерзкую кражу. В команде Оушена оказываются первоклассный карточный шулер, молодой искусный вор-карманник и гениальный разрушитель. Чтобы совершить этот безумный и сложный грабёж, Оушену придётся рисковать своей жизнью.',116,'85000000 $',12,770,8.083,7.7,'https://image.openmoviedb.com/kinopoisk-images/1704946/3a8875d0-caa7-4f3b-aa54-721e0868c4ad/orig','movie'),('2024-04-07 20:31:42.751516','2024-04-07 20:31:42.751516',12246,'Старая закалка',2002,'Митчу, Френку и Берни уже за тридцатник, скоро они станут ответственными взрослыми, женятся, заведут семьи и найдут работу, а детство всё не перестаёт в них бурлить.\n\nОчередной озорной придумкой становится попытка вновь пережить сладкие мгновения совместной учёбы в колледже, когда их слава гремела буквально по всем углам. Они снимают большой дом близ колледжа и устраивают в нём «студенческое братство»...',88,'24000000 $',16,771,6.691,7,'https://image.openmoviedb.com/kinopoisk-images/1946459/288b6b0f-3a4c-43ee-a838-130176081983/orig','movie'),('2024-04-07 20:31:43.314122','2024-04-07 20:31:43.314122',12247,'Фото за час',2002,'Сай Перриш - одинокий пожилой сотрудник фотолаборатории. В его жизни нет ничего, кроме работы, а единственная отрада в жизни - семья Йоркин. Проявляя для них фотографии на протяжении многих лет, Сай привязался к этой семье, и в особенности к маленькому Джейкобу. Но эта привязанность заходит слишком далеко.',96,'12000000 $',18,772,6.88,6.8,'https://image.openmoviedb.com/kinopoisk-images/1773646/db9ca7d3-75d9-4e2a-9772-c8b6749f79ce/orig','movie'),('2024-04-07 20:31:43.911295','2024-04-07 20:31:43.911295',12248,'Ночь в баре Маккула',2001,'Она могла заставить мертвого станцевать для нее чечетку. Но предпочитала живых. Их было трое: бармен Рэнди, сразу заглотивший наживку, адвокат Карл и детектив Делинг, занятый расследованием убийства. В умелых руках красота — страшная сила, и Джюел использовала свой дар на полную катушку.Все началось однажды ночью в баре Маккула, когда Рэнди впервые увидел ее. В последующие дни Джюел сумела сделать так, что один совсем потерял из-за нее голову, другой забыл о своей живой жене, а третий — даже не вспомнил о мертвой.И неудивительно: ведь она хотела больше, чем все они вместе взятые! Был еще четвертый, который считал себя хитрее остальных',93,'18000000 $',16,773,6.828,6.2,'https://image.openmoviedb.com/kinopoisk-images/1773646/5cc038cb-3902-46ca-b974-15a4d8364b74/orig','movie'),('2024-04-07 20:31:44.516901','2024-04-07 20:31:44.516901',12249,'Страна чудаков',2001,'Шон Брумдер, занимаясь серфингом, нашел в песке на пляже копию романа Маркуса Скиннера. Эта книга легендарного автора, который преподает в университете Стэнфорда, оказывает большое влияние на Шона.\n\nПосле этого молодой человек решает, что должен стать писателем. Но его мечты о посещении Стэнфорда и учебе под руководством известного наставника рушатся, когда по ошибке вместо документов Шона туда отправляют документы плохого ученика.\n\nС помощью своей подруги Эшли и брата-наркомана Шон пытается убедить школьное руководство пересмотреть его заявление. После ряда трагических неудач, Шону остается последнее средство - за день до окончания приема мчаться в университет, посадив за руль отморозка-братца и прихватив для поддержки свою подружку.',82,'18000000 $',18,774,6.621,6.2,'https://image.openmoviedb.com/kinopoisk-images/1900788/46030f6a-0046-4a8d-9124-93ca4621c8b0/orig','movie'),('2024-04-07 20:31:45.129267','2024-04-07 20:31:45.129267',12250,'Обыкновенный преступник',1999,'Ограбление – это то, что Майкл Линч всегда делает с блеском. Он берет банки один за другим, не оставляя полиции никаких шансов. Копы сбиваются с ног, гоняясь за ним, но не могут добыть ни единой улики!\nВсе знают, что он лидер преступной группы, но засадить его за решетку не удается никому! Линч хитер и изобретателен. Он – гений ограблений. Ему преданы свои и его ненавидят чужие. И Линчу определенно нравится такая жизнь, где он – герой!',93,'{}',16,775,6.773,6.3,'https://image.openmoviedb.com/kinopoisk-images/1629390/fa60d3e3-b42b-48ac-9c68-b4bf34350793/orig','movie'),('2024-04-07 20:31:45.858073','2024-04-07 20:31:45.858073',12251,'Осмосис Джонс',2001,'Он - герой новой породы. Одноклеточный герой нашего времени. Он - Осмосис Джонс. Этот заразительный мультипликационный боевик начинается с того, что Фрэнк проглатывает злодейский вирус по имени Трэкс.\n\nТеперь, глубоко внутри удивительных мультипликационных внутренностей города Фрэнк, одинокий полицейский - белая кровяная клетка по имени Осмосис Джонс и его упорный помощник Дрикс должны помешать злобной эпидемии, развязанной Трэксом!',95,'70000000 $',6,776,7.118,6.3,'https://image.openmoviedb.com/kinopoisk-images/4303601/56920793-9e49-4271-8335-218cabf6b690/orig','cartoon'),('2024-04-07 20:31:46.826248','2024-04-07 20:31:46.826248',12252,'Братство волка',2001,'Франция, вторая половина XVIII века. В местечке под названием Жевадан появляется страшное существо, прозванное жителями Зверем, оно безжалостно убивает женщин и детей. Зверь кажется неуловимым, уходя от многочисленных облав, его не берут пули, он исчезает так же внезапно как появляется, и только немногие выжившие способны описать его внешность.\n\nСам король Людовик XV решает разобраться в происходящем и поручает расследовать жестокие убийства учёному Грегору де Фронсаку. С Грегором в Жеводане появляется ещё один герой - индеец Мани - он когда-то спас де Фронсаку жизнь, и теперь они братья по крови.\n\nВокруг молчаливого индейца таинственности не меньше, чем вокруг Зверя. Мани прибегает к загадочным ритуалам, а в борьбе с монстром полагается на инстинкты и обычаи своего народа.',142,'29000000 FRF',16,777,7.357,7,'https://image.openmoviedb.com/kinopoisk-images/1599028/479951a7-ed46-43ed-b0a1-a60cb37ed26d/orig','movie'),('2024-04-07 20:31:47.619759','2024-04-07 20:31:47.619759',12253,'Хлеб и тюльпаны',2000,'Домохозяйка Розальба отправляется с мужем и детьми на автобусную экскурсию. Неожиданно она остается одна в придорожном кафетерии.\n\nПытаясь добраться домой, героиня волей случая попадает в Венецию – город ее мечты. Обретенная свобода дарит ей не только новые ощущения и приключения. На этом пути Розальба находит радость и любовь. Теперь все в ее жизни будет иначе.',114,'{}',16,778,7.121,7.3,'https://image.openmoviedb.com/kinopoisk-images/1704946/52a3fce0-a3aa-41e5-82eb-c4bd8ae7f0b0/orig','movie'),('2024-04-07 20:31:48.295138','2024-04-07 20:31:48.295138',12254,'Паника',2000,'Их семейный бизнес приносил хорошие деньги: убийство по найму - дорогая работа. Но однажды Алекс решил завязать. Он почувствовал, что устал. Устал убивать. Но не учел одного, что его отец так или иначе найдет способ устранить проблему, чтобы спасти дело, которому посвятил всю свою жизнь.',88,'1000000 $',16,779,6.71,6.7,'https://image.openmoviedb.com/kinopoisk-images/1704946/0c980c4b-3512-4c3c-985d-041dc0a30a5f/orig','movie'),('2024-04-07 20:31:48.933601','2024-04-07 20:31:48.933601',12255,'Комната страха',2002,'Мэг Олтман с дочерью Сарой въехала в только что купленный дом, ранее принадлежавший миллионеру. Хороший дом в хорошем районе, казалось бы, идеальное место для жизни. Помимо всего прочего дом оборудован спецкомнатой, в которой можно спрятаться, если в дом залезут воры. После того как стальная дверь толщиной в несколько сантиметров закроется, попасть в комнату становится невозможно. Конечно, злодеи не заставили себя долго ждать.',107,'48000000 $',18,780,7.281,6.8,'https://image.openmoviedb.com/kinopoisk-images/1629390/1e25551b-ca20-42ed-a23a-48738b93beaa/orig','movie'),('2024-04-07 20:31:49.543086','2024-04-07 20:31:49.543086',12256,'Патриот',2000,'Когда над страной вспыхнуло смертоносное пламя страшной войны, прославленный ветеран и отец семерых детей Бенджамин Мартин остался в стороне. Но хладнокровное убийство его сына в одночасье меняет всю его жизнь.\n\nЖажда мести превратила воинскую науку в жестокую бойню, а мирного плантатора - в безжалостного командира самого опасного отряда повстанцев...',165,'110000000 $',18,781,7.948,7.2,'https://image.openmoviedb.com/kinopoisk-images/6201401/43d340ec-ac0a-421b-9881-158cc9d000d8/orig','movie'),('2024-04-07 20:31:50.294550','2024-04-07 20:31:50.294550',12257,'Заплати другому',2000,'Представьте себе — Вы оказываете кому-либо существенную услугу и просите этого человека отблагодарить не Вас, а трёх других людей, которые, в свою очередь, отблагодарят ещё троих, и так далее, распространяя тепло и доброту в мировом масштабе. Насколько действенной может оказаться подобная сердечная идея? Ученик седьмого класса Тревор МакКинни решил это проверить, начав цепочку добра.',123,'40000000 $',18,782,8.079,7.2,'https://image.openmoviedb.com/kinopoisk-images/6201401/5c59ef9c-621d-45a6-916b-9c4dae665926/orig','movie'),('2024-04-07 20:31:50.834509','2024-04-07 20:31:50.834509',12258,'Идеальный шторм',2000,'Волны Атлантики вздымаются на 30-метровую высоту. Завывающий ветер невиданной силы. Хэллоуин 1991 года. Стихия наступает по трём фронтам, и один из них поднимает сильнейший шторм.',130,'140000000 $',18,783,7.336,6.5,'https://image.openmoviedb.com/kinopoisk-images/6201401/6605a15f-7bd8-4492-88cb-35c4011267c3/orig','movie'),('2024-04-07 20:31:51.494915','2024-04-07 20:31:51.494915',12259,'Пианистка',2001,'Эрика - профессор Венской консерватории. Но сама она далека от гармонии небесных сфер. Женщина всё ещё спит в одной кровати со старой матерью, тайно посещает порномагазины и под кроватью держит набор садомазохистских инструментов. Когда же в неё влюбляется один из учеников, она шокирует его своей реакцией и поведением.',131,'70000000 ATS',18,784,7.214,7.5,'https://image.openmoviedb.com/kinopoisk-images/1704946/6c1a8e0f-a084-4566-a1b6-b9f52ddc8030/orig','movie'),('2024-04-07 20:31:52.215154','2024-04-07 20:31:52.215154',12260,'Чёрная дыра',1999,'В недалеком будущем космический корабль терпит бедствие, в результате чего совершает вынужденную посадку на отдаленной планете. Погибает капитан, часть команды и большинство пассажиров. Выжившие оказываются на жуткой и безжизненной планете, которая имеет три солнца, из-за чего все живое гибнет в этой пустыне. Но как только планета погружается в темноту, появляются какие-то странные существа.',108,'23000000 $',18,785,7.591,7,'https://image.openmoviedb.com/kinopoisk-images/4486454/6096108b-a9ed-431b-ad5b-5d01ecd31fdb/orig','movie'),('2024-04-07 20:31:52.851861','2024-04-07 20:31:52.851861',12261,'Хамелеон',2001,'Скромный бухгалтер фабрики резиновых изделий Франсуа Пиньон однажды из разговора коллег узнаёт о том, что его хотят уволить. Франсуа решает покончить с собой, прыгнув с балкона, но его останавливает сосед, а узнав о причине такого поступка, берётся решить проблему Пиньона при помощи небольшой фальсификации и скандальных слухов.',84,'95130000 FRF',18,786,7.372,7,'https://image.openmoviedb.com/kinopoisk-images/4774061/145d7b5f-33ed-4248-bbc6-4e7f10ff8f45/orig','movie'),('2024-04-07 20:31:53.432185','2024-04-07 20:31:53.432185',12262,'Обещание',2000,'Детектив отдела по расследованию убийств Джерри Блэк выходит на пенсию. Последний рабочий день Джерри заканчивается прощальной вечеринкой, где коллеги вручают виновнику торжества билет на самолет в Мексику, где Блэк давно мечтал порыбачить.\n\nВ это же самое время в горах находят изуродованный труп восьмилетней девочки. Выход на пенсию откладывается, как, впрочем, и поездка в Мексику: Джерри выезжает на место преступления. И именно старый детектив берет на себя тяжелое бремя сообщить родителям о том, что их ребенка безжалостно убили.\n\nМать девочки требует от Блэка обещание, что он обязательно найдет убийцу. И Джерри дает это обещание, еще не представляя, что оно навсегда изменит его жизнь...',124,'35000000 $',16,787,6.912,6.8,'https://image.openmoviedb.com/kinopoisk-images/1704946/e80cc7b3-dce4-4338-b5f6-f9ccc1c5492e/orig','movie'),('2024-04-07 20:31:54.143911','2024-04-07 20:31:54.143911',12263,'Поллок',2000,'Не многие народы могут похвастаться тем, что из них вышли художники, перевернувшие все представления современников о том, какой должна быть живопись. Казимир Малевич в России... Сальвадор Дали в Испании... А в Америке? В Америке был Джексон Поллок (1912-1956).\n\nЧеловек трагической судьбы, этот необузданный гений за несколько лет совершил революцию в абстракционизме. Его талант открыла в 1941 году художница Ли Краснер, впоследствии ставшая его подругой жизни. Увы, их счастье было недолгим: внутренние демоны, терзавшие душу Поллока, толкали его на путь саморазрушения. В итоге, он прожил потрясающе яркую, но короткую жизнь. Жизнь, которой и посвящен этот фильм.',122,'6000000 $',18,788,7.085,7,'https://image.openmoviedb.com/kinopoisk-images/1599028/28b3910f-b9d5-4a36-9937-02ec96e53ae0/orig','movie'),('2024-04-07 20:31:54.723228','2024-04-07 20:31:54.723228',12264,'Одержимость',2002,'История двух ученых, которые узнают, что Рэндольф Эш, поэт Викторианской эпохи имел тайную внебрачную связь с другой менее известной поэтессой. Ученые начинают исследовать роман из прошлого, читая любовные письма влюбленных, чтобы собрать из осколков полную картину, и вскоре понимают, что сами не могут жить друг без друга…',102,'25000000 $',18,789,6.758,6.3,'https://image.openmoviedb.com/kinopoisk-images/1599028/8cd447d2-7e51-4a17-8650-2f9809a18188/orig','movie'),('2024-04-07 20:31:55.412388','2024-04-07 20:31:55.412388',12265,'Как стать принцессой',2001,'Пятнадцатилетняя Миа живет в Сан-Франциско и ведет обычную для американского подростка жизнь. Но умирает ее отец, и Миа узнает, что он был принцем одной европейской страны, а она теперь единственная наследница трона. Ее бабушка, королева, прибывает в Калифорнию, чтобы сообщить Мии о ее происхождении и выяснить, примет ли она трон. Она хочет сделать из Мии настоящую принцессу, научив этикету и манерам.\nК своему шестнадцатому дню рождения девушка должна решить, отправиться ли ей в Европу, чтобы управлять страной, или остаться с матерью в Сан-Франциско, ведя обычную жизнь американского подростка…',115,'26000000 $',12,790,7.131,6.4,'https://image.openmoviedb.com/kinopoisk-images/1704946/d0fb6056-566f-45ee-86ce-bf8937880659/orig','movie'),('2024-04-07 20:31:56.088245','2024-04-07 20:31:56.088245',12266,'Доказательство жизни',2000,'Терри Торн сумел выкупить заложника Пьера Ленуа на территории Чечни, утерев нос федералам, которые настаивали на том, чтобы самостоятельно осуществить выкуп. Терри — парень не простой; владеет всеми видами оружия, знает несколько языков, является хорошим переговорщиком и психологом.\n\nОн занимается освобождением заложников, если есть «доказательство жизни». А застраховать свою жизнь в странах с «горячими точками» стоит дорого. Еще больше выплачивается страховой компанией лицу, указанному в страховом полисе получателем. Продемонстрировав, как ловко Терри действовал в Чечне, авторы фильма переносят место действия в Южную Америку. Там захватом заложников и грабежами занимаются повстанцы. И для очередного освобождения заложников правительство обращается за помощью к Терри…',135,'65000000 $',16,791,6.809,6.3,'https://image.openmoviedb.com/kinopoisk-images/1900788/7e16a909-1142-4da3-8aef-4a90dd9f9af1/orig','movie'),('2024-04-07 20:31:56.708313','2024-04-07 20:31:56.708313',12267,'Тыковка',2002,'У очаровательной Кэролин Мак Даффи - сказочная жизнь: богатая семья, шикарный ухажер, престижный колледж, прекрасная машина и самые радужные планы на будущее. Беззаботная жизнь гламурных девушек, подобных Кэролин, как правило, лишена значительных потрясений и идёт легко и непринужденно, «как по маслу».\nНо однажды нашей со всех сторон идеальной девушке посчастливилось встретить самого несовершенного юношу со странным именем Тыква. Наша беззаботная героиня и представить себе не могла, что эта встреча изменит ее жизнь-сказку навсегда и сделает ее... еще лучше!',113,'{}',16,792,6.731,6.1,'https://image.openmoviedb.com/kinopoisk-images/1946459/db0873f1-1845-4d60-b933-010da4eea6c7/orig','movie'),('2024-04-07 20:31:57.370652','2024-04-07 20:31:57.370652',12268,'Любовь, сбивающая с ног',2002,'Барри Игану крупно не повезло. Быть восьмым ребенком в семье, где все остальные дети девчонки — это судьба не для слабых духом. Неудивительно, что в тени своих семи явно склонных к тирании сестер, строго пресекавших все его попытки завести романтические отношения, парень вырос жутким невротиком с кучей комплексов. \n\nБарри уже глубоко за тридцать, он страдает от внезапных вспышек ярости и так и не научился нормально общаться с людьми. С женщинами — в особенности. Но фортуна еще не поставила на Барри крест — однажды он встречает странную девушку, которой суждено перевернуть его жизнь.',95,'25000000 $',18,793,6.84,7.3,'https://image.openmoviedb.com/kinopoisk-images/1629390/b7e68c08-3baa-40b5-8153-6633946aa020/orig','movie'),('2024-04-07 20:31:57.977663','2024-04-07 20:31:57.977663',12269,'Тихий американец',2001,'Сайгон, 1952 г. Опытный британский журналист Томас Фаулер живет в экзотическом восточном раю, найдя свое счастье в объятиях юной красавицы Фонг. Приезд молодого американца Пайла развеивает скуку Томаса, уставшего от местных политических стычек и интриг, но когда Пайл признается, что страстно любит Фонг, их дружба превращается в острое противостояние.\nНе желая подчиняться судьбе, Фаулер решает получше узнать Пайла и вскоре понимает, что его соперник намного опаснее, чем кажется на первый взгляд.',97,'30000000 $',18,794,6.771,7,'https://image.openmoviedb.com/kinopoisk-images/1898899/a7420558-0e0a-430f-bf83-824ea804a34d/orig','movie'),('2024-04-07 20:31:58.838950','2024-04-07 20:31:58.838950',12270,'Перо маркиза де Сада',2000,'Действие происходит в 18 веке. Сексуальная, шокирующая история повествует о скандально известном Маркизе де Саде, о том, как его провокационное творчество перевернуло судьбы многих людей. Католический священник вовлечен в развратный и опасный мир Маркиза, поскольку они оба соперничают за любовь прекрасной молодой женщины.\n\nМаркиз иронично издевается над ханжами и лицемерами по всем правилам хорошего вкуса и тона, заставляя их разоблачиться физически и эмоционально. Очень часто под маской грубости скрывается хрупкая красота возвышенных чувств и ощущений.',124,'13500000 $',18,795,7.545,7.2,'https://image.openmoviedb.com/kinopoisk-images/4774061/a7a06ad6-b455-4dd0-b1fd-e32669d460a3/orig','movie'),('2024-04-07 20:31:59.564130','2024-04-07 20:31:59.564130',12271,'Клетка для кроликов',2002,'Западная Австралия, 1931 год. Бесчеловечный закон позволяет забирать детей из племени аборигенов и отсылать их за тысячи километров в специальные учреждения, где из них должны сделать покорных слуг для белых господ. Сестры Молли, Дейзи и их кузина Грейс совершают побег из охраняемого лагеря. Представители власти преследуют девочек. Сестрам предстоит пройти через всю Австралию вдоль бесконечной изгороди, которая защищает поселения от диких кроликов.',94,'6000000 $',12,796,7.351,7.4,'https://image.openmoviedb.com/kinopoisk-images/1704946/3d9184a0-8485-47dc-88f5-247696036190/orig','movie'),('2024-04-07 20:32:00.244117','2024-04-07 20:32:00.244117',12272,'Крысиные бега',2001,'Владелец крупнейшего казино Лас-Вегаса решает, что его самым богатым клиентам нужно нечто особенное. Он готовит для них нелегальный тотализатор - «Крысиные бега». Участники забега - обычные люди, случайно выбранные из толпы.\nОни получают шанс разбогатеть: кто первым доберется из Лас-Вегаса до захолустного городка Силвер-сити, тот получит 2 млн долларов, спрятанных в ячейке камеры хранения. Никто из соискателей и не догадывается, что за каждым их шагом следит хозяин казино и его клиенты, сделавшие собственные ставки на победителя…',112,'48000000 $',12,797,7.165,6.5,'https://image.openmoviedb.com/kinopoisk-images/1629390/73def333-6995-49fa-9ad3-39a1edaf7fd0/orig','movie'),('2024-04-07 20:32:00.921059','2024-04-07 20:32:00.921059',12273,'Красный Дракон',2002,'Агент ФБР Уилл Грэм получает тяжелые ранения при исполнении и покидает службу. Но через несколько лет его втягивают в новое расследование — в городе появился серийный убийца, которого пресса окрестила как Зубная фея. Чтобы поймать маньяка, Грэму приходится обратиться за помощью к Ганнибалу Лектеру.',124,'78000000 $',18,798,7.801,7.2,'https://image.openmoviedb.com/kinopoisk-images/1599028/6ecc7e26-6e71-4529-a604-0605bc41283e/orig','movie'),('2024-04-07 20:32:01.562176','2024-04-07 20:32:01.562176',12274,'Вспоминая Титанов',2000,'Германа Буна назначают новым тренером школьной команды по американскому футболу. Он — темнокожий, и многие белые игроки команды бойкотируют матчи и тренировки, пока их прежний наставник не соглашается занять должность ассистента Буна. Но это только первое препятствие на пути тренера и команды, которая должна стать единым целым, чтобы выиграть чемпионат штата.',113,'30000000 $',12,799,7.943,7.8,'https://image.openmoviedb.com/kinopoisk-images/6201401/62611f81-8192-4c42-98a7-8ad4b2cae46c/orig','movie'),('2024-04-07 20:32:02.200948','2024-04-07 20:32:02.201927',12275,'Дублеры',2000,'Еще вчера они были простыми работягами. Сейчас все изменилось: настал день их славы, когда, замещая бастующих профессионалов, они стали Дублерами. Невзрачные простаки превращаются в суперзвезд футбола!\r\n\r\nШэйну Фалько, профессионалу американского футбола, пришлось возглавить команду недотеп, собранную ветераном спорта Джимми Макгинти. Поддерживать боевой дух Дублеров собирается очаровательная Аннабель Фаррел и коллектив бывших стриптизерш. \r\n\r\n«Слава останется навечно. Девчонки будут сходить с ума», - говорит Фалько своим игрокам. Его план игры рассчитан безукоризненно. Их сила - в их непредсказуемости...',114,'50000000 $',16,800,7.55,6.6,'https://image.openmoviedb.com/kinopoisk-images/1704946/0d4f6aab-d592-4332-a00a-2920589ca6eb/orig','movie'),('2024-04-07 20:32:02.787534','2024-04-07 20:32:02.787534',12276,'Обитель зла',2002,'В гигантской подземной лаборатории выходит из-под контроля опаснейший вирус и мгновенно превращает своих жертв в прожорливых зомби. Достаточно одного их укуса или царапины, чтобы человек стал обезумевшим пожирателем живой плоти.\n\nВоенные посылают в кишащий голодными монстрами секретный комплекс отряд спецназа, к которому присоединяются Элис и полицейский Мэтт. У них есть только три часа, чтобы уничтожить вирус.',100,'33000000 $',18,801,7.56,6.6,'https://image.openmoviedb.com/kinopoisk-images/6201401/0da58a98-b9cb-4663-a320-6e6481a306b8/orig','movie'),('2024-04-07 20:32:03.507534','2024-04-07 20:32:03.507534',12277,'Вернись ко мне',2000,'Потребовалось немало усилий, чтобы заставить Боба, недавно овдовевшего архитектора, назначить «свидание вслепую». И тем не менее оно состоялось в незатейливой ирландско-итальянской забегаловке. Он был буквально сражен, но не дамой, с которой было назначено свидание, а остроумием официантки Грейс.\n\nНе без помощи дедушки, озабоченного замужеством внучки, Грейс и Боб встречаются. Их отношения расцветают, и кажется, что у наших влюбленных голубков все будет как нельзя лучше, пока не всплывает невероятная правда, такая, что легко может разбить их сердца навсегда.',115,'24000000 $',16,802,6.914,6.9,'https://image.openmoviedb.com/kinopoisk-images/1599028/12b34120-9f9d-4dca-8b11-9bd2eaeed19f/orig','movie'),('2024-04-07 20:32:04.137872','2024-04-07 20:32:04.137872',12278,'Сильная женщина',2001,'Умная и амбициозная девушка Беверли Донофрио мечтала о карьере писательницы. Но случайно забеременев в пятнадцать лет, она стала женой наркомана и была вынуждена практически в одиночку воспитывать не совсем желанного ребенка. Однако никакие горести не смогли заставить её опустить руки и потерять чувство юмора.',132,'48000000 $',18,803,7.263,6.5,'https://image.openmoviedb.com/kinopoisk-images/1704946/12eb2c55-e203-4e55-aac2-159c704b168a/orig','movie'),('2024-04-07 20:32:04.743400','2024-04-07 20:32:04.743400',12279,'Звонок',2002,'Телефонный звонок раздаётся после просмотра некой загадочной видеокассеты. Жертве даётся ровно семь дней, а после следует неминуемая смерть.\n\nЖурналистка Рэйчел расследует загадочные смерти молодых людей, и случайно кассета-убийца попадает в руки к её маленькому сыну, над которым теперь нависает смертельная угроза. У женщины есть только семь дней, чтобы разобраться в происходящем и спасти своего мальчика.',115,'48000000 $',18,804,7.256,7.1,'https://image.openmoviedb.com/kinopoisk-images/4303601/1de9a180-7e21-4443-bc12-918002876e41/orig','movie'),('2024-04-07 20:32:05.425588','2024-04-07 20:32:05.425588',12280,'Багровые реки',2000,'В престижном колледже в Альпах совершено зверское убийство, которое расследует опытный комиссар полиции Пьер Ньеманс. Тем временем в другом местечке происходит еще одно, весьма странное преступление - кто-то раскапывает и оскверняет могилу 10-летней девочки.\n\nЭто дело ведет молодой детектив Макс Керкерьян. Кажется, между данными событиями нет связи. Но она существует! И когда оба полицейских обнаруживают ее, доселе виденные ими заурядные злодеяния постепенно меркнут по сравнению с тем сердцем тьмы, куда приведут их поиски правды. Смертельно опасной правды...',106,'14000000 $',18,805,7.433,6.9,'https://image.openmoviedb.com/kinopoisk-images/4483445/824bf110-93c3-401d-bd3f-a20e8f5a5b31/orig','movie'),('2024-04-07 20:32:06.054530','2024-04-07 20:32:06.054530',12281,'Дорога на Эльдорадо',2000,'Тульо и Мигель – два отпетых мошенника, которые обожают, когда золотишко само идет к ним в руки. Однажды им посчастливилось найти таинственную карту, на которой обозначен величественный Город Золота, мифический Эльдорадо. Вместе со знаменитым конкистадором Эрнаном Кортесом приятели отправляются за сокровищами в рискованное путешествие к берегам далекой Америки.',89,'95000000 $',0,806,7.765,6.9,'https://image.openmoviedb.com/kinopoisk-images/4716873/282f675d-5b20-4464-8c37-3d2d343265b4/orig','cartoon'),('2024-04-07 20:32:06.973975','2024-04-07 20:32:06.973975',12282,'Дорожное приключение',2000,'Студент Джош изменил своей девушке Тиффани, которая учится в другом университете, записал весь процесс на камеру и случайно отправил видеокассету ей в подарок. Чтобы спасти отношения, нужно перехватить плёнку раньше, чем та попадёт в руки адресата. Прихватив троих друзей, Джош отправляется в марш-бросок на машине через всю Америку.',94,'16000000 $',18,807,7.09,6.5,'https://image.openmoviedb.com/kinopoisk-images/1898899/a917014c-dedb-4c4d-8137-395dfa10fd1f/orig','movie'),('2024-04-07 20:32:07.543080','2024-04-07 20:32:07.543080',12283,'Новичок',2002,'Фильм основан на реальной истории тренера, который в один прекрасный момент понимает, что осуществлять свои мечты никогда не бывает поздно. Джим Моррис никогда не поднимался выше младшей лиги после того, как травма плеча положила конец его карьере питчера почти двенадцать лет назад. \nТеперь он обзавелся женой и детьми, работает учителем химии в школе, а по совместительству является бейсбольным тренером техасской команды. \nИ вот удача: если команда Джима выиграет первенство штата, то у них есть шанс попасть в высшую лигу. Единственный шанс побуждает команду, ставшую из последней первой, на великие дела. Именно тогда Джим понимает, что его мечты начинают сбываться, и никак нельзя дать им остаться только в мыслях.',127,'22000000 $',12,808,7.084,6.9,'https://image.openmoviedb.com/kinopoisk-images/4303601/18316ae6-a27b-4893-83e4-354b36ba33ec/orig','movie'),('2024-04-07 20:32:08.197718','2024-04-07 20:32:08.197718',12284,'Семейка Тененбаум',2001,'Все члены семьи Тененбаум обладают уникальными способностями. Например, Чес уже в 10-летнем возрасте добился больших успехов в финансовой сфере, Ричи является одаренным теннисистом, Марго стала в 10 лет известным драматургом.\n\nДети выросли и выпорхнули из родительского гнезда, но семья решила воссоединиться, когда выяснилось, что отец семейства Роял Тененбаум страдает неизлечимой болезнью, и жить ему осталось чуть больше шести недель. За это время Роял постарается наверстать упущенное и уделить своим детям внимание, которым они были обделены в детстве.',110,'21000000 $',18,809,7.409,7.6,'https://image.openmoviedb.com/kinopoisk-images/1946459/e567dc6e-4388-4b8a-a293-913d6e6bfcb7/orig','movie'),('2024-04-07 20:32:08.774811','2024-04-07 20:32:08.774811',12285,'Правила секса',2002,'Шон Бэйтман позволяет себе только мимолётные связи, полагая, что любит только одну девушку. Пол Дантен - интеллигентный и циничный молодой распутник, думает, что влюблён в Шона. Лорен Хинд - последняя девственница в институте, мечтает о Викторе. Молодые студенты легко переступают через правила, но у их историй не самый счастливый конец.',110,'4000000 $',18,810,6.626,6.6,'https://image.openmoviedb.com/kinopoisk-images/1898899/9b9e3e37-e064-4d1e-8474-d345ad1c0455/orig','movie'),('2024-04-07 20:32:09.457428','2024-04-07 20:32:09.457428',12286,'Правила боя',2000,'Йемен, 1996 год. Полковник морской пехоты Терри Чилдерс с отрядом морпехов получает задание эвакуировать посла США и его семью, поскольку демонстрация исламистов у стен американского посольства быстро выходит из-под контроля. Вскоре наиболее радикальные демонстранты начинают обстреливать посольство, а отряд Чилдерса оказывается под огнём и несёт потери. Чилдерс приказывает открыть ответный огонь по толпе, что приводит к смерти 83 демонстрантов и большому количеству тяжело раненых, среди которых женщины и дети. Разгорается международный скандал, и советник президента США по национальной безопасности Билл Сокал, чтобы прикрыть тылы, решает повесить всех собак на Чилдерса. По прибытии полковника обвиняют в неправомерном убийстве мирных жителей, и теперь его будет судить военный трибунал. Чилдерс просит старого друга и боевого товарища полковника Хейза Ходжеса быть его адвокатом. Хейз, который уже одной ногой на пенсии, не может отказать Терри, поскольку тот в 1968 году спас ему жизнь во Вьетнаме.',128,'60000000 $',16,811,7.015,6.4,'https://image.openmoviedb.com/kinopoisk-images/1946459/26cea181-1fbb-4dd6-b88e-461f8ebdeb53/orig','movie'),('2024-04-07 20:32:10.268092','2024-04-07 20:32:10.268092',12287,'Час пик 2',2001,'Полицейские Ли и Картер прибывают в Гонконг по следам преступников, замышляющих похищение китайских сокровищ и их продажу в США. По мере того как детективы всё больше и больше запутываются в преступном заговоре, поездка от Гонконга до Лос-Анджелеса и Лас-Вегаса оборачивается для них опасным и интересным приключением.',90,'90000000 $',12,812,7.422,6.7,'https://image.openmoviedb.com/kinopoisk-images/1704946/877c4130-3b42-4937-bce9-a177f085d918/orig','movie'),('2024-04-07 20:32:10.983605','2024-04-07 20:32:10.983605',12288,'Симона',2002,'Съемки фильма поставлены под угрозу срыва, когда актриса, предполагавшаяся на главную роль, отказывается сниматься. Режиссер решает заменить ее цифровой актрисой Симоной, созданной с помощью компьютера.\n\nОднако все принимают искусственную девушку за настоящую. На волне внезапного успеха Симоны режиссер не осмеливается раскрыть свой обман ни окружающим... ни самому себе.',117,'{}',16,813,7.092,6.1,'https://image.openmoviedb.com/kinopoisk-images/1946459/25a93c76-fbaf-4e8a-b4a8-cf46e527cde8/orig','movie'),('2024-04-07 20:32:11.640395','2024-04-07 20:32:11.640395',12289,'Море Солтона',2001,'Дэнни Паркер &#151; стукач. Уже долгое время он ходит по краю в клоаке криминального мира, сдавая полиции наркоторговцев. Но у него есть веский мотив продолжать. Мотив, который может стоить ему жизни.',103,'18000000 $',16,814,6.939,7,'https://image.openmoviedb.com/kinopoisk-images/1777765/1d21dd12-31b7-48e1-8aeb-a0c82774a993/orig','movie'),('2024-04-07 20:32:12.318016','2024-04-07 20:32:12.318016',12290,'Санта Клаус 2',2002,'Вот уже восемь лет Скотт Кэлвин работает Санта Клаусом не покладая рук и как следует вошел во вкус. Однако это не значит, что у него не осталось никаких забот. На подступах к очередному Новому году герой вдруг открывает, что его сын Чарли растет хулиганом, а сам он согласно контракту обязан безотлагательно найти себе миссис Клаус, потому что холостой Санта - нарушение всех мыслимых правил.\nВдобавок, пытаясь одновременно решить возникшие проблемы, он неосторожно поручает дела двойнику, который в его отсутствие превращает жизнь на полюсе в полный хаос!',100,'65000000 $',12,815,6.208,5.7,'https://image.openmoviedb.com/kinopoisk-images/4774061/8265dda8-59ff-429e-b099-4108a4fce08c/orig','movie'),('2024-04-07 20:32:12.991289','2024-04-07 20:32:12.991289',12291,'За мной последний танец',2001,'У Сары была заветная мечта. Этой хрупкой девушке из маленького городка безумно хотелось стать знаменитой балериной. Но жизнь распорядилась иначе, и Саре пришлось отказаться от своих грез. Вскоре девушка переезжает к отцу в Чикаго, в опасный «черный» квартал.\n\nСара начинает ходить в «неблагополучную» школу, где подавляющее большинство учащихся - афроамериканцы. Она знакомится с приятным молодым человеком по имени Дерек Рейнольдс и его красивой сестрой. Вместе с новыми знакомыми Сара отправляется на местную дискотеку. Однако балетные па Сары здесь успеха не имеют, и опытный танцор Дерек предлагает обучить девушку всем премудростям хип-хопа.\n\nСара оказалась прекрасной ученицей, но неожиданно для себя начала испытывать то, что американцы называют «лихорадкой джунглей». Учитель девушки становится ее возлюбленным.',112,'13000000 $',12,816,7.241,6.2,'https://image.openmoviedb.com/kinopoisk-images/1773646/1b85663d-7603-4cca-a7e9-67a7e0710a95/orig','movie'),('2024-04-07 20:32:13.620700','2024-04-07 20:32:13.620700',12292,'Спасите Грейс',1999,'У Грейс было свое маленькое уютное счастье: дом и садик с оранжереей. Когда ее гулящий муж свел счеты с жизнью, она с ужасом узнала, что супруг не оставил ей ни пенни, только ужасные долги. Выход из создавшегося положения подсказал Грейс ее собственный газонокосильщик Мэтью – Грейс потрясающий садовник: о ее оранжерее местные жители рассказывают легенды. А когда у заядлого «курильщика» Мэтью стал увядать подпольно выращенный кустик конопли, он понял, что Грейс - единственная, кто может спасти растение.  ',93,'10000000 $',16,817,7.004,6.9,'https://image.openmoviedb.com/kinopoisk-images/1704946/9d509c91-9465-47f7-8333-f771b0c33430/orig','movie'),('2024-04-07 20:32:14.217950','2024-04-07 20:32:14.217950',12293,'Мокасины Маниту',2001,'Подлинная и леденящая душу история про кровных братьев Абахачи и Рейнджера, про славные племена апачей и шошонов, про очень-очень плохого белого парня Санта Марию, про голубого краснокожего Виннетуха, про великого вождя Хитрого Слизняка и его безвременно погибшего сына Трусливого Кролика, про несметные сокровища, завещанные Абахачи его дедушкой по имени Бешеная Корова, про то, как старый хрен учил любимого внука делиться и Абахачи честно разделил карту с указанием клада на четыре части, но был настолько пьян, что никак не может вспомнить, куда девал остальные три...',87,'7000000 DEM',12,818,6.775,6.7,'https://image.openmoviedb.com/kinopoisk-images/1946459/bc237b81-8bf1-43a7-9c47-49f825ea43c2/orig','movie'),('2024-04-07 20:32:14.858125','2024-04-07 20:32:14.858125',12294,'Медвежатник',2001,'Ник Уэллс – профессиональный взломщик сейфов. Он хочет порвать с криминальным прошлым, но его старый партнёр по нелегальному бизнесу Макс вынуждает его приступить к подготовке нового преступления. На этот раз целью злоумышленников становится скипетр французской королевской династии Бурбонов.',124,'68000000 $',18,819,7.22,6.8,'https://image.openmoviedb.com/kinopoisk-images/1629390/0473c7b0-147b-4578-b683-3755f077df30/orig','movie'),('2024-04-07 20:32:15.565300','2024-04-07 20:32:15.565300',12295,'Секретарша',2001,'Ли Холловэй возвращается в родной город. Она страдает небольшими отклонениями в поведении, однако это не мешает ей устроиться на работу секретарём к местному юристу мистеру Грэю. Поначалу работа кажется Ли вполне обычной, пока мистер Грэй не замечает у неё проблем с грамматикой и не решает исправить их своими особыми методами.',107,'4000000 $',18,820,6.997,6.9,'https://image.openmoviedb.com/kinopoisk-images/1704946/dd94cf95-a555-4d34-bee1-9c183442a756/orig','movie'),('2024-04-07 20:32:16.198083','2024-04-07 20:32:16.198083',12296,'Интуиция',2001,'В один суматошный зимний день в нью-йоркской толпе Джонатан встретил Сару. Два незнакомых человека в объятом рождественской лихорадкой городе обнаруживают, что их неодолимо тянет друг к другу. И они решают проверить судьбу: он пишет свой телефон на банкноте, она — в книге. Купюру разменивают, а книгу сдают букинисту. Джонатан и Сара уверены, что скоро увидятся вновь.',87,'28000000 $',12,821,7.705,6.8,'https://image.openmoviedb.com/kinopoisk-images/10835644/f18d54e4-5f26-4b0d-9436-147ba92b33cf/orig','movie'),('2024-04-07 20:32:16.782296','2024-04-07 20:32:16.782296',12297,'Серия 7: Претенденты',2001,'',86,'{}',16,822,5.299,6.5,'https://image.openmoviedb.com/kinopoisk-images/1599028/e4686c22-4408-4213-93d0-3145936244a6/orig','movie'),('2024-04-07 20:32:17.366684','2024-04-07 20:32:17.366684',12298,'Девятая сессия',2001,'Бригада по уничтожению асбеста получила выгодный контракт на очистку заброшенной психиатрической лечебницы. Лихо взявшись за работу, парни не ожидали, что в мрачных подвалах, заброшенных хранилищах и сырых палатах старой больницы до сих пор жива атмосфера ужаса и ненависти, переполнявшей измученные души больных, которые когда-то жили и умерли здесь.\n\nЗа несколько дней гнетущая аура этого жуткого места превратит лучших друзей в заклятых врагов и параноиков, ставших жертвами убийственного безумия.',100,'1500000 $',18,823,5.742,6.4,'https://image.openmoviedb.com/kinopoisk-images/1773646/a29c408a-04f4-411f-8fc6-eebb6239e808/orig','movie'),('2024-04-07 20:32:17.990615','2024-04-07 20:32:17.990615',12299,'Сексуальная тварь',2000,'Проведя почти всю жизнь за решёткой, гангстер Гэл Доув решил уйти на покой и вместе с любимой женой поселиться в Испании. Но однажды к нему явился незваный гость. Приятель Гэла, бритоголовый Дон Логан, намерен заставить его вернуться в Лондон, чтобы провернуть последнее, но очень крупное дело — настоящее «ограбление века».',89,'{}',18,824,6.725,7.3,'https://image.openmoviedb.com/kinopoisk-images/4486362/a6fae2ec-c419-4a66-92a5-01071f9f2333/orig','movie'),('2024-04-07 20:32:18.676067','2024-04-07 20:32:18.676067',12300,'Тень вампира',2000,'Лента рассказывает о создании известного фильма «Носферату», в котором, по слухам, главную роль графа Орлока сыграл настоящий вампир. В этом повествовании собрано всё, что известно о таинственных событиях, произошедших на съёмках в горах Чехословакии.',95,'8000000 $',16,825,6.798,6.9,'https://image.openmoviedb.com/kinopoisk-images/1599028/0e164172-f39b-438c-b034-a83bddbc9b19/orig','movie'),('2024-04-07 20:32:19.333592','2024-04-07 20:32:19.333592',12301,'Детектив Шафт',2000,'Детектив Джон Шафт известен своей жесткой манерой обхождения с преступниками. На этот раз ему досталось сложное дело. Шафту нужно усадить за решетку безжалостного убийцу - сына влиятельного миллионера – и найти единственного свидетеля, который ему в этом поможет. Но свидетельница Дайан Палмиери запугана и не хочет давать показания.',99,'46000000 $',16,826,6.446,6,'https://image.openmoviedb.com/kinopoisk-images/1599028/904021a3-86de-4e19-b942-10453722fa9a/orig','movie'),('2024-04-07 20:32:19.973781','2024-04-07 20:32:19.973781',12302,'Любовь зла',2001,'Для Хэла Ларсена начать длительные отношения с девушкой очень сложно, причем, виновата в этом даже не его не самая презентабельная внешность, а собственные чересчур завышенные запросы. Но жизнь Хэла меняется после неожиданной встречи в лифте - его случайный попутчик «открывает ему глаза», наделяя способностью видеть не внешнюю оболочку людей, а их внутреннюю красоту.\n\nНе подозревая о произошедшей с ним перемене, Хэл знакомится с Розмари, которая кажется ему настоящей красавицей, к тому же она умна, забавна и очень добра. Вот только окружающие вместо худенькой и стройной девушки видят необъятных размеров «слониху», под которой то и дело ломаются стулья...',109,'40000000 $',12,827,6.968,6,'https://image.openmoviedb.com/kinopoisk-images/1773646/19ff20d6-2e0b-431a-bae0-a7b470f48276/orig','movie'),('2024-04-07 20:32:20.725119','2024-04-07 20:32:20.725119',12303,'Шанхайские рыцари',2003,'Предатель убивает отца Чона Ванга и убегает в Англию. Чон и Рой О’Баннон отправляются в Лондон, чтобы отомстить злодею. Одновременно сестра Чона Лин раскрывает заговор против королевской семьи, но ей почти никто не верит. Чону же нужно решить тяжёлые задачи: как отомстить за смерть отца и удержать склонного к флирту Роя подальше от сестры.',114,'50000000 $',12,828,7.291,6.2,'https://image.openmoviedb.com/kinopoisk-images/1629390/3e99da2a-ced7-462d-b649-5e8866aec856/orig','movie'),('2024-04-07 20:32:21.416483','2024-04-07 20:32:21.416483',12304,'Шанхайский полдень',2000,'Когда прекрасную китайскую принцессу похищают, Император отправляет на Дикий Запад троих самых верных и искусных телохранителей. Чон Ванг, естественно, не оказывается в их числе. Но тайными путями ему всё-таки удаётся попасть в воинственную делегацию и оказаться в самом сердце Америки и непредсказуемых событий.\n\nВместе со случайным напарником китайский телохранитель попадает во всевозможные переделки; между делом он помогает племени Сиу, выкуривает трубку мира и тут же оказывается на тропе войны, по которой пробегают его многочисленные враги.',110,'55000000 $',12,829,7.559,6.6,'https://image.openmoviedb.com/kinopoisk-images/1629390/edd6fcad-d5e7-4239-9401-4bf9334825a2/orig','movie'),('2024-04-07 20:32:22.148818','2024-04-07 20:32:22.148818',12305,'Корабельные новости',2001,'Неудачнику Койлу в очередной раз не везёт. Его новая девушка Петел устраивает в его жизни полный бедлам. Чтобы начать всё с нуля, Койл покидает Нью-Йорк. Но, к своему удивлению, оказывается на пороге тайн загадочного прошлого.',111,'38000000 $',18,830,7.041,6.7,'https://image.openmoviedb.com/kinopoisk-images/1599028/348afe55-4572-488a-81e1-5615541c457d/orig','movie'),('2024-04-07 20:32:22.759645','2024-04-07 20:32:22.759645',12306,'Тротуары Нью-Йорка',2001,'Телевизионный продюсер Томми, порвавший со своей подружкой, знакомится в магазине с ветреной Марией, бросившей мужа. При этом Томми поддерживает любовную связь с Энни, агентом по недвижимости, с которой завязал отношения во время поисков новой квартиры.\n\nМуж Энни, 39-летний Гриффин изменяет жене с 19-летней официанткой Эшли. Но Эшли больше влечет к музыканту и по совместительству гостиничному швейцару Бену. Этот роман должен помочь ему восстановить уверенность в себе после развода с женой, той самой Марией из магазина...',108,'1000000 $',16,831,6.123,6.4,'https://image.openmoviedb.com/kinopoisk-images/1773646/169a067a-c167-4b3f-a27b-5d7a92b5c959/orig','movie'),('2024-04-07 20:32:23.346713','2024-04-07 20:32:23.346713',12307,'Знаки',2002,'Жизнь никогда не баловала фермера Грэма Хесса удивительными событиями и происшествиями. Ровно до того дня, когда он увидел, что его кукурузное поле испещрено непостижимыми, гигантскими знаками из примятых стеблей. Жители маленького городка в Пенсильвании пытаются найти разгадку этого феномена. Но никто не жаждет найти ее так страстно, как сам фермер, ведь фантастические события, происходящие на его поле бросают вызов всему, что он знает и во что он верит в этом мире. Хесс начинает личное расследование, еще не ведая, какие невообразимые, пугающие ответы получит он на свои вопросы...',106,'72000000 $',12,832,6.966,6.8,'https://image.openmoviedb.com/kinopoisk-images/1773646/515d2dd3-eedb-46cb-91f2-5f7e423d34b7/orig','movie'),('2024-04-07 20:32:24.016658','2024-04-07 20:32:24.016658',12308,'Убойный футбол',2001,'Шесть братьев под руководством опытного футбольного тренера создают непобедимую команду. Объединив неоценимый опыт древних мастеров кунг-фу и современную тактику футбольного боя, они подают заявку на участие в престижном футбольном первенстве с призом в миллион долларов.',85,'10000000 $',18,833,6.968,7.3,'https://image.openmoviedb.com/kinopoisk-images/1773646/3410e122-a1a1-46a5-bec2-d52219dc150c/orig','movie'),('2024-04-07 20:32:24.715633','2024-04-07 20:32:24.715633',12309,'Мелкие мошенники',2000,'Мойщик посуды по профессии, а в душе аферист и мелкий воришка Рэй задумывает невероятную авантюру. Вместе с женой Фрэнсис и компанией таких же, как он сам, «деловых людей» он решается прокопать подземный тоннель и ограбить банк.\n\nДля прикрытия этой операции Рэй с женой открывают сначала пиццерию, а затем булочную на той же улице, где расположен банк. И пока Рэй с друзьями выдают на-гора породу, прорывая тоннель, его жена с успехом осваивает новый бизнес. А когда замысловатое ограбление оказывается на грани срыва, судьба преподносит незадачливым мошенникам неожиданный сюрприз…',94,'25000000 $',12,834,7.001,6.7,'https://image.openmoviedb.com/kinopoisk-images/6201401/934e7563-fcb8-4c54-85af-29e9248b2cdc/orig','movie'),('2024-04-07 20:32:25.305222','2024-04-07 20:32:25.305222',12310,'Солярис',2002,'На космическую станцию, движущуюся по орбите загадочной планеты Солярис, прибывает психолог Крис Кельвин. Его цель — понять, что за необъяснимые вещи происходят с работающими там учеными. Крис обнаруживает, что руководитель экспедиции и его старый друг погиб при таинственных обстоятельствах. А вскоре он сам сталкивается с силой, стоящей за гранью человеческого понимания.',95,'47000000 $',12,835,6.058,6.2,'https://image.openmoviedb.com/kinopoisk-images/1629390/3c1c82b5-6510-4fd0-9773-e71525de2721/orig','movie'),('2024-04-07 20:32:25.983324','2024-04-07 20:32:25.983324',12311,'Космические ковбои',2000,'В 1958 году четверых отважных пилотов, которые должны были первыми отправиться в космос, в результате интриг отстранили от полетов навсегда. Сорок лет о них никто не вспоминал, но вот, получено сообщение: старый советский спутник связи может рухнуть на землю.\nГрозит катастрофа невиданных масштабов. Технология спутника настолько устарела, что разобраться здесь могут только четверо астронавтов-отставников.',130,'65000000 $',12,836,6.589,6.5,'https://image.openmoviedb.com/kinopoisk-images/1599028/d01fbbd1-142d-4936-bb7a-cfa7bf3503d8/orig','movie');
